(1, ' Pengaruh current ratio dan quick ratio terhadap kebijakan dividen melalui return on equity pada perusahaan manufaktur yang terdaftar di bei tahun 2014  	', 'Tujuan dari penelitian ini yaitu untuk mengetahui bagaimana kondisi kebijakan dividen  return on equity  current ratio  dan quick ratio pada perusahaan manufaktur yang terdaftar di bei tahun       Selain itu untuk mengetahui pengaruh current ratio dan quick ratio terhadap kebijakan dividen melalui return on equity  Penelitian ini tergolong kuantitatif bersifat asosiatif kausalitas  Populasi penelitian ini yaitu seluruh perusahaan manufaktur yang terdaftar di bei tahun      sebanyak     perusahaan dan sampel penelitian ini sebanyak    perusahaan dengan menggunakan metode purposive sampling  Tehnik pengumpulan data yang digunakan peneliti adalah tehnik dokumentasi  Analisis yang digunakan dalam penelitian ini adalah analisis jalur  path analysis   Hasil penelitian menunjukkan     kondisi kebijakan dividen dan roe perusahaan sampel tergolong baik     kondisi cr dan qr perusahaan sampel kurang baik     cr tidak berpengaruh langsung terhadap kebijakan dividen  namun berpengaruh tidak langsung melalui roe  dan    qr tidak berpengaruh positif signifikan terhadap kebijakan dividen dan roe ', 'bijak dividen  return on equity  current ratio  quick ratio usaha manufaktur daftar bei       current ratio quick ratio bijak dividen return on equity  golong kuantitatif sifat asosiatif kausalitas  populasi usaha manufaktur daftar bei          usaha sampel    usaha purposive sampling  tehnik kumpul data teliti tehnik dokumentasi  analisis analisis jalur  path analysis       bijak dividen roe usaha sampel golong     cr qr usaha sampel     cr pengaruh langsung bijak dividen  pengaruh langsung roe     qr pengaruh positif signifikan bijak dividen roe  ', 1),
(2, 'Pengaruh motif, lokasi dan kualitas layanan terhadap keputusan pemilihan fitness center (studi pada member fitness center best gym malang) ', 'Tujuan penelitian ini adalah untuk mengetahui kondisi motif lokasi kualitas layanan dan keputusan pemilihan konsumen pada fitness center pada member best gym pengaruh motif terhadap keputusan pemilihan fitness center pada member best gym pengaruh lokasi terhadap keputusan pemilihan fitness center pada member best gym pengaruh kualitas layanan terhadap keputusan pemilihan fitness center pada member best gym terdapat variabel yang berpengaruh dominan terhadap keputusan pemilihan fitness center pada member best gym Rancangan penelitian menggunakan penelitian deskriptif korelasional Rancangan penelitian menggunakan penelitian deskriptif korelasional Dengan menggunakan rumus slovin diperoleh sampel sebanyak responden Tehnik pengambilan sampel dengan simple random sampling Analisis data menggunakan analisis regresi berganda Temuan penelitian menunjukkan motif pada member fitness center best gym malang tinggi lokasi fitness center best gym malang strategis dan kualitas layanan dipersepsikan baik oleh member fitness center best gym malang terdapat pengaruh positif signifikan motif terhadap keputusan pemilihan fitness center pada member best gym malang terdapat pengaruh positif signifikan lokasi terhadap keputusan pemilihan fitness center pada member best gym malang terdapat pengaruh positif signifikan kualitas terhadap keputusan pemilihan fitness center pada member best gym malang terdapat variabel yang pengaruhnya dominan terhadap keputusan pemilihan fitness center pada member dari best gym ', 'an     motif  lokasi  layan konsumen fitness center member best gym     motif fitness center member best gym     lokasi fitness center member best gym     layan fitness center member best gym     variabel pengaruh dominan fitness center member best gym  rancang deskriptif korelasional  rancang deskriptif korelasional  rumus slovin  sampel     responden  tehnik sampel simple random sampling  analisis data analisis regresi ganda  temu     motif member fitness center best gym malang  lokasi fitness center best gym malang strategis  layan persepsi member fitness center best gym malang     positif signifikan motif fitness center member best gym malang     positif signifikan lokasi fitness center member best gym malang     positif signifikan fitness center member best gym malang     variabel pengaruh dominan fitness center member best gym  ', 1),
(3, 'Pengaruh penggunaan peringatan visual dalam desain kemasan terhadap keputusan pembelian dengan respon emosional sebagai variabel pemediasi ', 'Penelitian ini untuk mengetahui pengaruh penggunaan peringatan visual dalam desain kemasan produk terhadap keputusan pembelian dengan emosional sebagai variabel pemediasi  Populasi pada penelitian ini adalah pembeli rokok sampoerna a mild di warung kopi waris tulungagung dengan sampel     orang  Pedoman ukuran sampel menggunakan teknik maximum likehood dengan teknik simpel random sampling  Teknik analisis data menggunakan model persamaan struktural  structural equation modelling   Hasil penelitian menunjukkan bahwa peringatan visual dalam desain kemasan terbukti berpengaruh negatif dan tidak signifikan terhadap keputusan pembelian rokok sampoerna a mild  Peringatan visual dalam desain kemasan rokok sampoerna a mild terbukti tidak berpengaruh signifikan terhadap respon emosional  Respon emosional berpengaruh positif dan signifikan terhadap keputusan pembelian rokok sampoerna a mild  Respon emosional tidak memediasi pengaruh peringatan visual dalam desain kemasan rokok sampoerna a  mild terhadap keputusan pembelian ', 'guna ingat visual desain kemas produk beli emosional variabel mediasi  populasi beli rokok sampoerna mild warung kopi waris tulungagung sampel     orang  pedoman ukur sampel teknik maximum likehood teknik simpel random sampling  teknik analisis data model persamaan struktural  structural equation modelling   ingat visual desain kemas bukti pengaruh negatif signifikan beli rokok sampoerna mild  ingat visual desain kemas rokok sampoerna mild bukti pengaruh signifikan respon emosional  respon emosional pengaruh positif signifikan beli rokok sampoerna mild  respon emosional mediasi ingat visual desain kemas rokok sampoerna  mild beli  ', 1),
(4, '  Pengaruh brand exposure dan brand experience terhadap brand trust dan brandrecall (studi pada produk smartphone di wilayah kota malang)', 'Tujuan dari penelitian ini adalah untuk mengetahui pengaruh brand exposure dan brand experience terhadap brand trust dan brand recall pada produk smartphone kategori high end  Jumlah sampel pada penelitian ini adalah sebanyak     responden pengguna smartphone kategori high end di kota malang  Penelitian ini menggunakan teknik purposive sampling dengan kriteria sebagai berikut      berdomisili di kota malang      telah berusia minimal    tahun  dan     menggunakan smartphone kategori high end  Teknik analisis data dilakukan dengan menggunakan partial least square  pls  dengan smartpls      Hasil penelitian ini menunjukkan bahwa terdapat pengaruh yang signifikan pada hubungan brand experience terhadap brand recall  brand experience terhadap brand trust  brand trust terhadap brand recall dan tidak terdapat pengaruh yang signifikan pada hubungan brand exposure terhadap brand recall dan brand exposure terhadap brand trust  Selain itu hasil penelitian ini juga menunjukkan bahwa brand trust memediasi secara signifikan hubungan antara brand experience dan brand recall  dan brand trust tidak memediasi secara signifikan hubungan antara brand exposure dan brand recall ', 'brand exposure brand experience brand trust brand recall produk smartphone kategori high end  sampel     responden guna smartphone kategori high end kota malang  teknik purposive sampling kriteria      domisili kota malang      usia minimal         smartphone kategori high end  teknik analisis data partial least square  pls  smartpls      signifikan hubung brand experience brand recall  brand experience brand trust  brand trust brand recall signifikan hubung brand exposure brand recall brand exposure brand trust  brand trust mediasi signifikan hubung brand experience brand recall  brand trust mediasi signifikan hubung brand exposure brand recall  ', 1),
(6, ' Pengaruh kepuasan kerja dan keterlibatan kerja terhadap organizational citizenship behavior (ocb) karyawan pt. Telekomunikasi indonesia, tbk. Witel jatim selatan malang ', 'Penelitian ini bertujuan     mendeskripsikan kepuasan kerja  keterlibatan kerja dan ocb karyawan      mengetahui pengaruh kepuasan kerja terhadap ocb karyawan      mengetahui pengaruh keterlibatan kerja terhadap ocb karyawan  Penelitian ini menggunakan metode deskriptif kuantitatif  Populasi dalam penelitian ini adalah seluruh karyawan pt  Telekomunikasi indonesia tbk  witel jatim selatan malang sejumlah     karyawan dengan sampel sebanyak    karyawan yang ditentukan berdasarkan teknik proportionate random sampling  Instrumen penelitian menggunakan skala likert dan teknik analisis data dengan regresi linier berganda  Hasil penelitian menunjukkan      tingkat kepuasan kerja dan ocb karyawan dalam kategori sangat tinggi  dan tingkat keterlibatan kerja dalam kategori tinggi      kepuasan kerja berpengaruh secara positif dan signifikan terhadap ocb karyawan      keterlibatan kerja berpengaruh secara positif dan signifikan terhadap ocb karyawan ', '    deskripsi puas kerja  kerja ocb karyawan      puas kerja ocb karyawan      kerja ocb karyawan  deskriptif kuantitatif  populasi karyawan pt  telekomunikasi indonesia tbk  witel jatim selatan malang     karyawan sampel    karyawan tentu dasar teknik proportionate random sampling  instrumen skala likert teknik analisis data regresi linier ganda       tingkat puas kerja ocb karyawan kategori  tingkat kerja kategori      puas kerja pengaruh positif signifikan ocb karyawan      kerja pengaruh positif signifikan ocb karyawan  ', 1),
(7, ' Pengaruh return on equity, debt to equity ratiodan umur perusahaan terhadap kebijakan dividen (studi pada perusahaan manufaktur yang terdaftar di bei tahun 2014) 	', 'Tujuan penelitian ini adalah untuk mengetahui pengaruh secara parsial return on equity  roe  dan debt to equity ratio  der  terhadap kebijakan dividen serta umur perusahaan sebagai variabel yang memoderasi pengaruh roe dan der terhadap kebijakan dividen  Populasi penelitian ini adalah perusahaan manufaktur yang terdaftar di bursa efek indonesia  bei  tahun      sebanyak     perusahaan  Pengambilan sampel dilakukan dengan teknik purposive sampling sehingga dihasilkan    perusahaan  Analisis data yang digunakan adalah analisis regresi berganda dan analisis moderasi menggunakan uji residual  Hasil penelitian menunjukkan bahwa roe tidak berpengaruh signifikan terhadap kebijakan dividen  der berpengaruh negatif signifikan terhadap kebijakan dividen  sedangkan umur perusahaan tidak memoderasi pengaruh roe terhadap kebijakan dividen dan pengaruh der terhadap kebijakan dividen ', 'parsial return on equity  roe  debt to equity ratio  der  bijak dividen umur usaha variabel memoderasi roe der bijak dividen  populasi usaha manufaktur daftar bursa efek indonesia  bei           usaha  sampel teknik purposive sampling hasil    usaha  analisis data analisis regresi ganda analisis moderasi uji residual  roe pengaruh signifikan bijak dividen  der pengaruh negatif signifikan bijak dividen  umur usaha memoderasi roe bijak dividen der bijak dividen  ', 1),
(8, ' Dampak motivasi dan kepuasan terhadap prestasi: pengujian teori motivasi determinasi diri (self determination theory)	', 'Di indonesia sepakbola belum menjadi industri yang mendorong perekonomian karena prestasi tim sepakbola di indonesia yang belum optimal dan konsisten Ketidakkonsistenan prestasi tim sepakbola erat dikaitkan dengan pengelolaan tim dan prestasi atletnya karena prestasi tim sepakbola mencerminkan akumulasi prestasi atletnya Dua hal yang ditengarai mempengaruhi prestasi atlet sepakbola adalah motivasi dan kepuasan atlet Oleh karena itu penelitian ini bertujuan untuk menguji pengaruh motivasi dan kepuasan atlet terhadap prestasi atlet sepakbola dengan dasar teori motivasi determinasi diri self determination theory Penelitian ini menggunakan survey dengan kuesioner untuk mengumpulkan data dari seluruh atlet tim sepakbola metro fc kabupaten malang dan analisis regresi linear berganda untuk menguji kedua hipotesis Hasil penelitian menunjukkan bahwa kedua hipotesis didukung motivasi dan kepuasan atlet berpengaruh positif signifikan terhadap prestasi atlet sepakbola Penelitian ini juga mendukung generalisasi teori determinasi diri yang menyatakan bahwa seseorang yang memiliki determinasi diri yang kuat keteguhan hati dan kebulatan tekad akan memiliki motivasi diri yang tinggi yang kuat untuk mencapai tujuan yang telah ditetapkan', 'indonesia  sepakbola industri ekonomi prestasi tim sepakbola indonesia optimal konsisten  ketidakkonsistenan prestasi tim sepakbola erat kait kelola tim prestasi atlet  prestasi tim sepakbola cermin akumulasi prestasi atlet  tengara pengaruh prestasi atlet sepakbola motivasi puas atlet   uji motivasi puas atlet prestasi atlet sepakbola  dasar teori motivasi determinasi  self determination theory   survey kuesioner kumpul data atlet tim sepakbola metro fc kabupaten malang analisis regresi linear ganda uji hipotesis  hipotesis dukung  motivasi puas atlet pengaruh positif signifikan prestasi atlet sepakbola   dukung generalisasi teori determinasi milik determinasi kuat  teguh hati bulat tekad   milik motivasi kuat capai tetap  ', 1),
(9, '  Institusionalisasi internal audit capability model pada aparat pengawasan intern pemerintah  (studi kasus di kementerian luar negeri)	', 'Penelitian ini bertujuan untuk memperoleh pemahaman tentang institusionalisasi internal audit capabilty model  iacm  pada apip kementerian luar negeri dan implikasinya  dimana iacm merupakan tools untuk menilai dan meningkatkan kapabilitas apip yang dilakukan secara mandiri  dengan menggunakan strategi penelitian studi kasus berdasarkan proposisi teoritis  Dimana latar belakang institusionalisasi iacm dianalisis dengan menggunakan teori institusional  dan implikasi yang terjadi dianalisis dengan teori perubahan organisasi berdasarkan tahapan perubahan menurut lewin         Hasil penelitian menunjukkan bahwa coercive isomorphism menjadi gejala terkuat yang mendorong dilakukannya institusionalisasi iacm  Tekanan berasal dari bpkp yang merupakan lead agency apip  dan arahan presiden ri yang telah menetapkan target capaian tingkat kapabilitas apip nasional di tahun       Melihat model tahapan perubahan lewin        disini apip dipaksa melewati beberapa fase perubahan terhadap organisasinya melalui asssessment iacm  Implikasi yang terlihat apip terbantu memetakan rencana aksi yang akan dilakukan untuk memperbaiki dan meningkatkan tingkat kapabilitasnya', 'paham institusionalisasi internal audit capabilty model  iacm  apip menteri negeri implikasi  iacm tools nilai tingkat apip mandiri  strategi studi dasar proposisi teoritis  latar institusionalisasi iacm analisis teori institusional  implikasi analisis teori rubah organisasi dasar tahap rubah lewin         coercive isomorphism gejala kuat laku institusionalisasi iacm  tekan asal bpkp lead agency apip  arah presiden ri tetap target capai tingkat apip nasional       model tahap rubah lewin        apip paksa fase rubah organisasi asssessment iacm  implikasi apip bantu meta rencana aksi baik tingkat tingkat kapabilitasnya ', 1),
(10, ' Pengaruh brand trust, brand image, perceived quality, brand loyalty terhadap brand equity pengguna telkomsel', 'Penelitian ini bertujuan untuk menguji beberapa pengaruh antara lain brand trust terhadap brand equity  brand image terhadap brand equity  perceived quality terhadap brand equity  brand trust terhadap brand loyalty  brand image terhadap brand loyalty  perceived quality terhadap brand loyalty  dan brand loyalty terhadap brand equity  Rancangan penelitian yang digunakan adalah deskriptif dan eksplanatori dengan pendekatan kuantitatif  Jumlah sampel sebesar    mahasiswa s  dan s  fakultas ekonomi dan bisnis universitas brawijaya angkatan      sesuai dengan karakteristik populasi yaitu mahasiswa pengguna telkomsel minimal   tahun dan aktif melakukan pengisian ulang  Metode pengumpulan data menggunakan teknik wawancara dan kuesioner  dengan pengolahan data menggunakan partial least square  pls   Hasil penelitian menunjukkan adanya pengaruh signifikan antara variabel brand trust terhadap brand equity  brand image terhadap brand equity  perceived quality terhadap brand equity  brand trust terhadap brand loyalty  brand image terhadap brand loyalty  perceived quality terhadap brand loyalty  serta brand loyalty terhadap brand equity', 'uji brand trust brand equity  brand image brand equity  perceived quality brand equity  brand trust brand loyalty  brand image brand loyalty  perceived quality brand loyalty  brand loyalty brand equity  rancang deskriptif eksplanatori dekat kuantitatif  sampel    mahasiswa   fakultas ekonomi bisnis universitas brawijaya angkat      sesuai karakteristik populasi mahasiswa guna telkomsel minimal   aktif isi ulang  kumpul data teknik wawancara kuesioner  olah data partial least square  pls   signifikan variabel brand trust brand equity  brand image brand equity  perceived quality brand equity  brand trust brand loyalty  brand image brand loyalty  perceived quality brand loyalty  brand loyalty brand equity', 1),
(11, ' Pengaruh celebrity endorsement terhadap brand credibility dan brand equity pada online shop (study pada online shop vanilla hijab indonesia)	', 'Tujuan dari penelitian ini adalah untuk mengetahui pengaruh penggunaan celebrity endorsement terhadap brand credibility dan brand equity pada online shop yang ada di sosial media instagram  Jumlah sampel dalam penelitian adalah sebanyak     responden konsumen vanilla hijab yang ada di seluruh indonesia  Penelitian ini menggunakan teknik purposive sampling dengan kriteria sebagai berikut       berusia    hingga    tahun      memiliki akun instagram dan mengenal online shop serta produk vanilla hijab dan telah melakukan pembelian produk secara online melalui aplikasi tersebut sebanyak minimal   kali  Teknik analisis data yang dilakukan dengan menggunakan partial least square  pls  dengan smartpls      Hasil penelitian menunjukkan bahwa terdapat pengaruh yang signifikan pada hubungan celebrity endorsement terhadap brand credibility  brand credibility terhadap brand equity dan celebrity endorsement terhadap brand equity melalui brand credibility  Akan tetapi tidak ada pengaruh yang signifikan pada hubungan celebrity endorsement terhadap brand equity secara langsung  Hasil penelitian juga menunjukkan bahwa brand credibility memediasi secara penuh antara celebrity endorsement terhadap brand equity ', 'guna celebrity endorsement brand credibility brand equity online shop sosial media instagram  sampel     responden konsumen vanilla hijab indonesia  teknik purposive sampling kriteria       usia            milik akun instagram kenal online shop produk vanilla hijab beli produk online aplikasi minimal   kali  teknik analisis data partial least square  pls  smartpls      signifikan hubung celebrity endorsement brand credibility  brand credibility brand equity celebrity endorsement brand equity brand credibility  signifikan hubung celebrity endorsement brand equity langsung  brand credibility mediasi penuh celebrity endorsement brand equity  ', 1),
(12, ' Pengaruh interaksi personal, kebijakan, aspek fisik, reliabilitas, dan pemecahan masalah terhadap loyalitas pelanggan ritel : sebuah konteks toko buku	', 'Penelitian ini bertujuan untuk mengetahui      deskripsi kualitas pelayanan ritel dan loyalitas pelanggan      pengaruh kualitas pelayanan ritel secara parsial dan simultan terhadap loyalitas pelanggan      pengaruh dominan antara kualitas pelayanan ritel terhadap loyalitas pelanggan  Populasi dalam penelitian ini adalah konsumen yang melakukan pembelian minimal  x dalam waktu satu tahun  Teknik pengambilan sampel yang digunakan adalah purposive sampling dan diperoleh sampel sebanyak     responden  Penelitian ini menggunakan teknik analisis regresi linier berganda  Hasil analisis penelitian ini adalah      kualitas pelayanan ritel diklasifikasikan baik      dimensi interaksi personal  dan dimensi kebijakan masing masing tidak signifikan pengaruhnya terhadap loyalitas pelanggan  sedangkan dimensi aspek fisik  reliabilitas  dan pemecahan masalah masing masing berpengaruh positif signifikan terhadap loyalitas pelanggan  Kualitas pelayanan ritel berpengaruh positif signifikan terhadap loyalitas pelanggan      dimensi yang berpengaruh dominan adalah dimensi reliabilitas ', '     deskripsi layan ritel loyalitas langgan      layan ritel parsial simultan loyalitas langgan      dominan layan ritel loyalitas langgan  populasi konsumen beli minimal   teknik sampel purposive sampling  sampel     responden  teknik analisis regresi linier ganda  analisis      layan ritel klasifikasi      dimensi interaksi personal  dimensi bijak signifikan pengaruh loyalitas langgan  dimensi aspek fisik  reliabilitas  pecah pengaruh positif signifikan loyalitas langgan  layan ritel pengaruh positif signifikan loyalitas langgan      dimensi pengaruh dominan dimensi reliabilitas  ', 1),
(13, ' Pengaruh kualitas produk dan layanan terhadap  Loyalitas pelanggan coffee shop	', 'Penelitian ini bertujuan untuk menganalisis pengaruh kualitas produk dan layanan terhadap loyalitas pelanggan  dan kepuasan pelanggan sebagai mediasi  Populasi yang digunakan dalam penelitian ini adalah pelanggan dw coffee yang telah datang lebih dari satu kali pada rentang usia       tahun  dengan metode non probability sampling sebanyak     orang  Model analisis yang digunakan dalam penelitian ini adalah analisis deskriptif dan sem pls menggunakan software smartpls versi      Hasil penelitian menunjukkan bahwa    kualitas produk di dw coffee tidak berpengaruh terhadap kepuasan pelanggan     kualitas layanan di dw coffee berpengaruh terhadap kepuasan pelanggan     kualitas produk di dw coffee tidak berpengaruh terhadap loyalitas pelanggan     kualitas layanan di dw coffee tidak berpengaruh terhadap loyalitasl     kepuasan pelanggan di dw coffee berpengaruh terhadap loyalitas pelanggan  dan berfungsi sebagai mediasi sempurna antara kualitas layanan dan loyalitas pelanggan ', 'analisis produk layan loyalitas langgan  puas langgan mediasi  populasi langgan dw coffee kali rentang usia        non probability sampling     orang  model analisis analisis deskriptif m pls software smartpls versi         produk dw coffee pengaruh puas langgan     layan dw coffee pengaruh puas langgan     produk dw coffee pengaruh loyalitas langgan     layan dw coffee pengaruh loyalitasl     puas langgan dw coffee pengaruh loyalitas langgan  fungsi mediasi sempurna layan loyalitas langgan  ', 1),
(14, ' The relevance of leverage, profitability, market performance, and macroeconomic to stock price	', 'Penelitian ini bertujuan untuk menguji dan menganalisis pengaruh der  roe  per  suku bunga  dan nilai tukar terhadap harga saham  Sebanyak    perusahaan makanan dan minuman yang terdaftar di bursa efek indonesia tahun           ditelaah untuk diobservasi  Jenis penelitian ini adalah explanatory research dengan menggunakan metode linear multipel  Hasil penelitian menunjukkan variabel fundamental yang berpengaruh positif terhadap harga saham adalah rasio roe dan per  Sedangkan variabel fundamental yang berpengaruh negatif terhadap harga saham adalah rasio der  Suku bunga dan nilai tukar tidak berpengaruh terhadap harga saham ', 'uji analisis der  roe   suku bunga  nilai tukar harga saham     usaha makan minum daftar bursa efek indonesia           telaah observasi  jenis explanatory research linear multipel  variabel fundamental pengaruh positif harga saham rasio roe  variabel fundamental pengaruh negatif harga saham rasio der  suku bunga nilai tukar pengaruh harga saham  ', 1),
(15, ' Konstruk disonansi kognitif dalam penelitian perilaku konsumen: apakah popularitasnya memang sudah meredup?	', 'Artikel ini menjelaskan apakah konstruk disonansi kognitif sudah meredup atau belum penggunaannya dalam penelitian perilaku konsumen  Isu ini muncul seiring munculnya beberapa penelitian yang tidak lagi memasukkan konstruk ini dalam penelitian mereka  Berdasarkan studi literatur pada jurnal top bidang pemasaran  temuan menunjukkan bahwa konstruk disonansi kognitif masih populer dan digunakan secara luas dalam penelitian pemasaran  Temuan ini menjadi penting bagi tujuan pengembangan akademik dan praktis  karena konstruk ini berguna untuk mendukung implementasi strategi pemasaran terutama bagi pemasar yang menerapkan konsep    one stop shopping     Meskipun begitu  studi ini tidak dapat mengambil kesimpulan bahwa peneliti yang tidak memasukkan konstruk ini ke dalam model penelitian mereka adalah keliru  Temuan ini hanya dapat menunjukkan bahwa mereka telah membuang kesempatan untuk mendapatkan salah satu informasi penting dalam keperilakuan konsumen yaitu tentang ketidaknyamanan konsumen pada tahapan setelah pembelian  Ketegangan yang ada dalam ketidaknyamanan tersebut dapat memotivasi konsumen untuk mengubah sikap atau perilakunya  Terlepas dari adanya sikap pro dan kontra mengenai konstruk ini  fenomena ini bermanfaat untuk diteliti pada penelitian selanjutnya ', 'artikel konstruk disonansi kognitif redup guna perilaku konsumen  isu muncul iring muncul masuk konstruk  dasar studi literatur jurnal top bidang asar  temu konstruk disonansi kognitif populer luas asar  temu penting kembang akademik praktis  konstruk guna dukung implementasi strategi asar asar terap konsep    one stop shopping      studi ambil simpul teliti masuk konstruk model keliru  temu buang sempat salah informasi penting perilaku konsumen ketidaknyamanan konsumen tahap beli  tegang ketidaknyamanan motivasi konsumen ubah sikap perilaku  lepas sikap pro kontra konstruk  fenomena manfaat', 1),
(16, 'Sinyal yang ditimbulkan oleh informasi arus kas, Laba dan nilai tambah pasar dalam mendongkrak harga saham perusahaan consumer goods di indonesia', 'Tujuan utama korporasi adalah meningkatkan nilai perusahaan yang tercermin dari harga sahamnya  Penelitian ini bertujuan untuk mengetahui pengaruh arus kas operasi  laba akuntansi dan market value added  mva  terhadap harga saham perusahaan perusahaan consumer goods di indonesia  Populasi dalam penelitian ini adalah perusahaan consumer goods yang terdaftar di bursa efek indonesia tahun           sebanyak    perusahaan  Sampel dipilih secara acak dengan teknik simple random sampling dengan cara lotre menetapkan sebanyak    perusahaan  Dengan menggunakan teknik analisis regresi berganda  diperoleh hasil bahwa arus kas aktivitas operasi  laba akuntansi  dan mva berpengaruh signifikan terhadap harga saham  Hasil ini membuktikan bahwa arus kas aktivitas operasi  laba akuntasi dan market value added memiliki kandungan informasi positif atas prospek perusahaan di masa datang ', 'utama korporasi tingkat nilai usaha cermin harga saham  arus kas operasi  laba akuntansi market value added  mva  harga saham usaha usaha consumer goods indonesia  populasi usaha consumer goods daftar bursa efek indonesia              usaha  sampel pilih acak teknik simple random sampling lotre tetap    usaha  teknik analisis regresi ganda   arus kas aktivitas operasi  laba akuntansi  mva pengaruh signifikan harga saham  bukti arus kas aktivitas operasi  laba akuntasi market value added milik kandung informasi positif prospek usaha  ', 1),
(17, ' Pengaruh kompensasi dan keterlibatan kerja  Terhadap kinerja karyawan', 'Penelitian ini bertujuan untuk menguji pengaruh kompensasi dan keterlibatan kerja terhadap kinerja karyawan bagian building management sebuah pusat perbelanjaan di kota malang  Sampel pada penelitian ini berjumlah    karyawan dari populasi    karyawan  Penelitian ini merupakan studi empiris yang menggunakan teknik total sampling dalam pengumpulan data dan menggunakan analisis regresi linier berganda data yang digunakan adalah data primer yang diperoleh dengan menggunakan kuesioner hasil penelitian ini menunjukkan bahwa mayoritas karyawan telah puas dengan kompensasi dan keterlibatan kerja dan mayoritas karyawan memiliki kinerja yang baik ', 'uji kompensasi kerja kinerja karyawan building management pusat belanja kota malang  sampel    karyawan populasi    karyawan  studi empiris teknik total sampling kumpul data analisis regresi linier ganda data data primer  kuesioner mayoritas karyawan puas kompensasi kerja mayoritas karyawan milik kinerja  ', 1),
(18, ' Tingkat kesehatan koperasi simpan pinjam dan faktor yang mempengaruhinya	', 'Penelitian ini bertujuan untuk mendeskripsikan tingkat kesehatan koperasi simpan pinjam  ksp  di kota malang berdasarkan tujuh aspek antara lain permodalan  kualitas aktiva produktif  manajemen  efisiensi  likuiditas  kemandirian dan pertumbuhan  jati diri koperasi  serta menganalisis faktor yang mempengaruhinya  Penelitian deskriptif kuantitatif yang menggunakan metode dokumentasi berupa laporan keuangan tahunan ini menunjukkan bahwa     permodalan ksp berada pada kondisi sehat     kualitas aktiva produktif dalam kondisi kurang sehat     manajemen dalam kondisi cukup sehat     efisiensi dalam kondisi kurang sehat     likuiditas dalam kondisi kurang sehat     kemandirian dan pertumbuhan dalam kondisi kurang sehat     jati diri koperasi dalam kondisi tidak sehat  Faktor yang mempengaruhi kesehatan ksp antara lain kelalaian anggota membayar angsuran pinjaman dan simpanan wajib  kurangnya kesiapan koperasi dalam perencanaan kerja jangka panjang  penurunan jumlah anggota  beban yang tinggi  tingginya suku bunga pinjaman dan rendahnya suku bunga simpanan ', 'deskripsi tingkat sehat koperasi simpan pinjam  ksp  kota malang dasar tujuh aspek modal  aktiva produktif  manajemen  efisiensi  likuiditas  mandiri tumbuh  jati koperasi  analisis faktor pengaruh  deskriptif kuantitatif dokumentasi lapor uang tahun     modal ksp sehat     aktiva produktif sehat     manajemen sehat     efisiensi sehat     likuiditas sehat     mandiri tumbuh sehat     jati koperasi sehat  faktor pengaruh sehat ksp lalai anggota bayar angsur pinjam simpan wajib  kurang kesiap koperasi rencana kerja jangka  turun anggota  beban  tinggi suku bunga pinjam rendah suku bunga simpan  ', 1),
(19, ' Community affect dan brand community trust terhadap brand equity', 'Penelitian ini bertujuan untuk menguji dan menganalisis pengaruh brand community affect dan brand community trust terhadap brand equity  serta menguji pengaruh brand community affect dan brand community trust terhadap brand equity melalui brand loyalty sebagai variable mediasi  Obyek penelitian ini adalah seluruh anggota aktif malang yaris club sebanyak    orang  Teknik pengambilan sampel yang digunakan adalah metode total sampling  Teknik analisis data menggunakan analisis pls  partial least square   Hasil penelitian yang didapatkan adalah brand community affect berpengaruh positif secara langsung terhadap brand equity  brand community trust berpengaruh positf secara langsung terhadap brand equity  brand community affect berpengaruh positif secara langsung terhadap brand loyalty  brand community trust berpengaruh positif secara langsung terhadap brand loyalty  brand loyalty berpengaruh positif secara langsung terhadap brand equity  brand community affect berpengaruh positif terhadap brand equity melalui brand loyalty  brand community trust berpengaruh positif terhadap brand equity melalui brand loyalty ', 'uji analisis brand community affect brand community trust brand equity  uji brand community affect brand community trust brand equity brand loyalty variable mediasi  obyek anggota aktif malang yaris club    orang  teknik sampel total sampling  teknik analisis data analisis pls  partial least square   dapat brand community affect pengaruh positif langsung brand equity  brand community trust pengaruh positf langsung brand equity  brand community affect pengaruh positif langsung brand loyalty  brand community trust pengaruh positif langsung brand loyalty  brand loyalty pengaruh positif langsung brand equity  brand community affect pengaruh positif brand equity brand loyalty  brand community trust pengaruh positif brand equity brand loyalty  ', 1),
(20, ' Keutamaan kristiani dalam implementasi  Pengelolaan kas	', 'Tujuan penelitian ini untuk mendeskripsikan dan memaknai keutamaan kristiani yang mengandung nilai nilai moral dalam implementasi pengelolaan kas  Penelitian ini menggunakan pendekatan interpretatif dengan paradigma post positivisme dan desain penelitian adalah studi kasus  single case   Obyek penelitian adalah sebuah panti asuhan katolik di kota malang dibawah tanggung jawab misionaris dari yayasan misericordia  Biarawati  karyawan dan anak asuh sebagai informan  dan data yang diperoleh melalui wawancara mendalam dan observasi partisipasi pasif  Hasil penelitian menemukan bahwa organisasi panti asuhan memiliki tiga makna dalam implementasi pengelolaan kas yaitu spriritual  sosial dan keuangan  Makna spiritual  merupakan makna utama yang dinyatakan dalam iman  harapan dan cinta kepada tuhan  dengan menempatkan kas atau dana yang dimiliki organisasi adalah milik tuhan  amanah atau perintah  tanda kasih dan kemurahan hati  ungkapan syukur dan terima kasih  tanda pengakuan dan kebesaran hati  dan tanda iman dan kepercayaan ', 'deskripsi makna utama kristiani kandung nilai nilai moral implementasi kelola kas  dekat interpretatif paradigma post positivisme desain studi  single case   obyek panti asuh katolik kota malang bawah tanggung misionaris yayasan misericordia  biarawati  karyawan anak asuh informan  data  wawancara dalam observasi partisipasi pasif  temu organisasi panti asuh milik makna implementasi kelola kas spriritual  sosial uang  makna spiritual  makna utama nyata iman  harap cinta tuhan  tempat kas dana milik organisasi milik tuhan  amanah perintah  tanda kasih murah hati  ungkap syukur terima kasih  tanda aku besaran hati  tanda iman percaya  ', 1),
(21, 'Peran pemerintah nusa tenggara timur dan kelompok ina ndao dalam meningkatkan Kinerja produksi ikm tenun ikat mira keddi	', 'Tujuan penelitian ini untuk mengetahui dan menguraikan peran pemerintah provinsi nusa tenggara timur dan kelompok ina ndao dalam meningkatkan kinerja produksi ikm tenun ikat mira keddi di kota kupang  Metode yang digunakan dalam penelitian ini adalah metode kualitatif fenomenologi  Teknik analisis data yang dipergunakan adalah interaktif model  Hasil penelitian menunjukan bahwa peran pemerintah nusa tenggara timur dalam meningkatkan kinerja produksi ikm mira keddi di kota kupang sesuai dengan arah kebijakan dalam rencana pembangunan jangka menengah daerah  rpjmd   Program pengembangan berupa pelatihan teknik pencelupan benang  Pembinaan berupa mengontrol kerja ikm mira keddi  pembinaan teknik pencelupan dan pewarnaan  bantuan peralatan dan bahan baku produksi  Peran kelompok adalah mengontrol kerja ikm mira keddi  memberikan motif motif baru dan pembinaan manajemen kerja  Pembinaan kelompok tenun ikat terhadap ikm binaan meliputi inovasi pewarnaan alam dan memadukan motif daerah dan diversifikasi produk  Ikm diberikan kebebasan mengembangkan pasar sendiri atas hasil produksinya sehingga tidak bergantung kepada ina ndao ', 'urai peran perintah provinsi nusa tenggara timur kelompok ina ndao tingkat kinerja produksi ikm tenun ikat mira keddi kota kupang  kualitatif fenomenologi  teknik analisis data interaktif model  tunjuk peran perintah nusa tenggara timur tingkat kinerja produksi ikm mira keddi kota kupang sesuai arah bijak rencana bangun jangka tengah daerah  rpjmd   program kembang latih teknik celup benang  bina kontrol kerja ikm mira keddi  bina teknik celup warna  bantu ralat bahan baku produksi  peran kelompok kontrol kerja ikm mira keddi  motif motif bina manajemen kerja  bina kelompok tenun ikat ikm bina liput inovasi warna alam madu motif daerah diversifikasi produk  ikm bebas kembang pasar produksi gantung ina ndao  ', 1),
(31, ' Meningkatkan aktivitas belajar dan hasil belajar siswa dengan penerapan model pembelajaran explicit intruction	', 'Siswa di kelas xi apk smk muh kepanjen diketahui bahwa nilai aktivitas belajar dan hasil belajar siswa rendah Hasil penelitian menunjukkan bahwa penerapan model pembelajaran explicit intruction mampu menjadikan siswa aktif dan kreatif serta membantu siswa untuk meningkatkan aktivitas belajar dan hasil pelajaran membuat dokumen stenografi Hal tersebut terbukti pada nilai aktivitas belajar yang diamati oleh orang pengamat Nilai rata rata aktivitas belajar siswa sebelum diberi tindakan di bawah dengan kriteria c cukup Selanjutnya nilai rata rata kelas pada siklus i setelah adanya penerapan model pembelajaran explicit intruction meningkat menjadi di atas dengan kriteria b baik Pada siklus i nilai rata rata hasil belajar siswa meningkat menjadi rata rata untuk lks lkr nilai rata rata ulangan harian dan rata rata nilai ulangan semester dengan kriteria b baik sedangkan aktivitas belajar setelah tindakan dari siswa telah aktif dalam pembelajaran Siswa juga mengalami peningkatan selama penelitian ', 'siswa kelas x apk   smk muh   kepanjen  nilai aktivitas ajar ajar siswa rendah  terap model pembelajaran explicit intruction jadi siswa aktif kreatif bantu siswa tingkat aktivitas ajar ajar dokumen  stenografi  bukti nilai aktivitas ajar amat   orang amat  nilai aktivitas ajar siswa tindak    kriteria    nilai kelas siklus terap model pembelajaran explicit intruction tingkat    kriteria    siklus nilai ajar siswa tingkat lks      lkr     nilai ulang hari      nilai ulang semester      kriteria    aktivitas ajar tindak        siswa aktif pembelajaran  siswa alami tingkat  ', 2),
(32, 'Pengaruh motivasi berwirausaha terhadap minat berwirausaha melalui prestasi belajar mata pelajaran kewirausahaan siswa kelas xi  Smk negeri 1 kraksaan', 'Siswa lulusan smk merupakan tenaga siap pakai yang mudah terserap kerja  Hal yang menjadi perhatian adalah semakin banyaknya angka lulusan tetapi tidak diimbangi dengan penyediaan lapangan pekerjaan  menjadi salah satu penyebab banyaknya pengangguran  upaya yang dilakukan adalah berwirausaha  Minat berwirausaha siswa tumbuh karena adanya motivasi dan prestasi belajar mata pelajaran kewirausahaan di sekolah  Penelitian ini dilakukan pada siswa kelas xi ak  apk  pemasaran smk negeri   kraksaan  Teknik sampel pada penelitian ini menggunakan proporsional random sampling  Populasi dalam penelitian ini berjumlah     siswa  Jumlah sampel yang diperoleh sebanyak     siswa kelas xi smk negeri   kraksaan  Analisis data pada penelitian ini menggunakan analisis jalur  Hasil dari penelitian ini adalah    terdapat pengaruh positif dan signifikan antara motivasi berwirausaha terhadap prestasi belajar mata pelajaran kewirausahaan siswa kelas xi smk negeri   kraksaan     terdapat pengaruh positif dan signifikan antara prestasi belajar mata pelajaran kewirausahaan terhadap minat berwirausaha siswa kelas xi smk negeri   kraksaan     terdapat pengaruh positif dan signifikan antara motivasi berwirausaha terhadap minat berwirausaha siswa kelas xi smk negeri   kraksaan     terdapat pengaruh tidak langsung yang positif dan signifikan antara motivasi berwirausaha terhadap minat berwirausaha melalui prestasi belajar mata pelajaran kewirausahaan siswa kelas xi smk negeri   kraksaan ', 'siswa lulus smk tenaga pakai mudah serap kerja  hati banyak angka lulus imbang sedia lapang kerja  salah sebab banyak anggur  upaya berwirausaha  minat berwirausaha siswa tumbuh motivasi prestasi ajar mata ajar kewirausahaan sekolah  siswa kelas x ak  apk  asar smk negeri   kraksaan  teknik sampel proporsional random sampling  populasi     siswa  sampel      siswa kelas x smk negeri   kraksaan  analisis data analisis jalur     positif signifikan motivasi berwirausaha prestasi ajar mata ajar kewirausahaan siswa kelas x smk negeri   kraksaan     positif signifikan prestasi ajar mata ajar kewirausahaan minat berwirausaha siswa kelas x smk negeri   kraksaan     positif signifikan motivasi berwirausaha minat berwirausaha siswa kelas x smk negeri   kraksaan     langsung positif signifikan motivasi berwirausaha minat berwirausaha prestasi ajar mata ajar kewirausahaan siswa kelas x smk negeri   kraksaan  ', 2),
(33, '  Pengaruh penerapan presensi sidik jari (fingerprint) terhadap kinerja guru  Melalui motivasi kerja di sma negeri 5 malang	', 'Hasil penelitian ini menunjukkan     penerapan presensi sidik jari  fingerprint  termasuk dalam kategori sangat baik  motivasi kerja guru termasuk dalam kategori tinggi  dan kinerja guru termasuk dalam kategori baik      terdapat pengaruh secara langsung yang signifikan dan positif antara penerapan presensi sidik jari terhadap motivasi kerja guru      terdapat pengaruh secara langsung yang signifikan dan positif antara motivasi kerja terhadap kinerja guru      terdapat pengaruh secara tidak langsung yang signifikan dan positif antara penerapan presensi sidik jari terhadap kinerja guru melalui motivasi kerja  Saran yang direkomendasikan sehubungan dengan hasil penelitian adalah      untuk meningkatkan motivasi kerja dan kinerja guru di sma negeri   malang  hendaknya lembaga pendidikan tersebut selalu memantau  meninjau  dan memperbaiki pelaksanaan presensi sidik jari  fingerprint  yang sudah ada  Hal ini juga dapat mengurangi sikap para guru yang tidak terlalu termotivasi dengan sistem presensi sidik jari  fingerprint  yang sudah berjalan selama ini      lembaga pendidikan di sma negeri   malang hendaknya melakukan kajian motivasi dan kinerja secara berkala dengan harapan dapat mengetahui hal hal apa saja yang dapat mempengaruhi motivasi kerja dan kinerja para guru  sekaligus mengidentifikasi masalah masalah yang mungkin saja timbul sehingga masalah tersebut dapat segera teratasi  Selain itu lembaga pendidikan di sma negeri   malang perlu mengkaji faktor faktor lain yang dapat mempengaruhi motivasi kerja dan kinerja guru di sma negeri   malang selain penerapan presensi sidik jari  fingerprint   faktor faktor tersebut bisa saja mengenai lingkungan kerja atau iklm kerja  hubungan interpersonal  dan lain lain ', '    terap presensi sidik jari  fingerprint  kategori  motivasi kerja guru kategori  kinerja guru kategori      langsung signifikan positif terap presensi sidik jari motivasi kerja guru      langsung signifikan positif motivasi kerja kinerja guru      langsung signifikan positif terap presensi sidik jari kinerja guru motivasi kerja  saran rekomendasi hubung      tingkat motivasi kerja kinerja guru sma negeri   malang  lembaga didik pantau  tinjau  baik laksana presensi sidik jari  fingerprint   urang sikap guru motivasi sistem presensi sidik jari  fingerprint  jalan      lembaga didik sma negeri   malang kaji motivasi kinerja kala harap pengaruh motivasi kerja kinerja guru  identifikasi timbul atas  lembaga didik sma negeri   malang kaji faktor faktor pengaruh motivasi kerja kinerja guru sma negeri   malang terap presensi sidik jari  fingerprint   faktor faktor lingkung kerja iklm kerja  hubung interpersonal   ', 2),
(34, ' Pengaruh pengalaman praktik kerja industri dan prestasi uji kompetensi produktif terhadap kesiapan memasuki dunia kerja  Siswa smk negeri 1 malang	', 'Praktik kerja industri merupakan salah satu upaya untuk merealisasikan tujuan smk untuk menghasilkan lulusan yang berkualitas dan siap untuk bekerja serta menggambangkan sikap profesional sesuai bidang keahlian masing masing  Penelitian ini bertujuan untuk menguji      pengaruh pengalaman praktik kerja industri terhadap kesiapan memasuki dunia kerja      pengaruh prestasi uji kompetensi produktif terhadap kesiapan memasuki dunia kerja      pengaruh pengalaman praktik kerja industri dan prestasi uji kompetensi produktif terhadap kesiapan memasuki dunia kerja  Jenis penelitian ini deskriptif korelasi  Dengan sampel     siswa kelas xii program studi administrasi perkantoran di smkn   malang  Analisis yang digunakan regresi berganda  Hasil penelitian ini menunjukkan      terdapat pengaruh positif dan siginifikan antara pengalaman prakerin terhadap kesiapan memasuki dunia kerja      terdapat pengaruh positif dan signifikan antara prestasi uji kompetensi produktif terhadap kesiapan memasuki dunia kerja      terdapat pengaruh positif dan siginifikan antara pengalaman praktik kerja industri dan prestasi uji kompetensi produktif terhadap kesiapan memasuki dunia kerja ', 'praktik kerja industri salah upaya realisasi smk hasil lulus kualitas gambang sikap profesional sesuai bidang ahli  uji      pengalaman praktik kerja industri kesiap dunia kerja      prestasi uji kompetensi produktif kesiap dunia kerja      pengalaman praktik kerja industri prestasi uji kompetensi produktif kesiap dunia kerja  jenis deskriptif korelasi  sampel     siswa kelas xii program studi administrasi kantor smkn   malang  analisis regresi ganda       positif siginifikan pengalaman prakerin kesiap dunia kerja      positif signifikan prestasi uji kompetensi produktif kesiap dunia kerja      positif siginifikan pengalaman praktik kerja industri prestasi uji kompetensi produktif kesiap dunia kerja  ', 2),
(35, ' Pengembangan media movie maker pada mata pelajaran kearsipan kelas x administrasi perkantoran	', 'Tujuan penelitian ini untuk menghasilkan produk media pembelajaran movie maker dalam kompetensi dasar mengidentifikasi alat dan bahan kearsipan serta menjelaskan pengurusan surat masuk dan keluar untuk siswa kelas x program keahlian administrasi perkantoran smk pgri malang Penelitian ini menggunakan model pengembangan assure yang digabungkan dan dimodifikasi dengan model pengembangan d sehingga di peroleh tahap pengembangan Berdasarkan hasil validasi ahli media dan ahli materi dimana ahli media menunjukkan bahwa persentase sebesar dan ahli materi menunjukkan bahwa persentase sebesar dimana jumlah tersebut menunjukkan bahwa media pembelajaran movie maker memiliki kriteria sangat valid Hasil validasi oleh siswa kelompok kecil menunjukkan persentase sebesar di peroleh dari hasil skor empirik dibagi skor maksimal Hasil validasi oleh siswa kelompok besar menunjukkan persentase sebesar di peroleh dari hasil skor empirik dibagi skor maksimal ', 'hasil produk media pembelajaran movie maker kompetensi dasar identifikasi alat bahan arsip urus surat siswa kelas program ahli administrasi kantor smk pgri   malang  model kembang assure gabung modifikasi model kembang     tahap kembang  dasar validasi ahli media ahli materi  ahli media persentase      ahli materi persentase        media pembelajaran movie maker milik kriteria valid  validasi siswa kelompok persentase      skor empirik bagi skor maksimal  validasi siswa kelompok persentase        skor empirik bagi skor maksimal  ', 2),
(36, ' Pengembangan modul dalam mata pelajaran  Komunikasi bisnis berdasarkan kurikulum 2013	', 'Tujuan penelitian adalah menghasilkan produk berupa modul pembelajaran komunikasi bisnis berdasarkan kurikulum pada mata pelajaran komunikasi bisnis dengan materi teknik negosiasi yang telah melalui proses validasi Model pengembangan produk modul pembelajaran ini menggunakan modifikasi dari langkah langkah penelitian dan pengembangan yang dikemukakan oleh borg gall yang terdiri dari analisis kebutuhan pengembangan produk validasi ahli revisi uji penggunaan terbatas dan produk akhir Jenis data pada penelitian ini menggunakan data kuantitatif dan data kualitatif Data kuantitatif berupa saran tanggapan dan kritik dari validator yang digunakan sebagai pertimbangan dalam melakukan revisi terhadap modul pembelajaran yang dikembangkan Hasil proses uji coba produk tersebut didukung dengan hasil validasi yang diperoleh dari ahli kepenulisan modul sebesar ahli materi sebesar ahli bahasa sebesar dan uji coba pengguna siswa sebesar sehingga apabila hasil tersebut dihitung secara keseluruhan diperoleh rata rata sebesar Berdasarkan hasil analisis tersebut dapat disimpulkan bahwa modul pembelajaran komunikasi bisnis berdasarkan kurikulum dinyatakan layak dan dapat digunakan dalam proses pembelajaran materi teknik negosiasi di smk pawyatan daha kediri ', 'hasil produk modul pembelajaran komunikasi bisnis dasar kurikulum      mata ajar komunikasi bisnis materi teknik negosiasi proses validasi  model kembang produk modul pembelajaran modifikasi langkah langkah kembang dikemukakan borg   gall analisis butuh  kembang produk  validasi ahli  revisi  uji guna batas produk  jenis data data kuantitatif data kualitatif  data kuantitatif saran  tanggap  kritik validator timbang revisi modul pembelajaran kembang  proses uji coba produk dukung validasi  ahli kepenulisan modul         ahli materi         ahli bahasa         uji coba guna siswa         hitung          dasar analisis  simpul modul pembelajaran komunikasi bisnis dasar kurikulum      nyata layak proses pembelajaran materi teknik negosiasi smk pawyatan daha   diri  ', 2);
INSERT INTO `dataset` (`id`, `judul`, `data_ori`, `data_edit`, `kategori`) VALUES
(37, 'Pengembangan modul pembelajaran kontekstual bermuatan karakter pada mata pelajaran kewirausahaan di smk cendika bangsa kepanjen	', 'Kurikulum dikenal sebagai pendidikan karakter dimana pembelajaran yang dikembangkan menggunakan pendekatan scientific Untuk menunjang pembelajaran dengan menggunakan pendekatan scientific salah satunya dapat menggunakan modul Modul adalah sarana pembelajaran dalam bentuk tertulis atau cetak yang berisi materi pembelajaran metode tujuan pembelajaran petunjuk kegiatan belajar dan latihan yang disusun secara sistematis dan menarik untuk mencapai kompetensi yang diharapkan dan dapat digunakan secara mandiri Penelitian ini bertujuan untuk menghasilkan produk berupa modul pembelajaran kontekstual bermuatan karakter pada mata pelajaran kewirausahaan dengan materi produk kerajinan dari bahan lunak dan pengemasannya Penelitian ini menggunakan pendekatan kualitatif dengan didukung data kuantitatif Model pengembangan produk modul ini menggunakan modifikasi brog gall yang terdiri dari analisis kebutuhan perencanaan pengembangan produk validasi ahli uji coba kelompok kecil revisi produk akhir Produk divalidasi oleh orang ahli modul dan orang ahli materi kemudian dilakukan uji kelompok kecil sebanyak siswa Data dikumpulkan dengan pedoman wawancara dan angket Hasil penelitian menunjukkan bahwa modul yang dikembangkan termasuk dalam kriteria valid dan layak ditinjau dari hasil validasi ahli materi ahli modul dan pada uji coba kelompok kecil sebesar sehingga modul pembelajaran kontekstual bermuatan karakter valid dan layak digunakan sebagai bahan ajar', 'kurikulum      kenal didik karakter pembelajaran kembang dekat scientific  tunjang pembelajaran dekat scientific salah satu modul  modul sarana pembelajaran bentuk tulis cetak risi materi pembelajaran   pembelajaran  tunjuk giat ajar  latih susun sistematis tarik capai kompetensi harap mandiri  hasil produk modul pembelajaran kontekstual muat karakter mata ajar kewirausahaan materi produk rajin bahan lunak emas  dekat kualitatif dukung data kuantitatif  model kembang produk modul modifikasi brog   gall     analisis butuh     rencana     kembang produk     validasi ahli     uji coba kelompok     revisi     produk  produk divalidasi   orang ahli modul   orang ahli materi  uji kelompok    siswa  data kumpul pedoman wawancara  angket  modul kembang kriteria valid layak  tinjau validasi ahli materi  ahli modul uji coba kelompok modul pembelajaran kontekstual muat karakter valid layak bahan ajar  ', 2),
(38, ' Meningkatkan aktivitas dan hasil belajar siswa melalui kolaborasi model pembelajaran predict, observe and explain (poe) dan mind mapping  Pada mata pelajaran kearsipan	', 'Tujuan penelitian ini adalah implementasi kolaborasi model pembelajaran poe dan mind mapping pada mata pelajaran kearsipan serta mengetahui aktivitas dan hasil belajar siswa pada siswa kelas x program keahlian administrasi perkantoran smk pgri turen  Jenis penelitian merupakan penelitian tindakan kelas  ptk  yang dilakukan dua siklus   kali pertemuan   Hasil penelitian menunjukkan bahwa       implementasi kolaborasi model pembelajaran poe dan mind mapping pada mata pelajaran kearsipan pada siswa kelas x apk   smk pgri turen pada siklus memperoleh persentase sebesar     dan meningkat pada siklus ii menjadi            aktivitas belajar sangat memuskan dan hasil belajar mengalami kenaikan yang signifikan ', 'implementasi kolaborasi model pembelajaran poe mind mapping mata ajar arsip aktivitas ajar siswa siswa kelas program ahli administrasi kantor smk pgri turen  jenis tindak kelas  ptk  siklus   kali temu         implementasi kolaborasi model pembelajaran poe mind mapping mata ajar arsip siswa kelas apk   smk pgri turen siklus persentase     tingkat siklus i            aktivitas ajar mus ajar alami naik signifikan  ', 2),
(39, ' Meningkatkan hasil belajar siswa dengan pengembangan media pembelajaran  E-learning berbasis blog	', 'Tujuan penelitian ini adalah menghasilkan media pembelajaran e learning berbasis blog mengukur hasil belajar siswa setelah menggunakan media pembelajaran e learning berbasis blog untuk mengetahui perbedaan hasil belajar siswa pada kelas kontrol dan kelas eksperimen Penelitian pengembangan ini dilakukan dengan menggunakan model pengembangan research and development yang dikembangan oleh sugiyono melalui tahap tahap potensi dan masalah pengumpulan data desain produk validasi desain revisi desain uji coba produk revisi produk uji coba pemakaian revisi produk dan produk yang dihasilkan Sasaran penelitian ini adalah siswa kelas x program keahlian administrasi perkantoran smkn turen Berdasarkan hasil analisis data rata rata nilai posttest kelas eksperimen dan kelas kontrol menunjukkan bahwa adanya perbedaan nilai posttest antara kelas eksperimen dengan kelas kontrol Berdasarkan perbandingan nilai posttest tersebut maka media pembelajaran e learning berbasis blog yang dikembangkan dapat meningkatkan hasil belajar siswa pada kelas eksperimen ', '     hasil media pembelajaran learning basis blog      ukur ajar siswa media pembelajaran learning basis blog      beda ajar siswa kelas kontrol kelas eksperimen  kembang model kembang research and development kembang sugiyono  tahap tahap      potensi      kumpul data      desain produk      validasi desain      revisi desain      uji coba produk      revisi produk      uji coba pakai      revisi produk       produk hasil  sasar siswa kelas program ahli administrasi kantor smkn   turen  dasar analisis data  nilai posttest kelas eksperimen       kelas kontrol       beda nilai posttest kelas eksperimen kelas kontrol  dasar banding nilai posttest  media pembelajaran learning basis blog kembang tingkat ajar siswa kelas eksperimen  ', 2),
(40, ' Meningkatkan kemandirian belajar dan hasil belajar siswa melalui pengembangan modul administrasi kepegawaian berbasis strategi pembelajaran inkuiri terbimbing	', 'Penelitian dan pengembangan ini bertujuan untuk menghasilkan bahan ajar berupa modul administrasi kepegawaian berbasis strategi pembelajaran inkuiri terbimbing untuk siswa smk kelas xii program keahlian administrasi perkantoran mengetahui kelayakan modul yang telah dikembangkan melalui hasil validasi dan mengetahui apakah terjadi peningkatan kemandirian belajar dan hasil belajar siswa sebelum dan sesudah menggunakan modul Penelitian dan pengembangan ini dilakukan dengan menggunakan d model Model ini terdiri dari tahap pengembangan yaitu define design develop dan disseminate Diperoleh hasil rata rata nilai post test pada kelas eksperimen hasil validasi oleh ahli materi dan ahli modul mencapai hasil dan hasil penyebaran angket kemandirian belajar siswa dengan menggunakan modul juga mencapai persentase dari hasil penelitian diatas menunjukkan bahwa modul administrasi kepegawaian terbukti layak dan dapat meningkatkan hasil belajar dan kemandirian belajar siswa Lebih lanjut disarankan untuk menggunakan modul ini sebagai alternative penunjang pembelajaran administrasi kepegawaian khususnya pada materi pemberhentian pegawai dan pensiun ', 'kembang hasil bahan ajar modul administrasi kepegawaian basis strategi pembelajaran inkuiri bimbing siswa smk kelas xii program ahli administrasi kantor   layak modul kembang validasi  tingkat mandiri ajar ajar siswa modul  kembang  model  model   tahap kembang  define  design  develop  disseminate   nilai post test       kelas eksperimen  validasi ahli materi ahli modul capai                sebar angket mandiri ajar siswa modul capai persentase      atas modul administrasi kepegawaian bukti layak tingkat ajar mandiri ajar siswa  saran modul alternative tunjang pembelajaran administrasi kepegawaian materi pemberhentian gawai pensiun  ', 2),
(41, ' Meningkatkan percaya diri dan hasil belajar siswa melalui pengembangan modul mata pelajaran memberikan pelayanan kepada pelanggan berbasis guided inquiry	', 'Penelitian ini bertujuan menghasilkan modul dan mengetahui tingkat kelayakan modul  perbedaan hasil belajar  serta perbedaan percaya diri siswa yang menggunakan modul dengan siswa yang tidak menggunakan modul memberikan pelayanan kepada pelanggan berbasis guided inquiry  Metode penelitian ini menggunakan model  d dari thiagarajan  dkk  Melalui   tahapan  yaitu mendefinisikan  merancang  mengembangkan  dan menyebarluaskan  Hasil penelitian menunjukkan modul sangat valid dan layak digunakan dalam pembelajaran  Selain itu  diketahui juga perbedaan rata rata hasil belajar siswa kelas eksperimen dan kelas kontrol  yaitu       dan        Hasil analisis percaya diri secara keseluruhan juga menunjukkan bahwa terdapat perbedaan pada tingkat percaya diri siswa pada kelas eksperimen dengan kelas kontrol ', 'hasil modul tingkat layak modul beda ajar beda percaya siswa modul siswa modul layan langgan basis guided inquiry model thiagarajan dkk tahap definisi rancang kembang menyebarluaskan modul valid layak pembelajaran beda ajar siswa kelas eksperimen kelas kontrol analisis percaya beda tingkat percaya siswa kelas eksperimen kelas kontrol ', 2),
(42, ' Meningkatkan prestasi belajar kearsipan dengan menggunakan model pembelajaran cooperative script pada kelas xii apk  Smk muhammadiyah 5 kepanjen	', 'Tujuan penelitian ini adalah mendeskripsikan penerapan model pembelajaran cooperative script pada mata pelajarn kearsipan studi pada siswa program keahlian administrasi perkantoran kelas xii apk smk muhammadiyah   kepanjen  sebagai upaya untuk meningkatkan aktivitas dan hasil belajar siswa  Subyek penelitian ini adalah seluruh siswa kelas xii apk smk muhammadiyah   kepanjen yang berjumlah    siswa  Metode penelitian ini menggunakan metode siklus terdiri   tahapan yaitu perencanaan  pelaksanaan  pengamatan dan refleksi  Data data dalam peneletian ini diperoleh melalui observasi  tes dan dokumentasi analisis data dilakukan melalui pembelajaran  paparan data dan kesimpulan  Hasil penelitian ini menunjukkan bahwa nelalui model pembelajaran cooperative script dapat meningkatkan hasil belajar siswa pada mata pelajaan kearsipan pada siswa program keahlian administrasi perkantoran kelas xii apk smk muhammadiyah   kepanjen ', 'deskripsi terap model pembelajaran cooperative script mata pelajarn arsip studi siswa program ahli administrasi kantor kelas xii apk smk muhammadiyah kepanjen upaya tingkat aktivitas ajar siswa subyek siswa kelas xii apk smk muhammadiyah kepanjen siswa siklus tahap rencana laksana amat refleksi data data peneletian  observasi tes dokumentasi analisis data pembelajaran papar data simpul nelalui model pembelajaran cooperative script tingkat ajar siswa mata laja arsip siswa program ahli administrasi kantor kelas xii apk smk muhammadiyah kepanjen ', 2),
(43, '  Pendidikan dan karakteristik pelaku umkm serta kontribusinya  Terhadap perekonomian nasional	', 'Penelitian ini bertujuan mengetahui peranan pendidikan dan karakteristik pelaku umkm terhadap kontribusinya terhadap perekonomian  Jenis penelitian bersifat deskriptif  menggunakan data sekunder  Hasil penelitian menunjukkan bahwa pendidikan  formal  pelaku umkm relatif rendah  Dari     responden pelaku ukm     persennya berpendidikan slta  dan atau lebih rendah  Sedangkan sarjana  diploma     persen  dan      atau   orang berpendidikan magister  Rendahnya pendidikan ini telah menjadi faktor penentu rendahnya nilai tambah untuk pembangunan ekonomi nasional ', 'peran didik karakteristik pelaku umkm kontribusi ekonomi jenis sifat deskriptif data sekunder didik formal pelaku umkm relatif rendah responden pelaku ukm persen berpendidikan slta rendah sarjana diploma persen orang berpendidikan magister rendah didik faktor tentu rendah nilai bangun ekonomi nasional', 2),
(44, ' Pengaruh lingkungan kerja dan motivasi kerja terhadap kompetensi guru bersertifikasi di smk negeri 1 pasuruan', 'Tujuan penelitian ini adalah untuk mengetahui deskripsi lingkungan kerja  motivasi kerja  dan kompetensi guru dan untuk mengetahui pengaruh lingkungan kerja dan motivasi kerja terhadap kompetensi guru  Jenis penelitian ini adalah deskriptif korelasional dengan menggunakan pendekatan kuantitatif  Populasi dalam penelitian ini adalah semua guru yang bersertifikasi di smk negeri   pasuruan yang berjumlah    guru dan sampelnya adalah seluruh populasi  Skala yang digunakan dalam penelitian ini adalah skala likert dengan   alternatif jawaban  Teknik pengumpulan data menggunakan metode kuesioner dan sebelum kuesioner digunakan untuk penelitian  dilakukan uji validitas dan reliabilitas terlebih dahulu  Untuk mengetahui hasil penelitian ini menggunakan regresi linear berganda dan uji t  Hasil dalam penelitian ini menunjukkan variabel lingkungan kerja tergolong sangat baik  variabel motivasi kerja tergolong baik  dan variabel kompetensi guru tergolong baik  dan variabel lingkungan kerja dan motivasi kerja berpengaruh secara positif signifikan terhadap kompetensi guru ', 'deskripsi lingkung kerja motivasi kerja kompetensi guru lingkung kerja motivasi kerja kompetensi guru jenis deskriptif korelasional dekat kuantitatif populasi guru sertifikasi smk negeri pasuruan guru sampel populasi skala skala likert alternatif teknik kumpul data kuesioner kuesioner uji validitas reliabilitas regresi linear ganda uji variabel lingkung kerja golong variabel motivasi kerja golong variabel kompetensi guru golong variabel lingkung kerja motivasi kerja pengaruh positif signifikan kompetensi guru ', 2),
(45, '  Pengaruh penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan terhadap minat menjadi guru	', 'Penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan merupakan salah satu faktor untuk meningkatkan minat mahasiswa untuk menjadi guru  Kajian dan praktik lapangan merupakan matakuliah praktik yang dilakukan di sekolah sekolah yang telah bekerja sama dengan pihak kampus  dimana mahasiswa akan menghadapi langsung bagaimana menjadi seorang guru yang profesioanl dari bekal yang telah diperoleh selama perkuliahan  Adapun tujuan dari penelitian ini untuk mengetahui   a  deskripsi penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan   b  deskripsi minat mahasiswa untuk menjadi guru   c  pengaruh penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan secara parsial terhadap minat menjadi guru   d  pengaruh penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan secara simultan terhadap minat menjadi guru  Jenis penelitian ini adalah penelitian eksplanasi  dengan analisis deskriptif dan analisis linier berganda  Populasi dan penelitian berjumlah     mahasiswa dengan sampel     mahasiswa  Pengambilan sampel menggunakan teknik propotional random sampling  Hasil analisis menunjukkan bahwa   a  ada pengaruh signifikan antara penguasaan matakuliah keahlian berkarya terhadap minat menjadi guru diterima   b  ada pengaruh signifikan antara penguasaan kajian dan praktik lapangan terhadap minat menjadi guru diterima   c  ada pengaruh signifikan antara penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan terhadap minat menjadi guru  Penelitian ini menunjukkan besarnya pengaruh penguasaan matakuliah keahlian berkarya dan kajian praktik lapangan terhadap minat menjadi guru sebesar      dan sisanya       dipengaruhi variabel lain ', 'kuasa matakuliah ahli karya kaji praktik lapang salah faktor tingkat minat mahasiswa guru kaji praktik lapang matakuliah praktik sekolah sekolah kampus mahasiswa hadap langsung guru profesioanl bekal  kuliah deskripsi kuasa matakuliah ahli karya kaji praktik lapang deskripsi minat mahasiswa guru kuasa matakuliah ahli karya kaji praktik lapang parsial minat guru kuasa matakuliah ahli karya kaji praktik lapang simultan minat guru jenis eksplanasi analisis deskriptif analisis linier ganda populasi mahasiswa sampel mahasiswa sampel teknik propotional random sampling analisis signifikan kuasa matakuliah ahli karya minat guru terima signifikan kuasa kaji praktik lapang minat guru terima signifikan kuasa matakuliah ahli karya kaji praktik lapang minat guru besar kuasa matakuliah ahli karya kaji praktik lapang minat guru sisa pengaruh variabel ', 2),
(46, ' Pengaruh self regulated learning dan ketersediaan fasilitas belajar  Terhadap hasil belajar siswa pada mata pelajaran otomatisasi perkantoran	', 'Penelitian ini bertujuan untuk mengetahui     deskripsi self regulated learning  fasilitas belajar dan hasil belajar siswa kelas x administrasi perkantoran  apk  pada mata pelajaran otomatisasi perkantoran di smk negeri   panji situbondo      pengaruh self regulated learning dan fasilitas belajar terhadap hasil belajar siswa  Jenis penelitian deskriptif korelasional dengan pendekatan kuantitatif  Hasil penelitian ini yaitu      self regulated learning  fasilitas belajar dan hasil belajar siswa berada pada kategori baik     terdapat pengaruh yang signifikan antara self regulated learning dan fasilitas belajar terhadap hasil belajar siswa ', 'deskripsi self regulated learning fasilitas ajar ajar siswa kelas administrasi kantor apk mata ajar otomatisasi kantor smk negeri panji situbondo self regulated learning fasilitas ajar ajar siswa jenis deskriptif korelasional dekat kuantitatif self regulated learning fasilitas ajar ajar siswa kategori signifikan self regulated learning fasilitas ajar ajar siswa ', 2),
(47, ' Pengelolaan arsip digital	', 'Dalam praktik pengelolaan arsip berbasis kertas  banyak permasalahan yang dihadapi  sehingga memberikan ruang pada media elektronik sebagai alternatif dalam pengelolaan arsip  Dalam terminologi kearsipan  media elektronik dikelompokan sebagai arsip media baru  Salah satu bentuk penyimpanan arsip media baru adalah media digital  Media digital biasanya memerlukan alat bantu berupa komputer  karena tidak dapat dibaca secara langsung  Arsip yang disimpan dalam bentuk digital dapat berupa gambar  suara  video  tulisan atau lainnya yang dapat dijadikan sebuah data dalam bentuk biner  binary   dapat diolah dalam program komputer dan disimpan dalam media penyimpanan data digital ', 'praktik kelola arsip basis kertas masalah hadap ruang media elektronik alternatif kelola arsip terminologi arsip media elektronik kelompok arsip media salah bentuk simpan arsip media media digital media digital alat bantu komputer baca langsung arsip simpan bentuk digital gambar suara video tulis jadi data bentuk biner binary o program komputer simpan media simpan data digital ', 2),
(48, '  Pengembangan e-modul berbasis adobe flash cs6  Pada mata pelajaran penataan barang dagang	', 'Perkembangan teknologi yang sangat pesat menghasilkan hal hal baru baik teknologi secara umum maupun perkembangan teknologi dalam dunia pendidikan Perkembangan teknologi tersebut menuntut pendidik untuk mengembangkan pembelajaran yang inovatif Salah satunya menggunakan multimedia interaktif yang dikemas dalam bentuk e modul atau modul elektronik dengan memanfaatkan aplikasi adobe flash cs Penelitian ini menggunakan metode penelitian dan pengembangan r d dengan prosedur penelitian dan pengembangan r d addie yang digabungkan dengan borg gall meliputi tahap yaitu analisis analisis kebutuhan design media pembelajaran development validasi media dan materi implementasi uji coba terbatas dan uji coba lapangan dan evaluasi revisi tiga kali E modul ini divalidasi oleh dua validator sebanyak tiga kali yaitu produk awal setelah uji coba terbatas dan setelah uji coba lapangan Berikut adalah hasil yang diperoleh pada tahap terakhir validasi diantaranya validasi ahli media sebesar validasi ahli materi sebesar dan validasi siswa ', 'teknologi pesat hasil teknologi teknologi dunia didik teknologi tuntut didik kembang pembelajaran inovatif salah satu multimedia interaktif kemas bentuk modul modul elektronik manfaat aplikasi adobe flash cs kembang prosedur kembang addie gabung borg gall liput tahap analisis analisis butuh design media pembelajaran development validasi media materi implementasi uji coba batas uji coba lapang evaluasi revisi kali modul divalidasi validator kali produk uji coba batas uji coba lapang  tahap validasi validasi ahli media validasi ahli materi validasi siswa ', 2),
(49, ' Pengembangan media autoplay untuk meningkatkan hasil belajar siswa  Pada mata pelajaran prinsip-prinsip bisnis	', 'Penelitian pengembangan ini dilaksanakan dengan tujuan untuk menghasilkan produk pengembangan media pembelajaran audio visual pada kompetensi dasar etika bisis Penelitian dilakukan juga untuk mengetahui perbedaan hasil belajar siswa kelas x pemasaran di smk negeri blitar dengan menggunakan media audio visual dan tanpa mengunakan media pembelajaran audio visual Jenis penelitian pengembangan yang digunakan ini merupakan penelitian pengembangan media audio visual menggunakan langkah langkah metode research and development r d yang dikembangkan oleh sugiyono Hasil analisis data menunjukkan bahwa pengembangan media pembelajaran audio visual dapat meningkatkan hasil belajar siswa Saran pemanfaatan media audio visual ini yaitu produk ini diharapakan dapat dijadikan referensi guru mata pelajaran untuk mendukung kegiatan pembelajaran di kelas komponen lain seperti animasi pembuka yang lebih menarik serta video tutorial bagi siswa ', 'kembang laksana hasil produk kembang media pembelajaran audio visual kompetensi dasar etika bisis beda ajar siswa kelas asar smk negeri blitar media audio visual guna media pembelajaran audio visual jenis kembang kembang media audio visual langkah langkah research and development kembang sugiyono analisis data kembang media pembelajaran audio visual tingkat ajar siswa saran manfaat media audio visual produk diharapakan jadi referensi guru mata ajar dukung giat pembelajaran kelas komponen animasi buka tarik video tutorial siswa ', 2),
(50, ' Peningkatan hasil belajar kompetensi dasar mengklasifikasikan jenis bisnis ritel melalui model discovery learning dengan media mind mapping	', 'Penelitian ini bertujuan untuk mengetahui bagaimana penerapan model discovery learning dengan menggunakan media mind mapping pada kompetensi dasar mengklasifikasikan jenis bisnis ritel dan apakah penerapan model discovery learning dengan menggunakan media mind mapping dapat meningkatkan hasil belajar siswa  Penelitian dilakukan dengan pendekatan kualitatif dan kuantitatif dalam rancangan penelitian tindakan kelas dengan dua siklus dengan waktu penelitian untuk masing masing siklus   pertemuan     x    menit  Yang hasilnya menunjukkan bahwa melalui penggunaan model discovery learning dengan media mind mapping hasil belajar siswa baik dalam ranah pengetahuan  ketrampilan  maupun sikap mengalami peningkatan ', 'terap model discovery learning media mind mapping kompetensi dasar klasifikasi jenis bisnis ritel terap model discovery learning media mind mapping tingkat ajar siswa dekat kualitatif kuantitatif rancang tindak kelas siklus siklus temu menit hasil guna model discovery learning media mind mapping ajar siswa ranah pengetahuan ketrampilan sikap alami tingkat ', 2),
(61, 'The effectiveness of transtheoretical model to reduce compulsive internet use of senior high school students	', 'Penelitian ini bertujuan mengetahui keefektifan transtheoretical model untuk menurunkan compulsive internet use siswa sekolah menengah atas  sma   Penelitian ini menggunakan rancangan single subject design  Subjek penelitian terdiri dari empat siswa kelas x sma kolese santo yusup malang yang memiliki skor compulsive internet use dalam kategori tinggi  Instrumen yang dipergunakan dalam penelitian ini adalah panduan pelaksanaan konseling transtheoretical model  skala compulsive internet use  pedoman observasi dan pedoman wawancara  Hasil penelitian yang dianalisis menggunakan analisis visual menunjukkan adanya perbedaan tingkat compulsive internet use siswa sebelum dan sesudah diberikan intervensi berupa konseling transtheoretical model ', 'efektif transtheoretical model turun compulsive internet use siswa sekolah tengah sma rancang single subject design subjek siswa kelas sma kolese santo yusup malang milik skor compulsive internet use kategori instrumen pandu laksana konseling transtheoretical model skala compulsive internet use pedoman observasi pedoman wawancara analisis analisis visual beda tingkat compulsive internet use siswa intervensi konseling transtheoretical model ', 3),
(62, 'Pengembangan panduan pelatihan keterampilan mengelola emosi sebagai upaya preventif perilaku bullying siswa sekolah menengah pertama	', 'Penelitian ini bertujuan untuk mengembangkan panduan pelatihan keterampilan mengelola emosi sebagai upaya preventif perilaku bullying siswa sekolah menengah pertama  smp   Metode yang digunakan dalam penelitian ini ialah model penelitian dan pengembangan  Subjek uji coba pada penelitian ini melibatkan ahli bimbingan dan konseling  bk   ahli psikologi  ahli teknologi pendidikan  tep  dan konselor sekolah  Instrumen yang digunakan adalah skala keterampilan mengelola emosi untuk siswa  instrumen penilaian ahli dan instrumen penilaian konselor  Data hasil penilaian dari ahli bk  ahli psikologi  ahli tep dan tiga konselor sekolah di tiga sekolah berbeda kota malang menunjukkan bahwa produk yang dikembangkan dapat diterima dan layak digunakan untuk peningkatan keterampilan mengelola emosi sebagai upaya preventif perilaku bullying siswa smp ', 'kembang pandu latih terampil kelola emosi upaya preventif perilaku bullying siswa sekolah tengah smp model kembang subjek uji coba libat ahli bimbing konseling bk ahli psikologi ahli teknologi didik p konselor sekolah instrumen skala terampil kelola emosi siswa instrumen nilai ahli instrumen nilai konselor data nilai ahli bk ahli psikologi ahli p konselor sekolah sekolah beda kota malang produk kembang terima layak tingkat terampil kelola emosi upaya preventif perilaku bullying siswa smp ', 3),
(63, 'Hubungan antara persepsi terhadap layanan bimbingan belajar dengan kemandirian belajar peserta didik sekolah menengah pertama	', 'Penelitian ini bertujuan untuk mengetahui hubungan antara persepsi terhadap layanan bimbingan belajar dengan kemandirian belajar peserta didik sekolah menengah pertama  smp   Penelitian ini merupakan penelitian korelasi dan expose facto  Populasi penelitian ini adalah seluruh peserta smp negeri    yogyakarta yang berjumlah     orang  Sampel sejumlah     peserta didik ditentukan dengan teknik proportional stratified random sampling  Metode pengumpulan data menggunakan skala persepsi terhadap layanan bimbingan belajar dan skala kemandirian belajar  Uji validitas instrumen menggunakan koefisien korelasi product moment  Uji reliabilitas dengan menggunakan teknik alpha cronbach  diperoleh p         untuk variabel persepsi terhadap layanan bimbingan belajar  dan p         untuk variabel kemandirian belajar  Teknik analisis menggunakan analisis statistik  Hasil penelitian menunjukkan bahwa ada hubungan positif antara persepsi terhadap layanan bimbingan belajar dengan kemandirian belajar peserta didik smp negeri    yogyakarta ', 'hubung persepsi layan bimbing ajar mandiri ajar serta didik sekolah tengah smp korelasi expose facto populasi serta smp negeri yogyakarta orang sampel serta didik tentu teknik proportional stratified random sampling kumpul data skala persepsi layan bimbing ajar skala mandiri ajar uji validitas instrumen koefisien korelasi product moment uji reliabilitas teknik alpha cronbach  variabel persepsi layan bimbing ajar variabel mandiri ajar teknik analisis analisis statistik hubung positif persepsi layan bimbing ajar mandiri ajar serta didik smp negeri yogyakarta ', 3),
(64, 'Studi komparasi kinerja konselor dalam layanan konseling individual berdasarkan self evaluation dan peer evaluation	', 'Tujuan penelitian ini adalah untuk melakukan evaluasi kinerja konselor sekolah dalam menyelenggarakan layanan konseling individual melalui self evaluation dan peer evaluation  Penelitian ini menggunakan pendekatan descriptive survey melalui rancangan descriptive comparative study  Subjek adalah konselor di daerah istimewa yogyakarta  diy   khususnya kabupaten bantul  Teknik analisis menggunakan rumus mann whitney u  Berdasarkan analisis hasil penelitian diperoleh nilai signifikansi mann whitney u antara self evaluation dengan peer evaluation yaitu sebesar                Artinya tidak ada perbedaan signifikan penilaian kinerja konselor berdasarkan pengisian instrumen self evaluation dan peer evaluation ', 'evaluasi kinerja konselor sekolah selenggara layan konseling individual self evaluation peer evaluation dekat descriptive survey rancang descriptive comparative study subjek konselor daerah istimewa yogyakarta y kabupaten bantul teknik analisis rumus mann whitney dasar analisis  nilai signifikansi mann whitney self evaluation peer evaluation beda signifikan nilai kinerja konselor dasar isi instrumen self evaluation peer evaluation ', 3),
(65, 'Meningkatkan percaya diri siswa melalui teknik cognitive defusion', 'Tujuan penelitian ini adalah untuk mengetahui keefektifan teknik cognitive defusion untuk meningkatkan percaya diri siswa  Penelitian ini menggunakan pre experimental design dengan rancangan one group pre test post test design  Subjek dalam penelitian ini melibatkan enam siswa sekolah menengah kejuruan  smk  di kota yogyakarta yang memiliki tingkat percaya diri rendah  Instrumen yang digunakan adalah skala percaya diri  Analisis yang digunakan untuk menguji perbedaan percaya diri sebelum dan sesudah diberikan perlakuan konseling teknik cognitive defusion adalah uji jenjang bertanda wilcoxon  Hasil menunjukkan bahwa terdapat kenaikan skor tingkat percaya diri siswa setelah diberikan perlakuan berupa konseling teknik cognitive defusion  Dapat disimpulkan bahwa teknik cognitive defusion efektif untuk meningkatkan tingkat percaya diri siswa ', 'efektif teknik cognitive defusion tingkat percaya siswa pre experimental design rancang one group pre test post test design subjek libat enam siswa sekolah tengah juru smk kota yogyakarta milik tingkat percaya rendah instrumen skala percaya analisis uji beda percaya laku konseling teknik cognitive defusion uji jenjang tanda wilcoxon naik skor tingkat percaya siswa laku konseling teknik cognitive defusion simpul teknik cognitive defusion efektif tingkat tingkat percaya siswa ', 3),
(66, 'Tracer study alumni: upaya pengembangan prodi bimbingan konseling universitas negeri makassar	', 'Tujuan penelitian untuk mengetahui profil alumni mahasiswa bimbingan dan konseling masa tunggu alumni bimbingan dan konseling relevansi program studi dengan kebutuhan pasar kerja tanggapan pengguna alumni Penelitian bersifat deskriptif kualitatif menggunakan metode survei Analisis yang dilakukan dengan persentase dan menggunakan tahapan yaitu reduksi data penyajian data dan pengambilan kesimpulan Hasil penelitian yaitu penelusuran melalui instrumen tracer study memberikan gambaran pencapaian ipk lulusan rata rata atau di antara dan terdapat cumlaude atau Masa studi alumni prodi bimbingan dan konseling terbilang cepat yaitu masa studi tahun terdapat serta alumni menyelesaikan studi dengan tepat pada masa waktu yaitu tahun Demikian halnya masa tunggu mendapat pekerjaan pertama sangat cepat yaitu paling lama bulan dengan persentase Pekerjaan yang paling banyak ditempati oleh alumni adalah guru bimbingan dan konseling dengan data Pengguna menyarankan peningkatan kompetensi alumni dalam bidang bahasa asing khususnya bahasa inggris kecakapan atau keterampilan pengembangan diri serta penguasaan teknologi perlu lebih dikembangkan ', 'profil alumni mahasiswa bimbing konseling tunggu alumni bimbing konseling relevansi program studi butuh pasar kerja tanggap guna alumni sifat deskriptif kualitatif survei analisis persentase tahap reduksi data saji data simpul telusur instrumen tracer study gambar capai ipk lulus cumlaude studi alumni prodi bimbing konseling bilang cepat studi alumni selesai studi hal tunggu kerja cepat persentase kerja tempat alumni guru bimbing konseling data guna saran tingkat kompetensi alumni bidang bahasa asing bahasa inggris cakap terampil kembang kuasa teknologi kembang ', 3),
(67, 'Tingkat prokrastinasi akademik siswa sekolah menengah pertama muhammadiyah 9 yogyakarta	', 'Prokrastinasi akademik merupakan salah satu permasalahan yang terjadi di kalangan pelajar sekolah menengah pertama  smp   Penelitian ini bertujuan untuk mendeskripsikan tingkat prokrastinasi akademik siswa smp muhammadiyah   yogyakarta  Penelitian ini menggunakan jenis penelitian deskriptif kuantitatif  Hasil penelitian menunjukkan bahwa       pelajar smp muhammadiyah   yogyakarta memiliki prokrastinasi akademik tinggi        sedang  dan      rendah  Berdasarkan hasil penelitian tersebut  direkomendasikan agar peneliti selanjutnya menggunakan konseling ringkas berfokus solusi untuk mereduksi perilaku prokrastinasi akademik siswa smp muhammadiyah   yogyakarta ', 'prokrastinasi akademik salah masalah kalangan ajar sekolah tengah smp deskripsi tingkat prokrastinasi akademik siswa smp muhammadiyah yogyakarta jenis deskriptif kuantitatif ajar smp muhammadiyah yogyakarta milik prokrastinasi akademik rendah dasar rekomendasi teliti konseling ringkas fokus solusi reduksi perilaku prokrastinasi akademik siswa smp muhammadiyah yogyakarta ', 3),
(68, 'Model pembelajaran berbasis penstimulasian multiple intelligences siswa	', 'Tulisan ini membahas mengenai penerapan teori multiple intelligences dalam pembelajaran di sekolah  Pembahasan diawali dengan menguraikan perkembangan konsep inteligensi dan multiple intelligences  Diikuti dengan menjelaskan dampak teori multiple intelligences dalam bidang pendidikan dan pembelajaran di sekolah  Bagian selanjutnya menguraikan tentang implementasi teori multiple intelligences dalam praktik pembelajaran di kelas yaitu bagaimana pemberian pengalaman belajar siswa yang difasilitasi guru dapat menstimulasi multiple intelligences siswa  Evaluasi hasil belajar siswa dari pandangan penerapan teori multiple intelligences seharusnya dilakukan menggunakan authentic assessment dan portofolio yang lebih memfasilitasi para siswa mengungkapkan atau mengaktualisasikan hasil belajarnya melalui berbagai cara sesuai dengan kekuatan jenis inteligensinya ', 'tulis bahas terap teori multiple intelligences pembelajaran sekolah bahas awal urai konsep inteligensi multiple intelligences ikut dampak teori multiple intelligences bidang didik pembelajaran sekolah urai implementasi teori multiple intelligences praktik pembelajaran kelas beri pengalaman ajar siswa fasilitas guru stimulasi multiple intelligences siswa evaluasi ajar siswa pandang terap teori multiple intelligences authentic assessment portofolio fasilitas siswa aktualisasi ajar sesuai kuat jenis inteligensi ', 3),
(69, 'Pengembangan paket bimbingan perencanaan studi lanjut dengan model creative problem solving bagi siswa sekolah menengah atas	', 'Penelitian ini bertujuan untuk menghasilkan produk berupa paket bimbingan perencanaan studi lanjut dengan model creative problem solving bagi siswa sma yang memenuhi aspek keberterimaan yaitu aspek ketepatan  kegunaan  kemudahan dan kemenarikan  Paket bimbingan tersebut terdiri atas buku panduan konselor yang berisi langkah langkah pemberian bimbingan sesuai tahapan dalam perencanaan karier dan buku panduan siswa yang berisi materi serta evaluasi  Metode penelitian ini diadaptasi dari model research and development  r d  prosedural borg   gall         Uji ahli dan uji lapangan terbatas  calon pengguna  dianalisis menggunakan inter rater agreement model  gregory         Indeks validitas uji ahli materi  media dan calon pengguna konselor menunjukkan kriteria sangat tinggi  Produk ini memenuhi kriteria sangat tepat  sangat berguna  sangat mudah dan sangat menarik sehingga bermakna sangat layak untuk digunakan  Berdasarkan uji tersebut dapat disimpulkan bahwa produk paket bimbingan perencanaan studi lanjut telah memenuhi kriteria keberterimaan ', 'hasil produk paket bimbing rencana studi model creative problem solving siswa sma penuh aspek terima aspek tepat guna mudah kemenarikan paket bimbing buku pandu konselor risi langkah langkah beri bimbing sesuai tahap rencana karier buku pandu siswa risi materi evaluasi adaptasi model research and development prosedural borg gall uji ahli uji lapang batas calon guna analisis inter rater agreement model gregory indeks validitas uji ahli materi media calon guna konselor kriteria produk penuh kriteria guna mudah tarik makna layak dasar uji simpul produk paket bimbing rencana studi penuh kriteria terima ', 3),
(70, 'Bimbingan kelompok dengan pengajaran formula abcde pendekatan rasional emotif behavior untuk meningkatkan self efficacy mahasiswa calon guru', 'Tujuan penelitian ini yaitu merumuskan dan menyusun desain intervensi bimbingan kelompok dengan pengajaran formula abcde pendekatan rasional emotif behavior serta menguji efektivitas desain intervensi dalam meningkatkan self efficacy calon guru di departemen pendidikan teknologi agro industri universitas pendidikan indonesia  upi   Penelitian menggunakan mixed methods dengan strategi embedded konkuren  kuantitatif sebagai metode primer dan kualitatif sebagai metode sekunder   Teknik analisis data menggunakan analisis data kuantitatif  primer  dan kualitatif  sekunder   Hasil penelitian menunjukkan bahwa secara kuantitatif  bimbingan kelompok dengan pengajaran formula abcde pendekatan rasional emotif behavior belum efektif dalam meningkatkan self efficacy mahasiswa calon guru dengan beberapa faktor penyebab  Dari data kualitatif didapatkan bahwa mahasiswa menyadari akan masalahnya  menyadari ada penyebab keyakinan irasional penyebab masalah  memahami dalam mengatasinya sehingga mahasiswa merasa semakin yakin akan kemampuan untuk menjadi guru  Peneliti selanjutnya diharapkan menindaklanjuti penelitian ini dengan menerapkan desain intervensi kepada mahasiswa yang memiliki self efficacy ketegori rendah dan sedang ', 'rumus susun desain intervensi bimbing kelompok ajar formula abcde dekat rasional emotif behavior uji efektivitas desain intervensi tingkat self efficacy calon guru departemen didik teknologi agro industri universitas didik indonesia upi mixed methods strategi embedded konkuren kuantitatif primer kualitatif sekunder teknik analisis data analisis data kuantitatif primer kualitatif sekunder kuantitatif bimbing kelompok ajar formula abcde dekat rasional emotif behavior efektif tingkat self efficacy mahasiswa calon guru faktor sebab data kualitatif dapat mahasiswa sadar sadar sebab yakin irasional sebab paham atas mahasiswa mampu guru teliti harap menindaklanjuti terap desain intervensi mahasiswa milik self efficacy ketegori rendah ', 3),
(71, 'Keefektifan konseling kelompok cognitive behavior therapy untuk mengurangi keraguan pengambilan keputusan karier siswa sekolah menengah kejuruan	', 'Tujuan penelitian ini adalah untuk mengetahui keefektifan konseling kelompok cognitive behavior therapy dalam menurunkan keraguan pengambilan keputusan karier siswa sekolah menengah kejuruan  Desain penelitian menggunakan pretest posttest control group design  Ada dua jenis instrumen yang digunakan yaitu instrumen pengumpulan data dan panduan eksperimen  Panduan eksperimen terdiri dari buku konseling kelompok kognitif behavioral panduan untuk konselor  sedangkan alat ukur terdiri atas skala keraguan pengambilan keputusan karier yang memiliki validitas nilai r di atas       dan reliabilitas       dan lembar siswa refleksi diri  Analisis data yang digunakan two independent sampel test mann whitney u  Analisis statistik menunjukkan bahwa nilai z hitung   z tabel yaitu        maka h  ditolak  Hal ini menunjukkan bahwa konseling kelompok cognitive behavior therapy efektif untuk menurunkan keraguan pengambilan keputusan karier siswa sekolah menengah kejuruan ', 'efektif konseling kelompok cognitive behavior therapy turun ragu karier siswa sekolah tengah juru desain pretest posttest control group design jenis instrumen instrumen kumpul data pandu eksperimen pandu eksperimen buku konseling kelompok kognitif behavioral pandu konselor alat ukur skala ragu karier milik validitas nilai reliabilitas lembar siswa refleksi analisis data two independent sampel test mann whitney analisis statistik nilai hitung tabel tolak konseling kelompok cognitive behavior therapy efektif turun ragu karier siswa sekolah tengah juru ', 3),
(72, 'Studi meaning of life siswa sekolah menengah pertama etnis tengger	', 'Meaning of life adalah nilai nilai yang dijadikan pedoman hidup  bersifat penting dan berharga  Meaning of life dapat ditemukan dengan menggunakan berbagai kegiatan yang Terkandung dalam tiga sumber nilai  yaitu  nilai kreatif  nilai penghayatan  dan nilai bersikap  Tujuan penelitian ini adalah      mengetahui meaning of life siswa sekolah menengah pertama etnis tengger      mengetahui nilai kreatif yang tercermin dalam diri siswa sekolah menengah pertama etnis tengger      mengetahui nilai penghayatan yang tercermin dalam diri siswa sekolah menengah pertama etnis tengger      mengetahui nilai bersikap yang tercermin dalam diri siswa sekolah menengah pertama etnis tengger  Penelitian ini adalah penelitian kuantitatif menggunakan metode survei  Penelitian ini dilakukan dengan langkah langkah  merumuskan masalah penelitian dan menentukan tujuan survei  menentukan konsep dan menggali kepustakaan  mengambil sampel  membuat kuisioner atau inventori  melakukan pekerjaan lapangan  dan mengolah data  Hasil penelitian menunjukkan bahwa siswa sekolah menengah pertama etnis tengger memiliki meaning of life yang tinggi  hal ini berarti mereka menggunakan pedoman hidup untuk mencapai tujuan hidupnya ', 'meaning of life nilai nilai jadi pedoman hidup sifat penting harga meaning of life temu giat kandung sumber nilai nilai kreatif nilai hayat nilai sikap meaning of life siswa sekolah tengah etnis tengger nilai kreatif cermin siswa sekolah tengah etnis tengger nilai hayat cermin siswa sekolah tengah etnis tengger nilai sikap cermin siswa sekolah tengah etnis tengger kuantitatif survei langkah langkah rumus tentu survei tentu konsep gali pustaka ambil sampel kuisioner inventori kerja lapang o data siswa sekolah tengah etnis tengger milik meaning of life pedoman hidup capai hidup ', 3),
(74, 'Karakter ideal konselor multibudaya berdasarkan nilai luhur semar	', 'Saat ini banyak konselor yang melakukan pelabelan karena kurangnya wawasan multibudaya konselor tersebut Pelabelan yang dilakukan oleh konselor ini dapat berdampak kurang baik terhadap pemilihan strategi intervensi konselor terhadap konselinya Wawasan multibudaya yang dimiliki konselor harus ditingkatkan dengan cara membangun karakter yang ideal pada diri mereka Karakter ideal ini berkaitan dengan pemahaman dan perilaku konselor untuk menyikapi kondisi konseli yang heterogen serta seberapa tinggi rasa ingin tahu minat maupun motivasi konselor untuk senantiasa menambah wawasan multibudaya yang mereka miliki Nilai nilai luhur yang terdapat di dalam diri semar dapat dikaitkan dengan bagaimana karakter ideal konselor multibudaya Penelitian ini bertujuan untuk menjelaskan karakter ideal konselor multibudaya yang diambil dari nilai luhur semar serta mengkaitkan karakter tersebut dengan kompetensi multibudaya konselor Penelitian ini menggunakan pendekatan kualitatif tipe library research Karakter ideal konselor multibudaya yang dapat dirumuskan antara lain religius netral toleransi tulus disiplin peduli sosial bersahabat adil jujur luwes demokratis dan rasa ingin tahu', 'konselor label kurang wawas multibudaya konselor label konselor dampak strategi intervensi konselor konseli wawas multibudaya milik konselor tingkat bangun karakter ideal karakter ideal kait paham perilaku konselor sikap konseli heterogen minat motivasi konselor senantiasa tambah wawas multibudaya milik nilai nilai luhur mar kait karakter ideal konselor multibudaya karakter ideal konselor multibudaya ambil nilai luhur mar kait karakter kompetensi multibudaya konselor dekat kualitatif tipe library research karakter ideal konselor multibudaya rumus religius netral toleransi tulus disiplin peduli sosial sahabat adil jujur luwes demokratis ', 3),
(75, 'Landasan filosofis keterampilan komunikasi konseling	', 'Konseling merupakan kegiatan profesional yang melibatkan hubungan antara seorang konselor dengan individu atau sekelompok individu Layaknya suatu hubungan interpersonal konseling tidak dapat dilepaskan dari berlangsungnya proses interaksi dan komunikasi pada pihak pihak yang terlibat di dalam proses tersebut Penguasaan keterampilan komunikasi merupakan prasyarat dasar bagi konselor untuk dapat menggunakan berbagai keterampilan konseling secara efektif dan efisien Harus dipahami bahwa hampir keseluruhan keterampilan konseling melibatkan keterampilan komunikasi konselor Pemahaman yang baik terhadap keterampilan komunikasi harus didasari oleh pengkajian dan pemahaman mendalam terhadap filsafat komunikasi Penguasaan tersebut memudahkan konselor dalam menggunakan berbagai keterampilan konseling yang telah dirumuskan oleh para ahli sebagai modal untuk memberikan pelayanan bantuan yang berhasil guna bagi konseling ', 'konseling giat profesional libat hubung konselor individu kelompok individu layak hubung interpersonal konseling lepas langsung proses interaksi komunikasi libat proses kuasa terampil komunikasi prasyarat dasar konselor terampil konseling efektif efisien paham terampil konseling libat terampil komunikasi konselor paham terampil komunikasi dasar kaji paham dalam filsafat komunikasi kuasa mudah konselor terampil konseling rumus ahli modal layan bantu hasil konseling ', 3),
(76, 'Keefektifan konseling behavioral teknik modeling dan konseling analisis transaksional teknik role playing untuk meminimalkan kecenderungan perilaku agresif siswa sekolah menengah atas	', 'Penelitian ini bertujuan untuk mengetahui keefektifan konseling behavioral teknik modeling dan konseling analisis transaksional teknik role playing untuk meminimalkan kecenderungan perilaku agresif siswa  Penelitian eksperimen dengan rancangan pretestposttest control group design ini mengambil sampel dengan teknik purposive sampling  Sampel terdiri dari    orang siswa kelas x sekolah menengah atas  sma  laboratorium universitas pendidikan ganesha yang memiliki perilaku agresif tinggi     sampel dibagi secara acak dan merata pada tiga kelompok  yaitu      kelompok eksperimen yang mendapatkan perlakuan konseling behavioral teknik modeling      kelompok eksperimen yang mendapatkan perlakuan konseling analisis transaksional teknik role playing      dan kelompok kontrol  Data kecenderungan perilaku agresif sebelum dan sesudah perlakuan dikumpulkan dengan kuesioner perilaku agresif  kemudian dianalisis dengan uji t  Hasil menunjukkan      konseling behavioral teknik modeling efektif meminimalkan kecenderungan perilaku agresif      konseling analisis transaksional teknik role playing efektif meminimalkan perilaku agresif  dan     konseling analisis transaksional dengan teknik role playing lebih efektif meminimalkan kecenderungan perilaku agresif dibanding konseling behavioral teknik modeling ', 'efektif konseling behavioral teknik modeling konseling analisis transaksional teknik role playing minimal cenderung perilaku agresif siswa eksperimen rancang pretestposttest control group design ambil sampel teknik purposive sampling sampel orang siswa kelas sekolah tengah sma laboratorium universitas didik ganesha milik perilaku agresif sampel bagi acak rata kelompok kelompok eksperimen laku konseling behavioral teknik modeling kelompok eksperimen laku konseling analisis transaksional teknik role playing kelompok kontrol data cenderung perilaku agresif laku kumpul kuesioner perilaku agresif analisis uji konseling behavioral teknik modeling efektif minimal cenderung perilaku agresif konseling analisis transaksional teknik role playing efektif minimal perilaku agresif konseling analisis transaksional teknik role playing efektif minimal cenderung perilaku agresif banding konseling behavioral teknik modeling ', 3),
(77, 'Pengekspresian jatuh cinta siswa sekolah menengah pertama melalui media tulisan kreativitas atau vandalisme	', 'Tujuan penelitian ini adalah untuk mengetahui karakteristik jatuh cinta dan bentuk pengekspresian jatuh cinta melalui media tulisan  coretan  pada siswa sekolah menengah pertama  smp   Pendekatan yang dipilih adalah pendekatan kualitatif dengan jenis penelitian fenomenologi  Subjek adalah siswa smp pancadarma malang  Hasil menunjukkan cinta diekspresikan dalam bentuk perilaku pacaran  cinta yang mendasari hubungan ini adalah cinta romantis sehingga hubungan tidak dapat dikatakan mendalam  unreflective   Dalam pengekspresiannya  cinta dapat diungkapkan secara langsung  lisan dan tindakan  maupun tidak langsung  tulisan   Pengekspresian cinta melalui tulisan dapat diklasifikasi menjadi media tulisan  fasilitas sekolah  fasilitas umum  fasilitas pribadi  media sosial   bentuk tulisan  graffiti  tato  berbalas komentar  bertukar pesan teks  puisi  menulis surat  cerita pendek   dan isi penulisan  perasaan dan keinginan yang ingin diungkapkan   Dapat disimpulkan bahwa ada dua karakteristik utama pengekspresian cinta dalam bentuk tulisan  yaitu cinta yang diekspresikan dalam bentuk karya dan cinta yang diekspresikan dalam bentuk perilaku vandalisme  perusakan  ', 'karakteristik jatuh cinta bentuk ekspresi jatuh cinta media tulis coret siswa sekolah tengah smp dekat pilih dekat kualitatif jenis fenomenologi subjek siswa smp pancadarma malang cinta ekspresi bentuk perilaku pacar cinta dasar hubung cinta romantis hubung dalam unreflective ekspresi cinta langsung lisan tindak langsung tulis ekspresi cinta tulis klasifikasi media tulis fasilitas sekolah fasilitas fasilitas pribadi media sosial bentuk tulis graffiti tato balas komentar tukar pesan teks puisi tulis surat cerita pendek isi tulis rasa simpul karakteristik utama ekspresi cinta bentuk tulis cinta ekspresi bentuk karya cinta ekspresi bentuk perilaku vandalisme perusa ', 3);
INSERT INTO `dataset` (`id`, `judul`, `data_ori`, `data_edit`, `kategori`) VALUES
(78, 'Perbedaan kematangan sosial siswa yang berasal dari sekolah homogen dan sekolah heterogen	', 'Tujuan penelitian ini adalah untuk mendeskripsikan      kematangan sosial siswa dari sekolah homogen dan sekolah heterogen      untuk menguji apakah ada perbedaan tingkat kematangan sosial siswa dari sekolah homogen dan heterogen  Sampel penelitian kuantitatif ini adalah     siswa dari madrasah aliyah swasta  mas  ar risalah dan mas tarbiyah islamiyah  ti  batang kabung  Pemilihan sampel menggunakan teknik proportional random sampling  Instrumen yang digunakan dalam penelitian ini adalah skala kematangan sosial siswa  Data dianalisis dengan statistik deskriptif dan uji t  Temuan penelitian adalah      kematangan sosial siswa dari sekolah heterogen sekolah homogen berada pada kategori tinggi      terdapat perbedaan tingkat kematangan sosial siswa yang berasal dari sekolah yang homogen dan heterogen  dimana tingkat sosial kematangan siswa yang berasal dari sekolah heterogen lebih tinggi ', 'deskripsi matang sosial siswa sekolah homogen sekolah heterogen uji beda tingkat matang sosial siswa sekolah homogen heterogen sampel kuantitatif siswa madrasah aliyah swasta mas ar risalah mas tarbiyah islamiyah t batang kabung sampel teknik proportional random sampling instrumen skala matang sosial siswa data analisis statistik deskriptif uji temu matang sosial siswa sekolah heterogen sekolah homogen kategori beda tingkat matang sosial siswa asal sekolah homogen heterogen tingkat sosial matang siswa asal sekolah heterogen ', 3),
(79, 'Pengaruh metode permainan edukatif terhadap interaksi sosial siswa taman kanak-kanak	', 'Penelitian ini bertujuan mengetahui pengaruh metode permainan edukatif terhadap interaksi sosial siswa taman kanak kanak katolik  tkk   Penelitian kuantitatif ini menggunakan desain penelitian quasi eksperimental dalam bentuk reversal time series design  Populasi dalam penelitian ini adalah    siswa kelas b  tkk st  Fransiskus xaverius tarakan yang kemudian diambil sepuluh siswa sebagai sampel  Teknik pengumpulan data yang digunakan adalah menggunakan observasi  Data dianalisis menggunakan teknik analisis grafik dengan ketentuan pengambilan keputusan analisis grafik berdasarkan  frekuensi  latensi  kecenderungan stabilitas  kecenderungan arah grafik  dan level perubahan  Hasil menunjukkan bahwa permainan edukatif memberikan pengaruh positif yang signifikan terhadap interaksi sosial siswa tkk ', 'main edukatif interaksi sosial siswa taman kanak kanak katolik tkk kuantitatif desain quasi eksperimental bentuk reversal time series design populasi siswa kelas tkk st fransiskus xaverius tarak ambil puluh siswa sampel teknik kumpul data observasi data analisis teknik analisis grafik tentu analisis grafik dasar frekuensi latensi cenderung stabilitas cenderung arah grafik level rubah main edukatif positif signifikan interaksi sosial siswa tkk ', 3),
(84, 'Pengembangan paket pelatihan ground, understand, Revise, use (guru)-karierâ€ untuk meningkatkan Efikasi diri karier calon konselor	', 'Bimbingan dan konseling merupakan suatu sistem yaitu meliputi masalah tujuan teknik media dan evaluasi Suatu teknik dalam pelaksanaan layanan bk tidak dapat berdiri sendiri oleh karena itu perlu diwadahi oleh suatu media Fungsi dari media bimbingan dan konseling adalah untuk memperlancar proses pelaksanan layanan bk tersebut Teknik yang dipilih adalah proses guru ground understand revise use sedangkan media yang dipilih adalah paket pelatihan guru karier Tujuan penelitian ini yaitu untuk menghasilkan media bimbingan dan konseling berupa paket pelatihan guru karier yang dapat diterima secara teoretis dan praktis Penelitian ini menggunakan metode penelitian dan pengembangan Model pengembangan yang digunakan adalah model penelitian dan pengembangan borg gall Paket pelatihan ini terdiri dari eksemplar yaitu paket pelatihan untuk pegangan konselor dan paket pelatihan untuk pegangan konseli Berdasarkan hasil uji ahli bk uji ahli pengembangan media pendidikan uji pengguna dan uji kelompok kecil pada mahasiswa bk calon konselor dapat disimpulkan bahwa paket pelatihan guru karier terbukti layak diterima sebagai media bimbingan dan konseling untuk meningkatkan efikasi diri karier calon konselor Saran yang diajukan dalam penelitian ini antara lain agar para dosen bk dan guru bk konselor dapat menggunakan paket pelatihan guru karier untuk meningkatkan efikasi diri karier calon konselor dapat menggunakan paket pelatihan ini sebagai sarana pengembangan pribadi konselor bagi peneliti selanjutnya dapat menggunakan subjek penelitian yang lebih luas mengganti rancangan penelitian menjadi penelitian eksperimental dengan kelompok kontrol serta penelitian tindakan bimbingan dan konseling ', 'bimbing konseling sistem liput teknik media evaluasi teknik laksana layan bk diri wadah media fungsi media bimbing konseling lancar proses pelaksanan layan bk teknik pilih proses guru ground understand revise use media pilih paket latih guru karier hasil media bimbing konseling paket latih guru karier terima teoretis praktis kembang model kembang model kembang borg gall paket latih eksemplar paket latih pegang konselor paket latih pegang konseli dasar uji ahli bk uji ahli kembang media didik uji guna uji kelompok mahasiswa bk calon konselor simpul paket latih guru karier bukti layak terima media bimbing konseling tingkat efikasi karier calon konselor saran ajuk dosen bk guru bk konselor paket latih guru karier tingkat efikasi karier calon konselor paket latih sarana kembang pribadi konselor teliti subjek luas ganti rancang eksperimental kelompok kontrol tindak bimbing konseling ', 3),
(86, 'Model dialog 4d untuk meningkatkan Kesadaran multi-kultural siswa sma Di kota malang	', 'Seorang konselor akan dikatakan profesional apabila mampu menguasai konsep Dan praksis asesmen untuk memahami kondisi  kebutuhan  dan masalah siswa  menguasai Kerangka teoritik dan praksis bimbingan dan konseling  bk   merancang program bk  Mengimplementasikan program bk yang komprehensif  menilai proses dan hasil kegiatan bk  Memiliki kesadaran dan komitmen terhadap etika profesional serta menguasai konsep dan Praksis penelitian dalam bk  Penelitian ini merupakan penelitian pengembangan  Tahap analisis Kebutuhan dilakukan dengan metode survey  Pada kenyataannya masih banyak ditemukan Konselor yang belum menguasai keseluruhan kompetensi diatas  Hal ini juga disebabkan Karena banyaknya tugas dan tanggung jawab konselor sekolah dalam menangani permasalahan Siswa dibandingkan jumlah konselor di sekolah  Secara ideal satu konselor memegang     Siswa di sekolah  permendiknas no    tahun        Pada kenyataannya di lapangan berdasarkan Hasil observasi pada beberapa sekolah menengah atas  sma  di kota malang  konselor Memegang lebih dari     siswa bahkan ada yang memegang sampai lebih dari     siswa  Dari Uraian data sebagai dipaparkan  dapatlah disimpulkan sebagai berikut      banyak konselor Mengeluh terhadap suasana sekolah yang kurang memungkinkan konselor melaksanakan Konseling dengan baik      konselor membutuhkan strategi alternatif layanan individual karena Mereka kesulitan menerapkan pendekatan konseling dalam semua situasi      konselor harus Kreatif dalam menerapkan layanan dan strategi konseling untuk memberi layanan kepada siswa Dengan baik ', 'konselor profesional kuasa konsep praksis asesmen paham butuh siswa kuasa rangka teoritik praksis bimbing konseling bk rancang program bk implementasi program bk komprehensif nilai proses giat bk milik sadar komitmen etika profesional kuasa konsep praksis bk kembang tahap analisis butuh survey nyata temu konselor kuasa kompetensi atas sebab banyak tugas tanggung konselor sekolah tangan masalah siswa banding konselor sekolah ideal konselor pegang siswa sekolah permendiknas no nyata lapang dasar observasi sekolah tengah sma kota malang konselor pegang siswa pegang siswa urai data papar dapat simpul konselor keluh suasana sekolah konselor laksana konseling konselor butuh strategi alternatif layan individual sulit terap dekat konseling situasi konselor kreatif terap layan strategi konseling layan siswa ', 3),
(91, 'Motion development program for parents of child with cerebral palsy (pengembangan program bina gerak untuk orang tua anak cerebral palsy)', 'Program bina gerak adalah program yang efektif dilaksanakan secara berkelanjutan  Melihat kondisi waktu anak yang lebih banyak berada dirumah dibandingkan dengan saat anak cerebral palsy berada di sekolah atau lembaga terapi  Maka peran orang tua anak cerebral palsy sangat penting guna menunjang kefektifan sebuah program bina gerak  Tujuan pengembangan adalah      mendeskripsikan prototype program bina gerak untuk orang tua anak cerebal palsy     menganalisis kelayakan pengembangan prototype program bina gerak untuk orang tua anak cerebal palsy  Penelitian ini menggunakan r   d dengan desain penelitian  d namun pada penelitian ini hanya pada tahap  d atau define  design  dan develop dikarenakan penulis tidak sampai pada tahap penjualan atau penyebaran produk mengingat keterbatasan waktu  Hasil penelitian yang telah dilakukan  terlihat bahwa pengembangan program bina gerak ini telah berhasil diuji dalam membantu proses program bina gerak yang berkelanjutan  Hal ini ditunjukan pada saat uji coba terbatas hasil dari pengembangan tersebut dapat membantu meningkatkan kefektifan dari sebuah program bina gerak yang memiliki sifat berkelanjutan untuk mencapai tujuan program tersebut  Kesimpulan penelitian adalah     produk yang dihasilkan dalam penelitian ini adalah pengembangan program bina gerak untuk orang tua anak cerebral palsy yang dikemas dalam bentuk buku     penelitian ini menghasilkan produk yang layak berupa pengembangan program bina gerak untuk orang tua anak cerbral palsy  Dikatakan layak karena telah memenuh kriteria  a  valid menurut dua validator ahli materi atau isi   b  valid menurut validator ahli desain produk   c  kategori baik dalam pengamatan peneliti terhadap orang tua dalam memahami program bina gerak dan menerapkannya pada anak cerebral palsy', 'program bina gerak program efektif laksana berkelanjutan anak rumah banding anak cerebral palsy sekolah lembaga terapi peran orang tua anak cerebral palsy penting tunjang kefektifan program bina gerak kembang deskripsi prototype program bina gerak orang tua anak cerebal palsy analisis layak kembang prototype program bina gerak orang tua anak cerebal palsy desain tahap define design develop tulis tahap jual sebar produk batas kembang program bina gerak hasil uji bantu proses program bina gerak berkelanjutan tunjuk uji coba batas kembang bantu tingkat kefektifan program bina gerak milik sifat berkelanjutan capai program simpul produk hasil kembang program bina gerak orang tua anak cerebral palsy kemas bentuk buku hasil produk layak kembang program bina gerak orang tua anak cerbral palsy layak penuh kriteria valid validator ahli materi isi valid validator ahli desain produk kategori amat teliti orang tua paham program bina gerak terap anak cerebral palsy ', 4),
(92, ' Improvement of realistic mathematics learning outcomes with the application of snowball throwing learning model for students with intellectual disability in the grade viii of smplb	', 'Tunagrahita merupakan suatu kondisi di mana intelegensinya berada di bawah rata rata  Jika pembelajaran matematika dengan menggunakan pembelajaran konvensional  maka akan membuat siswa tunagrahita kesulitan dalam memahaminya  Tujuan penelitian ini adalah mendeskripsikan peningkatan hasil belajar pada mata pelajaran matematika  Penelitian ini menggunakan desain ptk  Dilaksanakan dengan dua siklus  Subyek penelitiannya adalah   siswa kelas viii di smplb negeri kedungkandang  Hasil penelitian menunjukkan bahwa pada siklus i mengalami peningkatan rata rata nilai siswa        dan pada siklus ii nilai rata rata siswa mencapai         Kesimpulannya yaitu dengan menggunakan model pembelajaran snowball throwing  terjadi peningkatan hasil belajar antara pratindakan  siklus i  dan siklus ii ', 'tunagrahita intelegensinya pembelajaran matematika pembelajaran konvensional siswa tunagrahita sulit paham deskripsi tingkat ajar mata ajar matematika desain ptk laksana siklus subyek teliti siswa kelas viii smplb negeri kedungkandang siklus alami tingkat nilai siswa siklus i nilai siswa capai simpul model pembelajaran snowball throwing tingkat ajar pratindakan siklus siklus i ', 4),
(93, ' Evaluation of inclusive education policies at the level of primary and secondary education in indonesia (evaluasi kebijakan pendidikan inklusif di tingkat satuan pendidikan dasar dan menengah di indonesia)', 'Penelitian ini mengkaji tentang implementasi pendidikan inklusif di tingkat satuan pendidikan dasar dan menengah di indonesia melalui   dimensi  yaitu dimensi kelembagaan  dimensi kurikulum  dimensi pembelajaran  dimensi penilaian  dimensi kesiswaan  dimensi sdm  dimensi sarana dan prasarana  dimensi peran serta masyarakat  dan dimensi pembiayaan  Penelitian ini menggunakan pendekatan survei dengan melibatkan    sd  smp  smk yang menyelenggarakan pendidikan inklusif dari    kabupaten kota pada   provinsi di indonesia  Sampel provinsi kab kota dan satuan pendidikan dipilih secara purposif random sampling  Pengumpulan data instrumen evaluasi diri sekolah inklusi dari yusuf        yang meliputi form       dan    Analisis data menggunakan statistik deskriptif dengan   kategori yaitu sangat kurang              kurang              sedang              baik             dan sangat baik               Hasil penelitian menunjukkan bahwa implementasi pendidikan inklusif di tingkat satuan pendidikan dasar dan menengah sebagai berikut      aspek kelembagaan rata rata          aspek kurikulum rata rata            aspek pembelajaran rata rata            aspek penilaian dan kenaikan kelas rata rata            aspek kesiswaan rata rata            aspek sumber daya manusia rata rata            aspek sarana dan prasarana rata rata            aspek peran serta masyarakat rata rata        dan     aspek pembiayaan rata rata       ', 'kaji implementasi didik inklusif tingkat satu didik dasar tengah indonesia dimensi dimensi lembaga dimensi kurikulum dimensi pembelajaran dimensi nilai dimensi siswa dimensi sdm dimensi sarana prasarana dimensi peran masyarakat dimensi biaya dekat survei libat sd smp smk selenggara didik inklusif kabupaten kota provinsi indonesia sampel provinsi kab kota satu didik pilih purposif random sampling kumpul data instrumen evaluasi sekolah inklusi yusuf liput form analisis data statistik deskriptif kategori implementasi didik inklusif tingkat satu didik dasar tengah aspek lembaga aspek kurikulum aspek pembelajaran aspek nilai naik kelas aspek siswa aspek sumber daya manusia aspek sarana prasarana aspek peran masyarakat aspek biaya ', 4),
(95, ' Application of polamatika techniques to improve operations multiplication tiled capability in low vision students class vii in slb-a yapti makassar. (penerapan teknik polamatikan untuk meningkatkan kemampuan operasi hitung perkalian bersusun siswa low vi', 'Kemampuan siswa tunanetra kelas vii di slb a yapti makassar dalam mengoperasikan perkalian bersusun masih sangat rendah  Untuk meningkatkan kemampuan operasi perkalian bersusun dicoba dengan menerapkan teknik polamatika  Penelitian ini menggunakan pendekatan kuantitatif dan jenis metode penelitian eksperimen  Desain penelitian eksperimen yang dipergunakan adalah single subject research a b a  a  baseline      b  intervensi    a  baseline      Subyek penelitian adalah subjek yang diteliti dalam penelitian ini adalah satu orang siswa tunanetra laki laki jenis low vision  inisial hd  kelas vii di slb a yapti makassar  Teknik pengumpulan data dalam penelitian ini adalah melalui tes dan observasi  Data yang diperoleh diolah secara deskriptif kuantitatif  Hasil penelitian menunjukan bahwa kemampuan operasi perkalian bersusun pada siswa low vision kelas vii di slb a yapti makassar setelah menggunakan teknik polamatika pada operasi perkalian bersusun bilangan puluhan dengan satuan  dan puluhan dengan puluhan  dapat mencapai target behavior  meskipun pada operasi perkalian bersusun bilangan ratusan dengan satuan dan ratusan dengan puluhan belum dapat sepenuhnya mencapai target behaviour  Berdasarkan hasil penelitian tersebut dapat disimpulkan bahwa terjadi peningkatan kemampuan operasi perkalian bersusun pada siswa low vision di slb a yapti makassar setelah menggunakan teknik polamatika ', 'mampu siswa tunanetra kelas vii slb yapti makassar operasi kalian susun rendah tingkat mampu operasi kalian susun coba terap teknik polamatika dekat kuantitatif jenis eksperimen desain eksperimen single subject research baseline intervensi baseline subyek subjek orang siswa tunanetra laki laki jenis low vision inisial hd kelas vii slb yapti makassar teknik kumpul data tes observasi data  o deskriptif kuantitatif tunjuk mampu operasi kalian susun siswa low vision kelas vii slb yapti makassar teknik polamatika operasi kalian susun bilang puluh satu puluh puluh capai target behavior operasi kalian susun bilang ratus satu ratus puluh penuh capai target behaviour dasar simpul tingkat mampu operasi kalian susun siswa low vision slb yapti makassar teknik polamatika ', 4),
(96, ' The effect of forward chaining method towards self-help ability for wearing buttoned clothe for students with intellectual disability in the grade vii (pengaruh metode forward chaining terhadap kemampuan bina diri memakai baju berkancing pada peserta did', 'Tujuan dari penelitian ini adalah     untuk mendeskripsikan kemampuan peserta didik tunagrahita sedang dalam kemampuan bina diri memakai baju berkancing sebelum diberikan intervensi menggunakan metode forward chaining     untuk mendeskripsikan kemampuan peserta didik tunagrahita sedang dalam kemampuan bina diri memakai baju berkancing setelah diberikan intervensi menggunakan metode forward chaining     pengaruh metode forward chaining terhadap kemampuan bina diri memakai baju berkancing  Metode yang digunakan pada penelitian ini yaitu metode eksperimen dengan menggunakan single subject reseach  ssr  dengan model a b a  Presentase overlap antara kondisi baseline    a   ke intervensi sebesar    yang menunjukkan tidak ada tumpang tindih ', 'deskripsi mampu serta didik tunagrahita mampu bina maka baju kancing intervensi forward chaining deskripsi mampu serta didik tunagrahita mampu bina maka baju kancing intervensi forward chaining forward chaining mampu bina maka baju kancing eksperimen single subject reseach ssr model presentase overlap baseline intervensi tumpang tindih ', 4),
(97, '  Establishment of intellectual disability students employee responsibilities as cleaning service at the post-school periode â€œethnographic study at slb pembina national in the level section câ€ (pembentukan tanggung jawab kerja siswa tunagrahita pas', 'Dari studi pendahuluan dan observasi untuk siswa tuna grahita sebagai cleaning service sebagai bagian dari program pasca sekolah dari slb pembina nasional c malang  mereka bekerja dengan semangat  disiplin dan baik dan puas dalam pelayanan  Penelitian ini menggunakan pendekatan kualitatif jenis etnografi melalui wawancara  observasi dan dokumentasi untuk menggambarkan bagaimana pembentukan tanggung jawab kerja anak tuna grahita cleaning service  Ada   cleaning service sebagai subjek penelitian  Tujuan dari penelitian ini adalah untuk mendeskripsikan      program pelatihan ketrampilan     konsep pelatih keterampilan     bentuk pengawasan yang dilakukan dan     bentuk tanggung jawab kerja siswa tuna grahita pada program masa pasca sekolah sebagai cleaning service  Hasil wawancara terhadap informan adalah      program pelatihan sebagai keterampilan cleaning service yang diberikan sesuai dengan minat dan potensi anak      konsep pelatih dalam memberikan materi dan metode yang digunakan pun mudah  menyenangkan dan dapat dikerjakan      pengawasan yang menyentuh yang melibatkan guru  orang tua  dan program pengawasan rutin membuat anak taat dan bahagia sebagai petugas kebersihan      pembentukan tanggung jawab kerja siswa tuna grahita pasca sekolah sebagai pembina yang berdedikasi  disiplin dan pekerja keras  pelayanan dengan hasil memuaskan  Saran bagi kepala sekolah untuk memberikan rasa kepercayaan diri pada anak tuna grahita pada program pasca sekolah pada berbagai jenis pekerjaan sebagai cleaning service  dan tidak terbatas hanya pada jenis pekerjaan di luar gedung ', 'studi dahulu observasi siswa tuna grahita cleaning service program pasca sekolah slb bina nasional malang semangat disiplin puas layan dekat kualitatif jenis etnografi wawancara observasi dokumentasi gambar bentuk tanggung kerja anak tuna grahita cleaning service cleaning service subjek deskripsi program latih ketrampilan konsep latih terampil bentuk awas bentuk tanggung kerja siswa tuna grahita program pasca sekolah cleaning service wawancara informan program latih terampil cleaning service sesuai minat potensi anak konsep latih materi mudah senang awas sentuh libat guru orang tua program awas rutin anak taat bahagia tugas bersih bentuk tanggung kerja siswa tuna grahita pasca sekolah bina dedikasi disiplin kerja keras layan muas saran kepala sekolah percaya anak tuna grahita program pasca sekolah jenis kerja cleaning service batas jenis kerja gedung ', 4),
(98, '  The effect of human doll media usage on the special program of reproduction health towards the ability of self-care of reproduction health for students with hearing impairment at smplb malang (pengaruh penggunaan media boneka human doll pada program khu', 'Siswa tunarungu adalah anak yang tidak mampu mendengar mengakibatkan sulit memahami materi pembelajaran yang bersifat abstrak  Penelitian ini bertujuan untuk menganalisis pengaruh penggunaan media boneka human doll pada program khusus kesehatan reproduksi terhadap kemampuan merawat kesehatan reproduksi  Metode penelitian yang digunakan adalah quasi experiment dengan desain penelitian one group pretest and posttes design  Teknik analisis menggunakan uji wilcoxon  Hasil penelitian penggunaan media boneka human doll berpengaruh pada program khusus kesehatan reproduksi terhadap kemampuan merawat kesehatan reproduksi siswi tunarungu di smplb b yptb malang  Saran ditujukan kepada guru untuk menerapkan penggunaan media boneka human doll pada pembelajaran program khusus kesehatan reproduksi ', 'siswa tunarungu anak dengar akibat sulit paham materi pembelajaran sifat abstrak analisis guna media boneka human doll program khusus sehat reproduksi mampu rawat sehat reproduksi quasi experiment desain one group pretest and posttes design teknik analisis uji wilcoxon guna media boneka human doll pengaruh program khusus sehat reproduksi mampu rawat sehat reproduksi siswi tunarungu smplb yptb malang saran guru terap guna media boneka human doll pembelajaran program khusus sehat reproduksi ', 4),
(99, ' The development of a selalu hemat energi e-learning-based instructional material for enhancement learning result of students with hearing impairment (pengembangan bahan ajar tema selalu hemat energi berbasis e-learning untuk peningkatan hasil belajar sis', 'Penelitian ini bertujuan untuk mengembangkan materi pembelajaran berbasis pembelajaran e learning di kelas vii siswa tuna rungu  Beberapa masalah dalam penelitian ini adalah     siswa tidak mengerti bagaimana mengidentifikasi beberapa sumber energi  panas  listrik  cahaya dan bumi  yang ada di lingkungan  akibatnya hasil pembelajaran tidak dapat dicapai secara optimal     media pembelajaran membutuhkan peningkatan kuantitas dan kualitas  Tujuannya adalah untuk mendeskripsikan     proses perancangan bahan ajar berbasis e learning terpadu dengan tema selalu hemat energi     umpan balik ahli materi  praktisi pendidikan khusus tuna rungu dan ahli media pembelajaran     try out untuk kelompok kecil dan uji lapangan  dan    menganalisis keefektifan produk yang dikembangkan  Data dikumpulkan melalui kuesioner  evaluasi siswa  pretest dan posttest  Data dianalisis dengan deskriptif kualitatif  uji statistik deskriptif t test  Menurut pakar materi dan pakar praktisi produk sangat bagus  Dari umpan balik pakar media pembelajaran  produk dikategorikan sangat bagus  Hasil uji kelompok kecil itu sangat bagus  Hasil penilaian uji lapangan sangat bagus  Hasil tes dengan spss versi    berada pada tingkat signifikansi     Hasil pengujian skala luas menggunakan uji t menunjukkan pretest dan posttes       dan        sehingga ho ditolak  Dengan kata lain  ada perbedaan yang signifikan antara hasil belajar siswa sebelum dan sesudah digunakan bahan ajar ', 'kembang materi pembelajaran basis pembelajaran learning kelas vii siswa tuna rungu siswa erti identifikasi sumber energi panas listrik cahaya bumi lingkung pembelajaran capai optimal media pembelajaran butuh tingkat kuantitas tuju deskripsi proses rancang bahan ajar basis learning padu tema hemat energi umpan ahli materi praktisi didik khusus tuna rungu ahli media pembelajaran try out kelompok uji lapang analisis efektif produk kembang data kumpul kuesioner evaluasi siswa pretest posttest data analisis deskriptif kualitatif uji statistik deskriptif test pakar materi pakar praktisi produk bagus umpan pakar media pembelajaran produk kategori bagus uji kelompok bagus nilai uji lapang bagus tes spss versi tingkat signifikansi uji skala luas uji pretest posttes ho tolak beda signifikan ajar siswa bahan ajar ', 4),
(100, '  The appointed head master''s perception about the inclusive education policy in ambon city (persepsi kepala sekolah penunjukan terhadap kebijakan pendidikan inklusif di kota ambon)	', 'Kebijakan pemerintah tentang pendidikan inklusi diatur melalui peraturan menteri pendidikan nasional republik indonesia nomor tahun yang menjadi peraturan formal yang mencakup pelaksanaan pendidikan inklusif di indonesia Di kota ambon proses transmisi informasi pada kebijakan pendidikan inklusif telah dilaksanakan oleh dinas pendidikan kota ambon melalui serangkaian kegiatan sosialisasi baik secara internal maupun eksternal Namun isu ini masih kontroversi di kalangan sekolah antara yang menerima dan menolak model pendidikan inklusif Situasi tersebut mengindikasikan bahwa pelaksanaan kebijakan yang dikeluarkan oleh pemerintah pusat dan pemerintah daerah belum diserap oleh pemangku kepentingan di tingkat bawah Berdasarkan permasalahan di atas penelitian ini sangat dibutuhkan untuk mengetahui persepsi kepala sekolah tentang kebijakan pendidikan inklusif di kota ambon Tujuan dari penelitian ini adalah untuk menggali berbagai informasi yang berkaitan dengan persepsi sekolah tentang kebijakan pendidikan inklusif Penelitian ini menggunakan pendekatan kualitatif dengan melakukan wawancara mendalam dan analisis dengan menggunakan flow model of analysis Kegiatan dalam analisis meliputi reduksi data penyajian data serta interpretasi dan kesimpulan Hasil dari prinsipal pelaksana pendidikan memiliki persepsi yang berbeda tentang pendidikan inklusi Dari aspek strategi pendidikan inklusif ada kepala sekolah yang dapat memahami tentang kebijakan pendidikan inklusi Sedangkan kepala sekolah tidak mengerti Kesimpulan dari penelitian ini adalah persepsi kebijakan pendidikan inklusif dari kepala sekolah yang menerapkan pendidikan inklusi belum memahami pendidikan inklusi secara mendalam ', 'bijak perintah didik inklusi atur atur menteri didik nasional republik indonesia nomor atur formal cakup laksana didik inklusif indonesia kota ambon proses transmisi informasi bijak didik inklusif laksana nas didik kota ambon rangkai giat sosialisasi internal eksternal isu kontroversi kalangan sekolah terima tolak model didik inklusif situasi indikasi laksana bijak keluar perintah pusat perintah daerah serap mang penting tingkat dasar masalah butuh persepsi kepala sekolah bijak didik inklusif kota ambon gali informasi kait persepsi sekolah bijak didik inklusif dekat kualitatif wawancara dalam analisis flow model of analysis giat analisis liput reduksi data saji data interpretasi simpul prinsipal laksana didik milik persepsi beda didik inklusi aspek strategi didik inklusif kepala sekolah paham bijak didik inklusi kepala sekolah erti simpul persepsi bijak didik inklusif kepala sekolah terap didik inklusi paham didik inklusi dalam ', 4),
(102, '  Increasing students capabilities in writing simple present tense through engklek modification with ctl approach (meningkatkan kemampuan siswa tunarungu dalam menulis simple present tense melalui engklek modifikasi dengan pendekatan ctl)', 'Penelitian ini di latarbelakangi oleh rendahnya kemampuan siswa tunarungu di slb negeri gunungkidul dalam menulis simple present tense Untuk mengatasi permasalahan ini peneliti melakukan penelitian tindakan kelas dengan menggunakan engklek modifikasi dengan pendekatan ctl untuk meningkatakan kemampuan siswa dalam menulis simple present tense Maka dari itu penelitian ini bertujuan untuk mendeskripsikan peningkatan kemampuan siswa kelas vii slb negeri gunungkidul dalam menulis simple present tense melalui engklek modifikasi dengan pendekatan ctl Metode yang digunakan dalam penelitian ini adalah penelitian tindakan kelas dengan desain penelitian model spiral oleh kemmis and mctaggart Penelitian ini dilaksanakan dalam siklus Tiap siklus terdiri atas tahapan perencanaan pelaksanaan observasi dan refleksi Subjek penelitian ini adalah siswa tunarungu kelas vii di slb negeri gunungkidul Teknik pengumpulan data yang digunakan yaitu tes observasi dan dokumentasi Dapat disimpulkan bahwa pembelajaran engklek modifikasi dengan pendekatan ctl dapat meningkatakan kemampuan siswa dalam menulis simple present tense Sehingga disarankan agar guru menggunakan engklek modifikasi dengan pendekatan ctl untuk pembelajaran menulis simple present tense ', 'rendah mampu siswa tunarungu slb negeri gunungkidul tulis simple present tense atas masalah teliti tindak kelas engklek modifikasi dekat ctl meningkatakan mampu siswa tulis simple present tense deskripsi tingkat mampu siswa kelas vii slb negeri gunungkidul tulis simple present tense engklek modifikasi dekat ctl tindak kelas desain model spiral kemmis and mctaggart laksana siklus siklus tahap rencana laksana observasi refleksi subjek siswa tunarungu kelas vii slb negeri gunungkidul teknik kumpul data tes observasi dokumentasi simpul pembelajaran engklek modifikasi dekat ctl meningkatakan mampu siswa tulis simple present tense saran guru engklek modifikasi dekat ctl pembelajaran tulis simple present tense ', 4),
(103, '  The puberty meaning of autistic adolescent in their parentsâ€™ viewpoint â€œphenomenological studyâ€ (makna pubertas remaja autis bagi orangtua â€œkajian fenomenologiâ€)	', 'Remaja autis mengalami masa pubertas turbulensi yang dirasakan menyimpang dari remaja lainnya seperti adanya manipulasi seks emosi dan minat yang tidak stabil pada lawan jenis Tujuan dari penelitian ini adalah untuk mendapatkan gambaran atau makna sudut pandang orang tua tentang pubertas autis remaja kecemasan orang tua dalam menghadapi pubertas pubertas remaja harapan orang tua terhadap pubertas remaja dan penerimaan orang tua terhadap pubertas pubertas remaja Penelitian ini menggunakan pendekatan kualitatif fenomenologis dengan melakukan wawancara mendalam Desain penelitian terdiri dari karya pre field work diikuti oleh in the field yang terdiri dari getting in getting long and getting out Data kerja terdiri dari pengkodean dan pengkategorian untuk mendapatkan kesimpulan Dari analisis data dengan menggunakan flow model hasil penelitian tentang makna pubertas bagi orang tua t adalah dengan menafsirkan agresi t sebagai anugerah tuhan membuat orang tua sadar dan belajar lebih banyak kondisi anak mereka saat ini karena hasilnya adalah kebahagiaan Masa pubertas bagi orang tua s adalah sebagai tahap alami walaupun pubertasnya berbeda dengan anak anak lain yang rata rata Kesimpulan dari penelitian untuk orang tua t adalah menafsirkan kondisi tersebut sebagai pemberian tuhan kepada remaja autis mereka dan sebagai sesuatu proses alami yang harus dilalui oleh remaja mereka Sedangkan untuk orang tua s adalah sebagai bahan introspeksi diri dan belajar arti kesabaran ', 'remaja autis alami pubertas turbulensi rasa simpang remaja manipulasi seks emosi minat stabil lawan jenis gambar makna sudut pandang orang tua pubertas autis remaja cemas orang tua hadap pubertas pubertas remaja harap orang tua pubertas remaja terima orang tua pubertas pubertas remaja dekat kualitatif fenomenologis wawancara dalam desain karya pre field work ikut in the field getting in getting long and getting out data kerja kode kategori simpul analisis data flow model makna pubertas orang tua tafsir agresi anugerah tuhan orang tua sadar ajar anak hasil bahagia pubertas orang tua tahap alami pubertas beda anak anak simpul orang tua tafsir beri tuhan remaja autis proses alami remaja orang tua bahan introspeksi ajar arti sabar ', 4),
(105, ' Keefektifan teknik self instruction dalam konseling Kognitif-perilaku untuk meningkatkan efikasi diri Sosial siswa smkn 2 malang	', 'Penelitian ini bertujuan mengetahui keefektifan teknik self instruction untuk Meningkatkan efikasi diri sosial siswa smkn   malang  Penelitian eksperimen ini Menggunakan metode single case experimental design  sced  model a b a     Subjek Penelitian berjumlah tiga siswa kelas x di smkn   malang yang menunjukkan tingkat Efikasi diri sosial rendah berdasarkan skala efikasi diri sosial  Instrumen penelitian yang Digunakan adalah skala efikasi diri sosial dengan validitas butir     dan realibilitas         Pedoman observasi  dan pedoman konseling  Hasil penelitian menunjukkan bahwa subjek Mengalami peningkatan efikasi diri sosial setelah diberikan treatment  Data yang telah Dianalisis menggunakan visual inspection menunjukkan perubahan secara signifikan  Sehingga dapat disimpulkan teknik self instruction dalam konseling kognitif perilaku efektif Untuk meningkatkan efikasi diri sosial siswa smkn   malang ', 'efektif teknik self instruction tingkat efikasi sosial siswa smkn malang eksperimen single case experimental design sced model subjek siswa kelas smkn malang tingkat efikasi sosial rendah dasar skala efikasi sosial instrumen skala efikasi sosial validitas butir realibilitas pedoman observasi pedoman konseling subjek alami tingkat efikasi sosial treatment data analisis visual inspection rubah signifikan simpul teknik self instruction konseling kognitif perilaku efektif tingkat efikasi sosial siswa smkn malang ', 4),
(118, ' The effectiveness of backward chaining methods to improve skills in children  With intellectual disability		', 'Anak disabilitas intelektual memiliki masalah dalam perilaku adaptif seperti pada keterampilan makan  Tujuan penelitian ini untuk mendeskripsikan     kemampuan anak disabilitas intelektual sebelum diberikan intervensi menggunakan backward chaining     kemampuan anak disabilitas intelektual setelah diberikan intervensi menggunakan backward chaining  dan    keefektifan backward chaining untuk meningkatkan keterampilan makan  Metode penelitian yang digunakan dalam penelitian ini adalah metode eksperimen dengan menggunakan single subject reseach  ssr  dengan desain a b a  Hasil penelitian menunjukan perolehan presentase overlap antara kondisi baseline   ke kondisi intervensi sebesar     Perhitungan tersebut menyatakan adanya pengaruh keefektifan backward chaining sebagai intervensi terhadap peningkatan keterampilan makan sebagai target behavior ', 'anak disabilitas intelektual milik perilaku adaptif terampil makan deskripsi mampu anak disabilitas intelektual intervensi backward chaining mampu anak disabilitas intelektual intervensi backward chaining efektif backward chaining tingkat terampil makan eksperimen single subject reseach ssr desain tunjuk  presentase overlap baseline intervensi hitung efektif backward chaining intervensi tingkat terampil makan target behavior ', 4),
(120, ' The effect of perception exercise of tactual sally mangold toward early reading capability for students with hearing impairment	', 'Tunanetra merupakan hambatan fungsi pengelihatan yang membutuhkan cara belajar yang berbeda dengan orang normal lainnya  Tunanetra memiliki alat untuk belajar membaca dan menulis disebut braille  Membaca adalah kegiatan yang diperlukann untuk mendapatkan informasi  Tujuan dari penelitian ini adalah mendeskripsikan pengaruh latihan persepsi taktual sally mangold terhadap kemampuan membaca permulaan subyek dilihat dari sebelum dan sesudah intervensi  Metode yang digunakan adalah eksperimen dengan desain single subyek resecrh dan model a b a  Kesimpulan dari penelitian ini ditemukan pengaruh positif latihan persepsi taktual sally mangold terhadap kemampuan membaca permulaan subyek  Pengaruh tersebut dilihat dari skor kemampuan membaca permulaan subyek dari     menjadi     ', 'tunanetra hambat fungsi pengelihatan butuh ajar beda orang normal tunanetra milik alat ajar baca tulis braille baca giat diperlukann informasi deskripsi latih persepsi taktual sally mangold mampu baca mula subyek intervensi eksperimen desain single subyek resecrh model simpul temu positif latih persepsi taktual sally mangold mampu baca mula subyek skor mampu baca mula subyek ', 4),
(121, 'Analisis putusan pengadilan negeri sampang nomor 69/pid.b/2012/pn.spg. Prespektif hak kebebasan beragama di indonesia	', 'Hak dan kebebasan beragama merupakan hak konstitusional warga negara karena telah dijamin oleh konstitusi Namun demikian konflik kekerasan dan pelarangan terhadap hak ini masih banyak ditemui di berbagai wilayah di indonesia salah satunya ialah terhadap penganut paham syi ah di sampang Peristiwa tersebut mengantarkan tajul muluk menjadi terpidana melalui putusan pengadilan negeri sampang nomor pid b pn spg Peristiwa ini seolah memberikan tanda bahwa negara tidak mampu melindungi hak konstitusional warga negara dalam meyakini dan menganut suatu agama Bahkan negara seolah ikut menjadi aktor terhadap munculnya aksi aksi kekerasan dan penolakan kepada komunitas syi ah sampang Sikap negara yang demikian merupakan bentuk pengenyampingan terhadap prinsip kebebasan beragama yang telah dijamin oleh konstitusi ', 'hak bebas agama hak konstitusional warga negara jamin konstitusi konflik kerasan larang hak temu wilayah indonesia salah satu anut paham syi ah sampang peristiwa antar tajul muluk pidana putus adil negeri sampang nomor pid pn spg peristiwa tanda negara lindung hak konstitusional warga negara anut agama negara aktor muncul aksi aksi kerasan tolak komunitas syi ah sampang sikap negara bentuk pengenyampingan prinsip bebas agama jamin konstitusi ', 5),
(122, 'Kartu tanda penduduk tanpa kolom agama dalam perspektif eksistensialisme sartre	', 'Konsep kebebasan merupakan wujud analisa tentang bagaimana kata bebas itu hadir dan eksis sebagai wujud nyata dalam menghadapi ketidakpastian dunia kontemporer Manusia benar benar ingin mencari eksistensinya sebagai makhluk Eksistensialisme mencoba memberikan jalan terang bahwa hakikat manusia adalah keberadaannya dalam dunia Adalah sartre yang menyatakan diri sebagai filsuf eksistensialis taat dengan semboyan utamanya manusia dikutuk untuk bebas oleh sebab itu eksistensi mendahului esensi Pembahasan eksistensialisme ini berkaitan dengan fenomena penghapusan kolom agama pada kartu tanda penduduk di jakarta Kebijakan terhadap kartu tanda penduduk tersebut akan mencoba dianalisis pada konsep kebebasan eksistensialisme sartre dengan menggunakan pendekatan konflik sebagai epistemologi eksistensialisme sartre Sesuai dengan tema tersebut artikel ini berusaha mengungkap keterkaitan antara penghapusan kolom agama dengan model eksistensialisme sartre Karena pada dasarnya konsep eksistensialisme bersifat ateistik dan tidak begitu melihat sisi spiritualisme sebagai hal yang utama ', 'konsep bebas wujud analisa bebas hadir eksis wujud nyata hadap ketidakpastian dunia kontemporer manusia cari eksistensi makhluk eksistensialisme coba jalan terang hakikat manusia ada dunia sartre filsuf eksistensialis taat semboyan utama manusia kutuk bebas eksistensi dahulu esensi bahas eksistensialisme kait fenomena hapus kolom agama kartu tanda duduk jakarta bijak kartu tanda duduk coba analisis konsep bebas eksistensialisme sartre dekat konflik epistemologi eksistensialisme sartre sesuai tema artikel usaha ungkap kait hapus kolom agama model eksistensialisme sartre dasar konsep eksistensialisme sifat ateistik sisi spiritualisme utama ', 5),
(123, 'Kebijakan hukum penataan kurikulum mata kuliah kewarganegaraan di perguruan tinggi guna revolusi karakter mentaati hukum bagi mahasiswa	', 'Tujuan dari penulisan ini adalah membangun model penataan kembali kurikulum bahan kajian mata kuliah kewarganegaraan di perguruan tinggi agar lebih optimal dapat mengembangkan karakter mahasiswa dalam mentaati hukum  Karakter yang dimaksud bersumber pada asas ketuhanan  kemanusiaan  persatuan  kerakyatan dan keadilan karakter ini dapat terlaksana apabila setiap warganegara taat pada hukum  untuk mencapai hal tersebut diperlukan keteladanan ketaatan dari penyelenggara pendidikan  Penataan kurikulum dalam hal ini terlebih dahulu merumuskan visi  misi dan tujuan matakuliah kewarganegaraan  menentukan profil dan rumusan kompetensi serta upaya mensinkronkan kompetensi dengan bahan kajian  substansi materi kewarganegaraan kesadaran dan ketaatan hukum dijabarkan dari asas ketuhanan  kemanusiaan  persatuan  kerakyatan dan keadilan dan memuat kajian hukum tuhan  hukum etis dan hukum kodrat serta asas asas hukum positif indonesia  hukum positif yang dimaksud adalah perundang undangan yang konstekstual yang terjadi di masyarakat  daerah  kota dan desa  penataan kajian materi kewarganegaraan dalam aspek hukum ditekankan disamping pada pengetahuan hukum  isi sikap serta pola perilaku hukum  namun juga nilai nilai hukum  undang undang  Jadi ditekankan pada stransfer nilai hukum dan bukan semata mata transfer pengetahuan hukum  Tindak lanjut dari implementasi kajian ituperlu diuji cobakan dalam proses pembelajaran di dalam kampus  dan juga melakukan kegiatan ekstra kurikuler praktek laboratorium yang dapat dilakukan baik di kampus maupun di luar kampus sesuai dengan kemampuan perguruan tinggi masing masing ', 'tulis bangun model tata kurikulum bahan kaji mata kuliah kewarganegaraan guru optimal kembang karakter mahasiswa taat hukum karakter sumber asas tuhan manusia satu rakyat adil karakter laksana warganegara taat hukum capai teladan taat selenggara didik tata kurikulum rumus visi misi matakuliah kewarganegaraan tentu profil rumus kompetensi upaya sinkron kompetensi bahan kaji substansi materi kewarganegaraan sadar taat hukum dijabarkan asas tuhan manusia satu rakyat adil muat kaji hukum tuhan hukum etis hukum kodrat asas asas hukum positif indonesia hukum positif undang undang konstekstual masyarakat daerah kota desa tata kaji materi kewarganegaraan aspek hukum tekan samping pengetahuan hukum isi sikap pola perilaku hukum nilai nilai hukum undang undang tekan stransfer nilai hukum mata transfer pengetahuan hukum tindak implementasi kaji ituperlu uji coba proses pembelajaran kampus giat ekstra kurikuler praktek laboratorium kampus kampus sesuai mampu guru ', 5),
(124, 'Montesquieu dan makna sebuah keadilan	', 'Khalayak melihat berbagai tindak ketidakadilan yang mengemukan Hal ini menjadi salah satu keprihatinan bangsa Keadilan yang seharusnya dijamin oleh hukum tidak berjalan sebagaimana mestinya Montesquieu sangat peduli dengan isu keadilan dan hukum Pemerintah sudah seharusnya melihat hukum sebagai hal yang independen dari kekuasaan eksekutif Oleh karena itu hukum harus disesuaikan dengan situasi konkret sebuah bangsa dan bukan mengikuti kehendak penguasa Montesquieu dengan semangat melawan ketidakadilan juga turut menginspirasi jalannya revolusi Dia menganalogikan raja dan paus seperti tukang bohong Mereka menjadikan rakyat sebagai obyek pembodohan dia juga dianggap sebagai salah satu filsuf berpengaruh di prancis Tulisan ini akan membahas makna keadilan dan relasinya pada semangat perjuangan revolusi ', 'khalayak tindak ketidakadilan kemu salah prihatin bangsa adil jamin hukum jalan mesti montesquieu peduli isu adil hukum perintah hukum independen kuasa eksekutif hukum sesuai situasi konkret bangsa ikut hendak kuasa montesquieu semangat lawan ketidakadilan inspirasi jalan revolusi analogi raja paus tukang bohong jadi rakyat obyek bodoh anggap salah filsuf pengaruh prancis tulis bahas makna adil relasi semangat juang revolusi ', 5),
(125, 'Pengaruh balikan (feedback) guru dalam pembelajaran terhadap motivasi dan hasil belajar peserta didik (suatu kajian teoritis dan empirik)	', 'Feedback atau balikan dalam pembelajaran didefinisikan sebagai informasi yang dikomunikasikan kepada peserta didik yang bertujuan merubah pemikiran atau perilakunya untuk memperbaiki proses pembelajaran Pemberian feedback atau balikan oleh guru dalam pembelajaran merupakan kegiatan penting untuk memperbaiki pengetahuan pemerolehan kemampuan prestasi dan memotivasi belajar peserta didik para peneliti merekomendasikan karateristik feedback yang efektif untuk pembelajaran haruslah bersifat non evaluatif suportif tepat waktu dan spesifik feedback pembelajaran diberikan berupa informasi pada peserta didik sebagai respon tindakan kegiatan belajar yang telah dilakukan Feedback dapat disajikan dalam berbagai macam bentuk misalnya berupa verifikasi akurasi jawaban penjelasan tentang jawaban yang benar petunjuk dan contoh serta dilakukan kapan pun selama proses pembelajaran misalnya setelah diberikannya jawaban atau setelah jeda waktu tertentu Pengaruh feedback dalam pembelajaran dapat dijelaskan dengan mengacu pada teori teori belajar yaitu teori behaviourisme kognitivisme konstruktivisme dan teori belajar regulasi diri ', 'feedback balik pembelajaran definisi informasi komunikasi serta didik rubah pikir perilaku baik proses pembelajaran beri feedback balik guru pembelajaran giat penting baik pengetahuan pemerolehan mampu prestasi motivasi ajar serta didik teliti rekomendasi karateristik feedback efektif pembelajaran sifat non evaluatif suportif spesifik feedback pembelajaran informasi serta didik respon tindak giat ajar feedback saji bentuk verifikasi akurasi jelas tunjuk proses pembelajaran jeda feedback pembelajaran acu teori teori ajar teori behaviourisme kognitivisme konstruktivisme teori ajar regulasi ', 5),
(126, 'Pengembangan perangkat asesmen autentik dalam pembelajaran pendidikan kewarganegaraan', 'Tujuan penulisan adalah mendeskrisikan prosedur pengembangan ini yaitu untuk menghasilkan produk berupa perangkat asesmen yang terdiri dari panduan asesmen autentik  lembar kegiatan siswa dan software rekapitulasi untuk guru yang diperuntukkan bagi siswa kelas v semester i  Kelayakan produk dinilai berdasarkan tingkat validitas dari para ahli  tingkat keterterapan dan tingkat keterbacaan yang tinggi melalui uji coba produk  Instrumen pengumpulan data yang digunakan antara lain lembar validasi para ahli  angket tanggapan siswa dan angket tanggapan guru  Temuan penelitian dan pengembangan menunjukkan bahwa hasil uji validasi para ahli menyatakan sangat valid dengan skor rata rata sebesar       Tingkat keterterapan produk dengan skor rata rata sebesar       Tingkat keterbacaan produk dengan skor rata rata sebesar   ', 'tulis mendeskrisikan prosedur kembang hasil produk angkat asesmen pandu asesmen autentik lembar giat siswa software rekapitulasi guru untuk siswa kelas semester layak produk nilai dasar tingkat validitas ahli tingkat terap tingkat baca uji coba produk instrumen kumpul data lembar validasi ahli angket tanggap siswa angket tanggap guru temu kembang uji validasi ahli valid skor tingkat terap produk skor tingkat baca produk skor ', 5),
(127, 'Pola rekrutmen calon legislatif dapil 1 provinsi aceh yang dilakukan oleh partai keadilan sejahtera (pks) dan partai nasional demokrat (nasdem)', 'Rekrutmen politik adalah proses pengisian jabatan pada lembaga politik termasuk partai politik Sedangkan partai politik merupakan kendaraan pihak tertentu untuk membawa kepentingan politik dalam tahta kekuasaan guna mencapai tujuan yang di harapkan Tujuan penelitian ini adalah melihat bagaimana pola rekrutmen calon legislatif dapil provinsi aceh yang dilakukan oleh pks dan partai nasdem kriteria yang bagaimana digunakan dalam rekrutmen calon legislatif dapil provinsi aceh yang dilakukan oleh pks dan partai nasdem dan apa yang menjadi peluang serta tantangan dalam melakukan rekrutmen caleg dapil yang dilakukan oleh pks dan partai nasdem Metode yang digunakan adalah metode deskriptif dengan pendekatan kualitatif Pengumpulan data dilakukan dengan cara wawancara dan dokumentasi Hasil analisis data menunjukkan bahwa pola rekrutmen calon legilatif dapil provinsi aceh yang dilakukan oleh pks dan nasdem menunjukkan bahwa jauh berbeda Sehubungan dengan hal ini maka yang menjadi peluang dan tantangan pks yaitu pileg tahun ini lebih banyak tantangan dibandingkan peluang yang didapatkan oleh pks karena banyaknya permainan politik uang begitu pula yang dialami oleh partai nasdem politik uang yang menjadi tantangan paling besar pada pileg pertama kali yang diikuti oleh partai nasdem ', 'rekrutmen politik proses isi jabat lembaga politik partai politik partai politik kendara bawa penting politik tahta kuasa capai harap pola rekrutmen calon legislatif dapil provinsi aceh pks partai nasdem kriteria rekrutmen calon legislatif dapil provinsi aceh pks partai nasdem luang tantang rekrutmen caleg dapil pks partai nasdem deskriptif dekat kualitatif kumpul data wawancara dokumentasi analisis data pola rekrutmen calon legilatif dapil provinsi aceh pks nasdem beda hubung luang tantang pks pileg tantang banding luang dapat pks banyak main politik uang alami partai nasdem politik uang tantang pileg kali ikut partai nasdem ', 5);
INSERT INTO `dataset` (`id`, `judul`, `data_ori`, `data_edit`, `kategori`) VALUES
(128, 'Studi tentang nilai â€“ nilai sosial budaya dalam undang (haep) pada upacara kematian	', 'Indonesia mempunyai beragam kebudayaan yang terbentuk dilingkungan masyarakat  Salah satu kebudayaan yang ada di indonesia adalah budaya undang  haep  pada upacara kematian  Kebudayaan ini tetap dilestarikan di kecamatan semau hal ini dilakukan secara turun temurun  Budaya undang  haep  melalui beberapa proses diantaranya proses musyawarah yaitu pra musyawarah  kewenangan yang duduk di atas tikar adat  nehe tuan  dan pemimpin musyawarah  sarana dalam musyawarah  hasil musyawarah  menentukan waktu kubur  buka tikar penuh atau buka setengah  nukuneo  bolokai   mitang inala  butu leng  jumlah yang di haep  undang   utusan untuk haep  undang   kehadiran orang ', 'indonesia ragam budaya bentuk lingkung masyarakat salah budaya indonesia budaya undang haep upacara mati budaya lestari camat mau turun temurun budaya undang haep proses proses musyawarah pra musyawarah wenang duduk tikar adat nehe tuan pimpin musyawarah sarana musyawarah musyawarah tentu kubur buka tikar penuh buka nukuneo bolokai mitang inala butu leng haep undang utus haep undang hadir orang ', 5),
(129, 'Analisa perlindungan hukum bagi pemegang saham minoritas dalam proses akuisisi 	', 'Tulisan ini bertujuan untuk menganalisis implikasi hukum terhadap konflik hukum antara pasal     ayat   dan ayat   dari uupt  Pasal     ayat     uu no     tahun      tentang perseroan terbatas  uupt  menyatakan bahwa proses akuisisi harus memperhatikan kepentingan pemegang saham minoritas  Tetapi pada pasal     ayat     uupt tersebut menyatakan bahwa usaha yang dilakukan pemegang saham minoritas berdasarkan pasal    uupt tidak menghentikan proses akuisisi  Terlihat belum konsistennya uupt memberikan perlindungan hukum bagi pemegang saham minoritas dan terlihat adanya konflik hukum antara pasal     ayat     uupt yang ingin memberikan perlindungan hukum kepada pemegang saham minoritas dan ayat     dari pasal tersebut yang menggambarkan bahwa upaya hukum yang dilakukan pemegang saham minoritas tidak menghentikan proses akuisisi  Kajian menggunakan pendekatan perundang undangan dan pendekatan kasus diperoleh hasil bahwa tidak adanya kepastian hukum atas upaya hukum yang dilakukan pemegang saham minoritas dalam menggunakan hak suara sesuai dengan saham yang dimilikinya ketika pemegang saham minoritas tidak menyetujui dilakukannya akuisisi  Uupt belum memberikan perlindungan hukum yang jelas bagi pemegang saham minoritas sehingga dalam proses akuisisi pemegang saham minoritas dirugikan ', 'tulis analisis implikasi hukum konflik hukum pasal ayat ayat uupt pasal ayat uu no sero batas uupt proses akuisisi hati penting pegang saham minoritas pasal ayat uupt usaha pegang saham minoritas dasar pasal uupt henti proses akuisisi konsisten uupt lindung hukum pegang saham minoritas konflik hukum pasal ayat uupt lindung hukum pegang saham minoritas ayat pasal gambar upaya hukum pegang saham minoritas henti proses akuisisi kaji dekat undang undang dekat  pasti hukum upaya hukum pegang saham minoritas hak suara sesuai saham milik pegang saham minoritas menyetujui laku akuisisi uupt lindung hukum pegang saham minoritas proses akuisisi pegang saham minoritas rugi ', 5),
(130, 'Filosofi jawa nrimo ditinjau dari sila ketuhanan yang maha esa	', 'Setiap masyarakat indonesia memiliki kearifan lokal sebagai cerminan dari nilai dan karakter yang dianut oleh masyarakat itu Pada masyarakat jawa khususnya kearifan lokal yang berupa filosofi hidup banyak sekali ragamnya Salah satu filosofi hidup yang diyakini oleh mayarakat jawa adalah nrimo Nrimo diyakini sebagai karakter masyarakat jawa dalam menjalani hidup Masyarakat jawa yakin bahwa setelah bekerja keras maka hal yang dilakukan adalah nrimo apapun hasil yang diberikan oleh tuhan dan bersyukur atas berkah yang telah diberikan oleh tuhan atas kerja keras yang telah dilakukan Pada tulisan ini penulis akan menguraikan konsep filosofi jawa nrimo nilai nilai yang terkandung dalam filosofi nrimo dan filosofi jawa nrimo ditinjau dari sila pertama pancasila ketuhanan yang maha esa', 'masyarakat indonesia milik arif lokal cermin nilai karakter anut masyarakat masyarakat jawa arif lokal filosofi hidup ragam salah filosofi hidup yakin mayarakat jawa nrimo nrimo yakin karakter masyarakat jawa jalan hidup masyarakat jawa keras nrimo apa tuhan syukur berkah tuhan kerja keras tulis tulis urai konsep filosofi jawa nrimo nilai nilai kandung filosofi nrimo filosofi jawa nrimo tinjau sila pancasila tuhan maha esa ', 5),
(131, 'Fiqih ham dan hak kebebasan beribadah minoritas dzimmi di indonesia	', 'Indonesia merupakan negara multikultural Terdapat berbagai agama suku budaya dan adat istiadat Keberagaman ini merupakan sebuah keniscayaan yang harus dijalani sebagai kekuatan dalam membangun negara Namun keberagaman itu seolah diuji dengan berbagai peristiwa diskriminasi Salah satunya adalah kebebasan beribadah kaum minoritas agama di tengah mayoritas suatu agama tertentu Pendirian rumah ibadah oleh agama agama minoritas di berbagai daerah terus menuai kontroversi Pendewasaan pemikiran umat mayoritas menjadi bagian penting dalam mewujudkan keseimbangan hubungan sosial Oleh karena itu artikel ini mencoba untuk mewujudkan gagasan baru mengenai fikih ham Hasil konsepsi al quran tersebut dituangkan dalam gagasan fiqih ham yang berupaya untuk membangun kesetaraan hak beribadah bagi warga negara Fiqh ham diharapkan mampu membentuk kesadaran masyarakat untuk menghargai dan menghormati aktivitas peribadatan kaum minoritas ', 'indonesia negara multikultural agama suku budaya adat istiadat agam niscaya jalan kuat bangun negara agam uji peristiwa diskriminasi salah satu bebas ibadah kaum minoritas agama mayoritas agama diri rumah ibadah agama agama minoritas daerah tuai kontroversi dewasa pikir umat mayoritas penting wujud keseimbangan hubung sosial artikel coba wujud gagas fikih ham konsepsi al quran tuang gagas fiqih ham upaya bangun kesetaraan hak ibadah warga negara fiqh ham harap bentuk sadar masyarakat harga hormat aktivitas ibadat kaum minoritas ', 5),
(132, 'Fungsi bukti elektronik dalam hukum acara pidana pasca putusan mahkamah konstitusi Nomor 20/puu-xiv/2016	', 'Putusan mahkamah konstitusi nomor puu xiv yang memberi penafsiran terhadap pasal ayat ayat dan pasal b undang undang nomor tahun berimplikasi negatif terhadap hukum acara pidana mengingat dalam praktiknya bukti elektronik dipandang penting dipergunakan untuk mengungkap kebenaran materiil di persidangan Tujuan dari penelitian ini adalah untuk menganalisis urgensi bukti elektronik dalam mencari kebenaran materiil oleh hakim mengingat derasnya perkembangan teknologi informasi untuk menganalisis implikasi yuridis putusan mahkamah konstitusi no puu xiv terhadap keabsahan bukti elektronik dalam hukum acara pidana untuk menemukan konsep pembaruan hukum baru dalam hukum pembuktian di hukum acara pidana indonesia metode yang digunakan dalam penelitian ini adalah penelitian hukum dengan pendekatan perundang undangan statute approach pendekatan kasus case approach pendekatan konsep conseptual approach Hasil dari penelitian ini adalah keabsahan bukti elektronik yang digunakan dalam persidangan bergantung kepada izin dari penegak hukum dan membuat tidak sah bukti elektronik yang diajukan ke persidangan tanpa izin penegak hukum menjadi tidak sah Hal ini bertentangan dengan semangat dalam penegakan hukum pidana yang berusaha mengikuti arus perkembangan teknologi informasi karena dalam beberapa kasus bukti elektronik dipergunakan untuk mempermudah pembuktian seperti penggunaan teleconfrence cctv surat elektronik dan sebagainya Bukti elektronik saat ini belum dikategorikan sebagai alat bukti yang sah dalam kuhap sehingga dalam ius constituendum harus dimasukan sebagai alat bukti untuk menjamin kepastian hukum ', 'putus mahkamah konstitusi nomor puu xiv tafsir pasal ayat ayat pasal undang undang nomor implikasi negatif hukum acara pidana praktik bukti elektronik pandang penting ungkap benar materiil sidang analisis urgensi bukti elektronik cari benar materiil hakim deras teknologi informasi analisis implikasi yuridis putus mahkamah konstitusi no puu xiv absah bukti elektronik hukum acara pidana temu konsep baru hukum hukum bukti hukum acara pidana indonesia hukum dekat undang undang statute approach dekat case approach dekat konsep conseptual approach absah bukti elektronik sidang gantung izin tegak hukum sah bukti elektronik ajuk sidang izin tegak hukum sah tentang semangat tegak hukum pidana usaha ikut arus teknologi informasi bukti elektronik mudah bukti guna teleconfrence cctv surat elektronik bukti elektronik kategori alat bukti sah kuhap ius constituendum masuk alat bukti jamin pasti hukum ', 5),
(133, 'Implementasi model learning together untuk meningkatkan kecakapan kewarganegaraan siswa sekolah menengah pertama	', 'Tujuan dari kajian ini adalah mendeskripsikan implementasi model learning together untuk meningkatkan kemampuan kewarganegaraan siswa  Metode yang digunakan dalam kajian ini adalah pendekatan kualitatif dengan metode inquiry naturalistik  Teknik pengumpulan data seperti wawancara  observasi  dan dokumentasi  Hasil menunjukkan bahwa penerapan pembelajaran bersama model dapat meningkatkan kemampuan berprestasi siswa berpikir kritisdan berpartisipasi aktif  Siswa memiliki kemampuan intelektual untuk mengidentifikasi  menjelaskan  menganalisis masalah  mengevaluasi  dan mengambil serta mepertahankan pendapat tentang pemahaman kedaulatan rakyat dan sistem pemerintahan di indonesia  Siswa juga memiliki kemampuan partisipasi dalam berinteraksi  memantau  dan mempengaruhi kelompok tersebut  Perbaikan dari sudut pandang pendidikan kewarganegaraan merupakan salah satu komponen yang harus diwujudkan dalam pembentukan warga yang cerdas dan baik ', 'kaji deskripsi implementasi model learning together tingkat mampu kewarganegaraan siswa kaji dekat kualitatif inquiry naturalistik teknik kumpul data wawancara observasi dokumentasi terap pembelajaran model tingkat mampu prestasi siswa pikir kritisdan partisipasi aktif siswa milik mampu intelektual identifikasi analisis evaluasi ambil mepertahankan pendapat paham daulat rakyat sistem perintah indonesia siswa milik mampu partisipasi interaksi pantau pengaruh kelompok baik sudut pandang didik kewarganegaraan salah komponen wujud bentuk warga cerdas ', 5),
(134, 'Kewenangan dan tanggung jawab notaris dalam pembuatan akta perjanjian kawin pasca putusan mahkamah konstitusi no 69/puu-xii/2015	', 'Kajian ini membahas mengenai rasio legis putusan mahkamah konstitusi nomor puuxiii dan implikasi hukumnya terhadap kewenangan notaris dalam pembuatan akta perjanjian kawin pasca putusan mahkamah konstitusi nomor puu xiii tentang perjanjian kawin yang bisa dibuat setelah terjadinya perkawinan studi pada notaris di wilayah jakarta timur Hasil penulisan artikel ilmiah ini adalah apa yang menjadi dasar rasio legis mahkamah konstitusi mk mengeluarkan putusan mahkamah konstitusi mk nomor puu xiii tentang pembuatan perjanjian kawin yang bisa dibuat tidak hanya sebelum terjadinya perkawinan tetapi bisa juga dibuat setelah terjadinya perkawinan sepanjang dalam masa perkawinan dan implikasi hukumnya terhadap kewenangan notaris dalam pembuatan akta perjanjian kawin pasca putusan mahkamah konstitusi nomor puu xiii karena putusan mk itu bersifat final dan mengikat artinya semua pihak terutama notaris harus menghormati dan melaksanakan putusan mk nomor puu xiii tentang perjanjian kawin yang dibuat oleh para pihak boleh dibuat setelah terjadinya perkawinan dan harus disahkan oleh pejabat pencatat perkawinan yang berwenang atau notaris ', 'kaji bahas rasio legis putus mahkamah konstitusi nomor puuxiii implikasi hukum wenang notaris buat akta janji kawin pasca putus mahkamah konstitusi nomor puu xiii janji kawin kawin studi notaris wilayah jakarta timur tulis artikel ilmiah dasar rasio legis mahkamah konstitusi mk keluar putus mahkamah konstitusi mk nomor puu xiii buat janji kawin kawin kawin kawin implikasi hukum wenang notaris buat akta janji kawin pasca putus mahkamah konstitusi nomor puu xiii putus mk sifat final ikat notaris hormat laksana putus mk nomor puu xiii janji kawin kawin sahkan jabat catat kawin wenang notaris ', 5),
(135, 'Kewenangan peradilan agama dalam memutus perkara perceraian akibat murtad	', 'Pasal    undang undang nomor   tahun      tentang peradilan agama menegaskan bahwa kewenangan peradilan agama terbatas pada perkara perkara yang terjadi antara umat islam di indonesia seputar perkawinan  perceraian  shadaqah  infaq  wasiat  hibah  zakat  wakaf  dan ekonomi syariah  Pengaturan tersebut berimplikasi pada ketentuan yang boleh berperkara di pengadilan agama hanyalah orang islam  asas personalisasi   Pada kenyataannya  praktik yang sering ditemui di peradilan agama ialah kegiatan memutus perceraian akibat murtad  Tentu hal tersebut bertentangan dengan asas personalisasi yang melekat pada peradilan agama  Kajian ini penting untuk memastikan bahwa tindakan yang dilakukan peradilan agama tersebut telah sesuai dengan ketentuan hukum yang berlaku demi menjamin kepastian hukum pihak pihak yang berperkara dalam persoalan perceraian akibat murtad ', 'pasal undang undang nomor adil agama wenang adil agama batas perkara perkara umat islam indonesia putar kawin cerai shadaqah infaq wasiat hibah zakat wakaf ekonomi syariah atur implikasi tentu perkara adil agama orang islam asas personalisasi nyata praktik temu adil agama giat utus cerai murtad tentang asas personalisasi lekat adil agama kaji penting tindak adil agama sesuai tentu hukum berlaku jamin pasti hukum perkara cerai murtad ', 5),
(138, 'Motivasi belajar siswa kelas v terhadap mata pelajaran pendidikan pancasila dan Kewarganegaraan	', 'Kajian ini bertujuan untuk mengetahui motivasi belajar siswa kelas v terhadap mata pelajaran pendidikan pancasila dan kewarganegaraan dan solusi untuk mengatasi permasalahannya  Metode yang digunakan adalah deskriptif kualitatif  Hasil kajian menunjukkan bahwa siswa kelas v rata rata menyukai mata pelajaran pendidikan kewarganegaraan  Berdasarkan hasil ujian sebagian siswa nilainya di bawah kriteria ketuntasan minimal namun tidak sampai separuh antara     diantara    siswa  Nilai tersebut belum tuntas karena di rumah siswa kurang diperhatikan dalam belajar  siswa kurang memperhatikan saat di ajar dalam kelas  dan kondisi anak yang kurang normal  Di rumah anak tidak diperhatikan dalam belajar karena adanya faktor keluarga upaya dan solusi yang dilakukan guru di sekolah antara lain  memberikan pertanyaan kepada siswa yang tidak membuka buku pada saat pembelajaran  guru melakukan tanya jawab secara langsung kepada siswa terkait dengan materi  Guru memberikan kata kata mutiara saat kegiatan pembelajaran  Upaya lainnya yaitu mengumpulkan wali siswa pada saat pembagian raport semester ', 'kaji motivasi ajar siswa kelas mata ajar didik pancasila kewarganegaraan solusi atas masalah deskriptif kualitatif kaji siswa kelas suka mata ajar didik kewarganegaraan dasar uji siswa nilai kriteria tuntas minimal paruh siswa nilai tuntas rumah siswa hati ajar siswa hati ajar kelas anak normal rumah anak hati ajar faktor keluarga upaya solusi guru sekolah siswa buka buku pembelajaran guru langsung siswa kait materi guru mutiara giat pembelajaran upaya kumpul wali siswa bagi raport semester ', 5),
(139, 'Nilai - nilai cinta tanah air dalam perspektif Al-qurâ€™an', 'Cinta tanah air  hubb al wathan  merupakan perasaan bangga dan ikut memiliki sebuah wilayah tertentu  Perasaan ini diwujudkan dalam sikap rela berkorban untuk melindungi wilayahnya dari berbagai ganggungan dan ancaman  Pentingnya rasa cinta tanah air ini menjadikannya sebuah tabiat alamiah manusia yang dimiliki sejak lahir  Namun  yang menjadi problematika saat ini adalah spesialisasi makna cinta tanah air dalam kehidupan sehari hari  Dikotomi penolakan gerakan islam ashobiyah terhadap paham negara bangsa  nation state  menjadi salah satu bukti penyempitan makna cinta tanah air di masyarakat  Kajian terhadap pokok bahasan ini mengungkapkan konsep atau gagasan terkait cinta tanah air yang ditinjau dari segi agama dan bangsa  Hal ini penting untuk dilakukan agar tercipta pemahaman yang lebih kontekstual terhadap fenomena problematika paham cinta tanah air  Penelitian ini sangat penting untuk dilakukan mengingat sedikitnya kajian yang mendalam terhadap eksplorasi kandungan alquran dalam memecahkan problematika sosial yang terjadi saat ini harapannya dengan dikajinya topik ini dapat membuka wawasan masyarakat tentang konsep cinta tanah air dalam alquran  Penelitian ini mengungkap nilai nilai cinta tanah air dalam perspektif alquran ', 'cinta tanah air hubb al wathan rasa bangga milik wilayah rasa wujud sikap rela korban lindung wilayah ganggungan ancam cinta tanah air jadi tabiat alamiah manusia milik lahir problematika spesialisasi makna cinta tanah air hidup hari dikotomi tolak gerak islam ashobiyah paham negara bangsa nation state salah bukti sempit makna cinta tanah air masyarakat kaji pokok bahas konsep gagas kait cinta tanah air tinjau segi agama bangsa penting cipta paham kontekstual fenomena problematika paham cinta tanah air penting kaji dalam eksplorasi kandung alquran pecah problematika sosial harap kaji topik buka wawas masyarakat konsep cinta tanah air alquran ungkap nilai nilai cinta tanah air perspektif alquran ', 5),
(140, 'Paradigma membangun generasi emas indonesia tahun 2045	', 'Tahun      indonesia memasuki generasi emas  Hal tersebut menuntut indonesia untuk mempersiapkan generasi mudanya siap menghadapi momen tersebut dengan baik  sehingga generasi emas menjadi tangguh dan berfikir maju akan tetapi selalu memegang teguh nilai nilai pancasila  Generasi emas      merupakan harapan masa depan bangsa indonesia  Pendidikan merupakan media yang sangat sentral dalam mempersiapkan generasi emas terutama karakternya karakter yang harus dibangun haruslah bersifat holistik dan komprehensif berbasis pancasilais pendidikan tidak hanya mentransfer ilmu tetapi juga nilai nilai terutama karakter karakter yang ditanamkan pada diri generasi emas haruslah berbasis tiga aspek yakni nilai kejujuran  nilai kebenaran dan nilai keadilan ', 'indonesia generasi emas tuntut indonesia generasi muda hadap momen generasi emas tangguh berfikir maju pegang teguh nilai nilai pancasila generasi emas harap bangsa indonesia didik media sentral generasi emas karakternya karakter bangun sifat holistik komprehensif basis pancasilais didik transfer ilmu nilai nilai karakter karakter tanam generasi emas basis aspek nilai jujuran nilai benar nilai adil ', 5),
(142, 'Pengaruh penampilan kandidat terhadap evaluasi kandidat oleh pemilih (studi eksperimental penggunaan jilbab oleh caleg perempuan)', 'Pada pemilu legislatif seringkali seorang pemilih mendatangi tps tanpa memiliki pilihan mengenai siapa yang akan dia pilih untuk menjadi wakilnya di daerah dan pusat karena minimnya pengetahuan mereka akan pilihan yang mereka miliki Bahkan tak jarang ketika melihat foto foto dari mereka yang mencalonkan diri di tps itu adalah kali pertama melihat wajah calon wakil mereka Dalam kondisi di mana tingkat informasi sangat rendah ini petunjuk petunjuk sederhana seperti penampilan kandidat gelar afiliasi partai dan lain lain menjadi sumber penyusunan argumen bagi pemilih studi ini adalah studi mengenai persepsi yang muncul di benak pemilih saat melihat foto kandidat Fokus dari studi ini melihat pengaruh penampilan kandidat dalam hal ini penggunaan jilbab dan tidak terhadap evaluasi kandidat oleh pemilih Apakah bentuk penampilan tertentu seperti pemakaian jilbab membuat pemakainya dinilai lebih baik dari yang tidak menggunakan Hasil uji komparatif menunjukkan bahwa kandidat wanita yang menggunakan jilbab tidak dinilai lebih religius ataupun lebih jujur dibanding kandidat yang lain', 'milu legislatif seringkali pilih tps milik pilih wakil daerah pusat minim pengetahuan milik jarang foto foto calon tps kali wajah calon wakil tingkat informasi rendah tunjuk tunjuk sederhana tampil kandidat gelar afiliasi partai sumber susun argumen pilih studi studi persepsi muncul benak pilih foto kandidat fokus studi tampil kandidat guna jilbab evaluasi kandidat pilih bentuk tampil pakai jilbab maka nilai uji komparatif kandidat wanita jilbab nilai religius jujur banding kandidat ', 5),
(151, 'Dampak sosial industrilisasi tambak udang terhadap lingkungan di desa andulang kabupaten sumenep	', 'Industrialisasi adalah suatu proses perubahan sosial ekonomi yang mengubah sistem pencaharian masyarakat agraris menjadi masyarakat industri Desa andulang tahun yang lalu sudah jadi tambak dengan mengantongi izin dari badan pelayanan perizinan terpadu bppt Diantara manfaat dengan adanya industrialisasi tambak udang di desa andulang yakni menciptakan lapangan pekerjaan untuk kebutuhan ekonomi Meskipun demikian terdapat permasalahan sosial yang dirasakan oleh masyarakat di sekitar industri tersebut yakni pencemaran lingkungan Pertama pencemaran tanah terhadap lahan pertanian yang produktif menjadi tidak produktif Kedua pencemaran air yaitu terhadap laut menjadi gatal dan bau Ketiga pencemaran udara disekitar tambak udang yang menimbulkan bau yang tidak sedap ', 'industrialisasi proses rubah sosial ekonomi ubah sistem cahari masyarakat agraris masyarakat industri desa andulang tambak kantong izin badan layan izin padu bppt manfaat industrialisasi tambak udang desa andulang cipta lapang kerja butuh ekonomi masalah sosial rasa masyarakat industri cemar lingkung cemar tanah lahan tani produktif produktif cemar air laut gatal bau tiga cemar udara disekitar tambak udang timbul bau sedap ', 6),
(152, 'Dampak sosial perkawinan di bawah umur bagi kehidupan masyarakat desa kunjorowesi kecamatan ngoro kabupaten mojokerto', '\r\nDi desa kunjorowesi kecamatan ngoro kabupaten mojokerto sangat banyak yang melakukan pernikahan di bawah umur dari data awal yang peneliti dapatkan sebelum penelitian ini dilakukan salah satu sumber informasi atau informan mengatakan dilihat dari segi pendidikan saja banyak anak lulusan sd khususnya pelajar perempuan banyak yang tidak melanjutkan ke jenjang smp dengan alasan membantu orang tua dan dinikahkan oleh orang tuanya dari data tersebut saja dapat dilihat bahwa kesadaran yang sangat rendah dari masyarkat baik dari pemahaman pentingnya pendidikan maupun dampak yang berbahaya dari perkawinan di bawah umur tersebut peneliti juga menemukan anak yang masih berusia sekitar tahun tetapi sudah dua kali menjanda dan memiliki anak dari kedua perkawinan tersebut Penelitian ini akan mengunakan penelitian kualitatif dengan studi kasus di mana pada penelitian studi kasus seperti yang dirumuskan robert k Yin penelitian studi kasus adalah merupakan sebuah metode yang mengacu pada penelitian yang mempunyai unsur how dan why pada pertanyaan utama penelitiannya dan meneliti masalah masalah kontemporer masa kini serta sedikitnya peluang peneliti dalam mengontrol peristiwa kasus yang ditelitinya ', 'desa kunjorowesi camat ngoro kabupaten mojokerto nikah umur data teliti dapat salah sumber informasi informan segi didik anak lulus sd ajar perempuan lanjut jenjang smp alas bantu orang tua nikah orang tua data sadar rendah masyarkat paham didik dampak bahaya kawin umur teliti temu anak usia kali janda milik anak kawin guna kualitatif studi studi rumus robert yin studi acu unsur how why utama teliti teliti kontemporer luang teliti kontrol peristiwa teliti ', 6),
(153, 'Humanisme menurut niccolo machiavelli	', 'Machiavelli sebagai anak zamannya berupaya untuk membuka kesadaran manusia di masa kini  Dengan dipengaruhi semangat renaissance maka buah pikirnya terlihat begitu humanis  Walaupun banyak orang menyangka dia amoral tetapi pada kenyataannya dia memberikan berbagai saran yang bersifat humanis  Dia memang merekomendasikan bahwa penguasa boleh menghalalkan segala cara untuk mencapai tujuannya  Akan tetapi  khalayak melupakan bagaimana dia juga memberikan saran bagaimana cara untuk menjadi penguasa yang humanis  Dalam karyanya    diskursus     dia bahkan ingin untuk membongkar dan mengarahkan manusia untuk menjadi lebih humanis  Dia merasa bahwa hakikat manusia secara alamiah tentunya bersifat iri dengki dan manusia lebih cepat mengritik daripada memuji sehingga manusia akan terus mengulangi konflik sepanjang sejarah hidup mereka  Pemujaan akan masa lalu yang berlebih membuat manusia memiliki pola berpikir yang keliru  Sudah saatnya masa lalu harus dipahami bukan hanya dari masa lalu tetapi dari masa lalu dan masa kini ', 'machiavelli anak zaman upaya buka sadar manusia pengaruh semangat renaissance buah pikir humanis orang sangka amoral nyata saran sifat humanis rekomendasi kuasa halal capai tuju khalayak lupa saran kuasa humanis karya diskursus bongkar arah manusia humanis hakikat manusia alamiah sifat iri dengki manusia cepat kritik uji manusia ulang konflik sejarah hidup puja lebih manusia milik pola pikir keliru paham ', 6),
(154, 'Inventarisasi sarana dan prasarana obyek wisata di kota banjarmasin	', 'Artikel ini bertujuan untuk mengidentifikasi  mengelompokkan dan memetakan sarana dan prasarana obyek wisata di kota banjarmasin  Teknik pengumpulan data primer menggunakan cara survey  wawancara  dokumentasi  dan studi kepustakaan  Data sekunder di peroleh dari dinas pariwisata seni dan kebudayaan serta dinas kebudayaan dan pariwisata provinsi kalimantan selatan  Teknik analisis data yang digunakan yaitu analisis keruangan  Penelitian ini menggunakan metode deskriptif kualitatif  Hasil penelitian menunjukkan bahwa sarana dan prasarana obyek wisata di kota banjarmasin untuk sarana pokok  sarana pelengkap  dan sarana penunjang terbesar adalah restoran  rumah makan dengan jumlah    buah atau         terkecil adalah angkutan wisata dan gedung bioskop dengan masing masing berjumlah   buah atau        Prasarana umum dan prasarana kebutuhan masyarakat banyak di kota banjarmasin terbesar adalah atm bank dengan jumlah   buah atau         terkecil adalah pembangkit tenaga listrik  penyediaan air bersih  pelabuhan laut  dan fasilitas komunikasi dengan masing masing berjumlah   buah atau       ', 'artikel identifikasi kelompok meta sarana prasarana obyek wisata kota banjarmasin teknik kumpul data primer survey wawancara dokumentasi studi pustaka data sekunder  nas pariwisata seni budaya nas budaya pariwisata provinsi kalimantan selatan teknik analisis data analisis ruang deskriptif kualitatif sarana prasarana obyek wisata kota banjarmasin sarana pokok sarana lengkap sarana tunjang besar restoran rumah makan buah kecil angkut wisata gedung bioskop buah prasarana prasarana butuh masyarakat kota banjarmasin besar atm bank buah kecil bangkit tenaga listrik sedia air bersih labuh laut fasilitas komunikasi buah ', 6),
(155, 'Memecahkan masalah geografi melalui problem based learning	', 'Penelitian ini bertujuan mengetahui pengaruh model problem based learning terhadap kemampuan memecahkan masalah geografi  Model penelitian ini adalah quasi experiment dengan rancangan non equivalent control group design  Subyek penelitian adalah siswa kelas xi ips sma negeri   pulau laut timur semester genap tahun ajaran            Instrumen penilaian adalah tes esai yang didasarkan pada indikator kemampuan memecahkan masalah  yaitu     mengidentifikasi masalah      merumuskan masalah      menemukan alternatif solusi      memilih alternatif solusi      menarik kesimpulan  Analisis data menggunakan model independent sample t test dengan taraf signifikansi     Hasil penelitian menunjukkan bahwa terdapat pengaruh pembelajaran model pbl terhadap kemampuan memecahkan masalah geografi  Kemampuan memecahkan masalah geografi siswa kelas eksperimen dengan model pbl lebih tinggi daripada kelas kontrol dengan model konvensional  Saran yang diberikan  yaitu agar menyusun rencana pembelajaran dengan baik dan melakukan pembelajaran pbl di luar kelas  outdoor study  ', 'model problem based learning mampu pecah geografi model quasi experiment rancang non equivalent control group design subyek siswa kelas x ips sma negeri pulau laut timur semester genap ajar instrumen nilai tes esai dasar indikator mampu pecah identifikasi rumus temu alternatif solusi pilih alternatif solusi tarik simpul analisis data model independent sample test taraf signifikansi pembelajaran model pbl mampu pecah geografi mampu pecah geografi siswa kelas eksperimen model pbl kelas kontrol model konvensional saran susun rencana pembelajaran pembelajaran pbl kelas outdoor study ', 6),
(156, 'Pemanfaatan video dalam pembelajaran pancasila dan kewarganegaraan untuk meningkatkan kemampuan berpikir kritis siswa terhadap kebijakan publik	', 'Tujuan pembelajaran pancasila dan kewarganegaraan  ppkn  hendaknya dipakai sebagai sarana meningkatkan nasionalisme  dan bentuk jiwa nasionalisme tersebut perlu diwujudkan dalam kepedulian terhadap kebijakan publik  Setiap warga negara indonesia ikut berperan serta dalam meningkatkan kehidupan masyarakat adil  makmur dan sejahtera  Dalam perkuliahan pkn  peneliti menugaskan kepada para mahasiswa untuk membuat video loc  letter of concern  yang di upload di youtube  Aparat yang berwenang juga diharapkan dapat mengambil keputusan publik yang bijaksana  Metode penelitian ini menggunakan studi literatur  yaitu mencari referensi teori yang relevan dengan kasus atau permasalahan yang ditemukan  Disinilah peran pembelajaran ppkn sebagai alat dalam pembentukan karakter  terutama meningkatkan kepedulian warga negara indonesia dalam kehidupan bermasyarakat  berbangsa  dan bernegara ', 'pembelajaran pancasila kewarganegaraan ppkn pakai sarana tingkat nasionalisme bentuk jiwa nasionalisme wujud peduli bijak publik warga negara indonesia peran tingkat hidup masyarakat adil makmur sejahtera kuliah pkn teliti tugas mahasiswa video loc letter of concern upload youtube aparat wenang harap ambil publik bijaksana studi literatur cari referensi teori relevan masalah temu peran pembelajaran ppkn alat bentuk karakter tingkat peduli warga negara indonesia hidup masyarakat bangsa negara ', 6),
(157, 'Pemberdyaan nelayan berbasis pendidikan ekonomi dan potensi pesisir di kabupaten minihasa utara	', 'Artikel penelitian ini bertujuan melakukan analisis kebutuhan pemberdayaan nelayan tradisional pesisir di kabupaten minahasa utara propinsi sulawesi utara berbasis pada pendidikan ekonomi dan potensi pesisir  Penelitian ini menggunakan rancangan penelitian deskriptif kualitatif dengan menggunakan metode survey  observasi lapangan  wawancara dan focus group discussion  fgd   Subjek penelitian adalah nelayan pesisir minahasa utara berjumlah    orang nelayan yang tersebar pada   kecamatan yaitu kecamatan likupang timur  kecamatan kema dan kecamatan wori kabupaten minahasa utara yang memiliki kapasitas tangkap   gross ton ke bawah  Hasil analisis kebutuhan di identifkasi dalam observasi  wawancara mendalam serta focus group discussion yang di konfirmasi dengan hasil survey menunjukan     nelayan membutuhkan pengetahuan dan pemahaman mengenai karakteristik  sikap dan prinsi prinsip menjadi seorang wirausahawan sukses yang dapat di implementasikan dalam aktifitas usaha produktif di pesisir      membutuhkan pengetahuan mengenai diversifikasi usaha yang berbasis pada potensi pesisir dan laut  usaha alternatif nelayan       menyatakan bahwa mereka membutuhkan pengetahuan dan pemahaman mengenai pengolahan produk olahan ikan sebagai potensi pesisir dan laut  karena bahan baku yang melimpah      menyatakan membutuhkan literasi mengenai bagaimana membangun kemitraan usaha dan jejaring usaha dengan kelompok usaha yang lain      menyatakan bahwa mereka membutuhkan literasi mengenai pembentukan kelompok usaha bersama  kub  nelayan serta bagaimana mengembangkan kelompok usaha tersebut         nelayan membutuhkan literasi mengenai modal usaha dan tatacara mengakses modal usaha dan     menyatakan bahwa mereka sangat membutuhkan pengetahuan mengelolah uang  merencanakan pengalokasian keuangan dan tata cara menabung yang benar', 'artikel analisis butuh pemberdayaan nelayan tradisional pesisir kabupaten minahasa utara propinsi sulawesi utara basis didik ekonomi potensi pesisir rancang deskriptif kualitatif survey observasi lapang wawancara focus group discussion fgd subjek nelayan pesisir minahasa utara orang nelayan sebar camat camat likupang timur camat kema camat wori kabupaten minahasa utara milik kapasitas tangkap gross ton analisis butuh identifkasi observasi wawancara dalam focus group discussion konfirmasi survey tunjuk nelayan butuh pengetahuan paham karakteristik sikap prinsi prinsip wirausahawan sukses implementasi aktifitas usaha produktif pesisir butuh pengetahuan diversifikasi usaha basis potensi pesisir laut usaha alternatif nelayan butuh pengetahuan paham olah produk olah ikan potensi pesisir laut bahan baku limpah butuh literasi bangun mitra usaha jejaring usaha kelompok usaha butuh literasi bentuk kelompok usaha kub nelayan kembang kelompok usaha nelayan butuh literasi modal usaha tatacara akses modal usaha butuh pengetahuan elo uang rencana alokasi uang tata tabung ', 6),
(159, 'Pengembangan buku pedoman lab alam fakultas ilmu sosial untuk siswa smp	', 'Tujuan penelitian ini adalah menghasilkan buku pedoman laboratorium alam fisik dan sosial fakultas ilmu sosial untuk siswa smp sebagai suplemen dalam pembelajaran ips kelas vii semester Metode penelitian yang digunakan dalam penelitian ini adalah penelitian dan pengembangan research development dengan model d four d models Model ini terdiri dari empat tahap yaitu define pendefinisian design perancangan develop pengembangan dan disseminate penyebaran thiagarajan Kelayakan buku divalidasi oleh ahli materi dan media pembelajaran Skor validasi ahli materi sebesar dan skor validasi ahli media pembelajaran sebesar Berdasarkan hasil ini dapat disimpulkan bahwa buku pedoman laboratorium alam yang dikembangkan telah valid dan layak ', 'hasil buku pedoman laboratorium alam fisik sosial fakultas ilmu sosial siswa smp suplemen pembelajaran ips kelas vii semester kembang research development model four models model tahap define definisi design rancang develop kembang disseminate sebar thiagarajan layak buku divalidasi ahli materi media pembelajaran skor validasi ahli materi skor validasi ahli media pembelajaran dasar simpul buku pedoman laboratorium alam kembang valid layak ', 6),
(162, 'Pentingnya pendidikan informal tentang ekonomi pada keluarga transmigran	', 'Pendidik merupakan bagian yang penting dalam pendidikan  karena pendidik bertanggung jawab dalam membimbing dan membentuk pribadi anak didiknya  Orang tua berperan sebagai pendidik di dalam keluarga sehingga sikap dan tindakannya sehari hari memberi stimulus terhadap tingkah laku anak anak  Kesalahan orang tua dalam mendidik anak dapat mengakibatkan anak dalam per kembangannya tidak mampu mandiri dan sulit menyesuaikan diri dengan lingkungannya  Proses pendidikan ekonomi di lingkungan keluarga  biasanya tidak terprogram dan terjadwal sehingga berlangsungnya bisa terjadi setiap saat dan mungkin bersifat insidental  Pada proses tersebut  keteladanan dan sikap keseharian orang tua serta intensitas komunikasi anak dan orang tua dalam kehidupan berkeluarga menjadi poin penting bagi pendidikan ekonomi dalam keluarga  Selain itu  di dalam kehidupan ekonomi sehari hari tidak terlepas dari masalah uang  maka pendidikan ekonomi dalam keluarga dititikberatkan pada pemahaman tentang nilai uang dan tatanan sikap serta perilaku anak untuk mengatur pemanfaatan uang sesuai dengan prinsip ekonomi yang rasional  Pemahaman akan aktivitas produktif dan ekonomis pada orang tua ini penting dalam pengembangan sikap yang dapat mendorong pencapaian efektifitas dan efisiensi atas aktivitas tersebut yang dilakukan melalui pendidikan ekonomi di lingkungan keluarga  Dengan adanya kesadaran akan pendidikan ekonomi di dalam lingkup keluarga ini diharapkan mampu memperbaiki perekonomian keluarga transmigran ', 'didik penting didik didik tanggung bimbing bentuk pribadi anak didik orang tua peran didik keluarga sikap tindak hari stimulus tingkah laku anak anak salah orang tua didik anak akibat anak kembang mandiri sulit sesuai lingkung proses didik ekonomi lingkung keluarga program jadwal langsung sifat insidental proses teladan sikap keseharian orang tua intensitas komunikasi anak orang tua hidup keluarga poin penting didik ekonomi keluarga hidup ekonomi hari lepas uang didik ekonomi keluarga dititikberatkan paham nilai uang tatanan sikap perilaku anak atur manfaat uang sesuai prinsip ekonomi rasional paham aktivitas produktif ekonomis orang tua penting kembang sikap capai efektifitas efisiensi aktivitas didik ekonomi lingkung keluarga sadar didik ekonomi lingkup keluarga harap baik ekonomi keluarga transmigran ', 6),
(163, 'Peran wisata religi makam gus dur dalam membangun kehidupan sosial ekonomi masyarakat di sekitar pondok pesantren tebuireng jombang	', 'Artikel ini bertujuan untuk mendeskripsikan peran wisata religi makam gus dur dalam membangun kehidupan sosial ekonomi masyarakat sekitar pondok pesantren tebuireng jombang dan menganalisis kehidupan sosial ekonominya  Untuk mencapai tujuan tersebut  maka digunakan pendekatan kualitatif deskriptif  Teknik pengumpulan data yang digunakan adalah observasi  wawancara  dan studi dokumenter  Data dianalisis dengan cara mereduksi data  menyajikan data dan penarikan kesimpulan  Hasil penelitian menunjukkan bahwa wisata religi makam gus dur sangat berperan dalam membangun kehidupan sosial ekonomi masyarakat di sekitar pondok pesantren tebuireng jombang  terutama sejak gus dur dimakamkan di area pondok karena banyaknya peziarah yang datang dari berbagai daerah sehingga masyarakat sekitar dapat memanfaatkan peluang untuk mendirikan macam macam usaha yang berlandaskan prinsip islami  Kehidupan ekonomi di sekitar pondok pesantren tebuireng jombang meningkat  hal ini dapat dilihat semakin banyaknya masyarakat sekitar yang membuka bermacam macam usaha barang maupun jasa dan kehidupan sosial ekonomi mereka pun ikut terbangun dengan adanya interaksi sosial antara pedagang dengan pedagang serta pedagang dengan pembeli ', 'artikel deskripsi peran wisata religi makam gus dur bangun hidup sosial ekonomi masyarakat pondok pesantren tebuireng jombang analisis hidup sosial ekonomi capai dekat kualitatif deskriptif teknik kumpul data observasi wawancara studi dokumenter data analisis reduksi data saji data tarik simpul wisata religi makam gus dur peran bangun hidup sosial ekonomi masyarakat pondok pesantren tebuireng jombang gus dur makam area pondok banyak ziarah daerah masyarakat manfaat luang diri usaha landas prinsip islami hidup ekonomi pondok pesantren tebuireng jombang tingkat banyak masyarakat buka usaha barang jasa hidup sosial ekonomi bangun interaksi sosial dagang dagang dagang beli ', 6),
(166, '  Pengembangan pembelajaran blended learning  Pada generasi z	', 'Setiap generasi mempunyai kepercayaan  nilai  budaya  perspektif  kegemaran  dan kemahiran yang berbeda terhadap kehidupan dan pekerjaan  Generasi yang lahir pada awal tahun     an saat perkembangan teknologi sedemikian pesatnya disebut dengan generasi   z atau net generation  Karakter dari generasi ini sangat peka terhadap teknologi dan komunikasi  artinya mereka memiliki keunggulan dalam bidang informasi dan perkembangan pengetahuan  Sementara para pendidiknya yang lahir pada era sebelumnya masih belum terbiasa dengan hal itu sehingga seringkali pendidik mengaku    gaptek     gagap teknologi   Untuk menyikapi hal tersebut perlu ada inovasi baru dalam proses belajar mengajar sehingga sesuai dengan karakter tersebut  Mengkombinasikan pembelajaran konvensional dengan media komunikasi seperti whatsapp dan google drive merupakan salah satu solusi mudah pembelajaran ips pada generasi z  Peserta didik yang terbiasa berkomunikasi menggunakan jejaring sosial dapat mengakses materi dan rencana pembelajaran yang sudah disusun dengan terstruktur setiap pertemuan  Sehingga mereka dapat membaca atau menyiapkan pertanyaan sebelum pembelajaran dimulai  Proporsi penggunaan e learning pada pembelajaran ini mencapai     sehingga bisa disimpulkan sebagai pembelajaran blended learning  Pembelajaran ini berdiri di atas infrastruktur teknologi informasi dan bisa dilakukan kapanpun dan dimanapun  Jadi pembelajaran blended learning memiliki karakteristik yang terbuka  open   fleksibel  dan dapat terjadi dimana saja ', 'generasi percaya nilai budaya perspektif gemar mahir beda hidup kerja generasi lahir an teknologi pesat generasi net generation karakter generasi peka teknologi komunikasi milik unggul bidang informasi pengetahuan didik lahir era biasa seringkali didik a gaptek gagap teknologi sikap inovasi proses ajar ajar sesuai karakter kombinasi pembelajaran konvensional media komunikasi whatsapp google drive salah solusi mudah pembelajaran ips generasi serta didik biasa komunikasi jejaring sosial akses materi rencana pembelajaran susun struktur temu baca pembelajaran proporsi guna learning pembelajaran capai simpul pembelajaran blended learning pembelajaran diri infrastruktur teknologi informasi mana pembelajaran blended learning milik karakteristik buka open fleksibel ', 6),
(168, '   Integrasi nilai budaya etnis bugis makassar  Dalam proses pembelajaran  Sebagai salah satu strategi menghadapi era  Masyarakat ekonomi asean (mea)   Integrasi nilai budaya etnis bugis makassar  Dalam proses pembelajaran  Sebagai salah satu strategi men', 'Tulisan ini bertujuan untuk mengkaji tentang integrasi nilai budaya etnis bugis makassar dalam pembelajaran geografi sosial sebagai salah satu strategi menghadapi masyarakat ekonomi asean  mea   Nilai budaya lokal merupakan sebuah isu penting yang seharusnya dikaji dalam pembelajaran geografi sosial  Menghadapi baru ini diperlukan berbagai strategi diantaranya dengan mengadopsi nilai budaya lokal dalam proses pembelajaran  Pena naman nilai nilai budaya lokal dalam proses pembelajaran diharapkan akan mengimbangi pengaruh budaya asing yang semakin mewabah di masyarakat kita khususnya sulawesi selatan  Budaya bugis makassar sebagai salah satu budaya lokal yang tumbuh dan berkembang dikalangan masyarakat bugis makassar  memiliki unsur penting yang dapat meningkatkan motivasi belajar peserta didik  yaitu konsep siri    dan pacce  Konsep ini bila dimanfaatkan secara benar dalam proses pembelajaran dapat menjadi pendorong kuat bagi peserta didik untuk meningkatkan prestasi belajarnya', 'tulis kaji integrasi nilai budaya etnis bugis makassar pembelajaran geografi sosial salah strategi hadap masyarakat ekonomi ase a nilai budaya lokal isu penting kaji pembelajaran geografi sosial hadap strategi adopsi nilai budaya lokal proses pembelajaran pena naman nilai nilai budaya lokal proses pembelajaran harap imbang budaya asing wabah masyarakat sulawesi selatan budaya bugis makassar salah budaya lokal tumbuh kembang dikalangan masyarakat bugis makassar milik unsur penting tingkat motivasi ajar serta didik konsep siri pacce konsep manfaat proses pembelajaran dorong kuat serta didik tingkat prestasi ajar ', 6),
(169, '  Mengenang sepuluh tahun bencana industri  Lumpur lapindo dan tindakan kolektif para korban	', 'Artikel ini bertujuan untuk mengenang peristiwa luar biasa yang bernama bencana industri  Bencana ini berlansung cukup lama  di mana sumber semburan belum dapat dihentikan sampai kini  Menelan korban yang cukup banyak  bahkan ada desa yang terhapus dari peta  karena seluruh permukaan luluh lantak diterjang lumpur  Penyelesaian masalah sosialnya baru saja diakhiri setelah pemerintah memberikan talangan uang sebagai pelunasan    ganti rugi     Ganti rugi menjadi istilah yang kontroversial sebab pada dasarnya yang terjadi adalah jual beli  Tentu kedua istilah itu membawa konsekuensi masing masing  yang tentu ada pihak yang diuntungkan sebaliknya ada pula pihak yang dirugikan  Pihak korporasi yang diuntungkan sedangkan para korban yang dirugikan ', 'artikel kenang peristiwa nama bencana industri bencana berlansung sumber sembur henti telan korban desa hapus peta muka luluh lantak terjang lumpur selesai sosial perintah talang uang lunas ganti rugi ganti rugi istilah kontroversial dasar jual beli istilah bawa konsekuensi untung rugi korporasi untung korban rugi ', 6),
(170, '  Pendidik di atas garis  Dalam menyongsong masyarakat ekonomi asean	', 'Pendidik di atas garis menawarkan konsep dasar menuju revolusi mental yang membangun kesadaran menciptakan keteladanan Kemuliaan profesi sebagai pendidik merupakan benteng terdepan kedua setelah orang tua sehingga perlu memiliki sikap sikap pencerahan Tujuan penulisan ini adalah untuk memberikan pengetahuan tentang pendidik di atas garis memberikan gambaran konseptual menjadi pendidik di atas garis dan memberikan pengetahuan sikap pendidik di atas garis dalam menyongsong masyarakat ekonomi asean mea Pendidik di atas garis akan menjadi efektif dalam menyongsong mea karena barometer dari keberhasilan pendidik dilihat dari peserta didik yang dihasilkannya Inti dari konsep pendidik di atas garis harus lebih awal memiliki dan memprak tekkan diri menjadi pendidik di atas garis sehingga menghasilkan peserta didik di atas garis meliputi keterampilan yang bertangungjawab kebebasan solusi kemauan dan pilihan atau yang disingkat dengan terkesimalah Terkait dengan hal tersebut semboyan pendidikan dari ki hajar dewantara sesungguhnya wajib dipahami oleh pendidik di atas garis sehingga mampu memiliki sikap dalam menyongsong mea antara lain ing ngarso sung tulodo ing madya mangun karso tut wuri handayani ', 'didik garis awar konsep dasar revolusi mental bangun sadar cipta teladan mulia profesi didik benteng depan orang tua milik sikap sikap cerah tulis pengetahuan didik garis gambar konseptual didik garis pengetahuan sikap didik garis menyongsong masyarakat ekonomi ase a didik garis efektif menyongsong a barometer hasil didik serta didik hasil inti konsep didik garis milik memprak tekkan didik garis hasil serta didik garis liput terampil bertangungjawab bebas solusi mau singkat kesima kait semboyan didik ki hajar dewantara sungguh wajib paham didik garis milik sikap menyongsong a ing ngarso sung tulodo ing madya mangun karso tut wuri handayani ', 6),
(171, ' Pembelajaran tematik berbasis kearifan lokal  Di sekolah dasar dalam menghadapi  Masyarakat ekonomi asean (mea)	', 'Penulisan ini bertujuan untuk mengungkap peran nilai nilai kearifan lokal dalam menghadapi mea melalui pembelajaran tematik Beberapa penelitian dan pengembangan berbasis kearifan lokal yang telah dilakukan para peneliti terdahulu dimaksudkan untuk memfasilitasi siswa dalam mencapai pembelajaran yang bukan hanya konseptual tetapi juga aplikatif Kearifan lokal menjadi sangat penting mengingat bahwa proses pembelajaran yang terjadi di kelas khususnya pada siswa sekolah dasar sebaiknya dimulai dengan dunia terdekat atau yang sering dijumpai oleh siswa Nilai nilai kearifan lokal akan membantu siswa dalam memahami setiap konsep dalam materi sehingga bekal pengetahuan yang diperoleh siswa tidak hanya sampai pada sebatas pengetahuan saja tetapi juga dapat diimplementasikan siswa dalam wujud praktek di luar sekolah Pembelajaran tematik berbasis kearifan lokal akan menjadi koneksi dalam memahamkan siswa untuk bertindak tepat dalam menghadapi mea Peradaban yang tidak hanya menuntut manusia bukan sekedar serba tahu akan tetapi serba bisa untuk memajukan negara ', 'tulis ungkap peran nilai nilai arif lokal hadap a pembelajaran tematik kembang basis arif lokal teliti fasilitas siswa capai pembelajaran konseptual aplikatif arif lokal penting proses pembelajaran kelas siswa sekolah dasar dunia dekat jumpa siswa nilai nilai arif lokal bantu siswa paham konsep materi bekal pengetahuan  siswa batas pengetahuan implementasi siswa wujud praktek sekolah pembelajaran tematik basis arif lokal koneksi paham siswa tindak hadap a adab tuntut manusia sekedar serba serba maju negara ', 6),
(172, '  Pendidikan karakter kerja sama dalam pembelajaran  Siswa sekolah dasar pada kurikulum 2013	', 'Penulisan ini bertujuan untuk mendeskripsikan pendidikan karakter kerja sama yang terjadi dalam pembelajaran siswa sekolah dasar pada kurikulum       Telaah dilakukan dengan melakukan studi literatur dan studi penda huluan di empat sekolah di kota malang guna menyesuaikan hasil studi literatur dengan keadaan yang terjadi di sekolah  Hasil telaah literatur diketahui bahwa karakter kerja sama mampu meningkatkan kemampuan berinteraksi dan percaya diri siswa  Namun dalam pelaksanaannya ditemukan adanya kendala dari luar dan dalam lingkungan pendidikan  Kendala dari luar berupa perubahan sosial yang mengubah tata nilai  norma  budaya bangsa yang menjadi bebas  sedangkan kendala yang berasal dari dalam lingkungan pendidikan meliputi mind set  kebijakan pendidikan  dan kurikulum  Hal ini sesuai dengan hasil analisis studi pendahuluan dimana pelaksanaan pendidikan karakter pada kurikulum      masih berorientasi pada kemampuan pengetahuan siswa  sedangkan kemampuan sikap dan keterampilan masih belum diintegrasikan secara komprehensif ', 'tulis deskripsi didik karakter kerja pembelajaran siswa sekolah dasar kurikulum telaah studi literatur studi penda hulu sekolah kota malang sesuai studi literatur sekolah telaah literatur karakter kerja tingkat mampu interaksi percaya siswa laksana temu kendala lingkung didik kendala rubah sosial ubah tata nilai norma budaya bangsa bebas kendala asal lingkung didik liput mind set bijak didik kurikulum sesuai analisis studi dahulu laksana didik karakter kurikulum orientasi mampu pengetahuan siswa mampu sikap terampil integrasi komprehensif ', 6);
