(178, '  Praksis lesson study for learning community  Dalam pembelajaran ilmu pengetahuan sosial  Pada sekolah menengah pertama  Melalui kolaborasi kolegial guru dan dosen	', 'Fokus penelitian ini adalah untuk memaparkan dan menganalisis penerapan lesson study for learning community sebagai upaya peningkatan kualitas pembelajaran ips melalui kegiatan lesson study di smpn sumberpucung malang yang didampingi oleh fakultas ilmu sosial universitas negeri malang um Penelitian ini menggunakan pendekatan kualitatif dengan jenis penelitian studi kasus Sumber data utama penelitian ini adalah para guru ips smpn sumberpucung dan dosen fakultas ilmu sosial um yang terlibat dalam kegiatan lesson study di sekolah tersebut Temuan penelitian ini menuntun peneliti untuk menarik dua simpulan Pertama bahwa telah terjadi peningkatan kualitas pembelajaran ips saat pelaksanaan lesson study for learning community di smpn sumberpucung Hal ini dibuktikan dari proses pembelajaran selama empat siklus lesson study Kedua kolaborasi kolegial antara guru dan dosen telah berkontribusi dalam peningkatan kualitas pembelajaran ips di smpn sumberpucung Pola kolaborasi kolegial terwujud saat kegiatan lesson plan dan refleksi sekaligus nampak juga saat open lesson Terjadi hubungan saling belajar dan dialog diantara para guru dengan guru dan antara guru dengan dosen ', 'fokus apar analisis terap lesson study for learning community upaya tingkat pembelajaran ips giat lesson study smpn sumberpucung malang damping fakultas ilmu sosial universitas negeri malang um dekat kualitatif jenis studi sumber data utama guru ips smpn sumberpucung dosen fakultas ilmu sosial um libat giat lesson study sekolah temu tuntun teliti tarik simpul tingkat pembelajaran ips laksana lesson study for learning community smpn sumberpucung bukti proses pembelajaran siklus lesson study kolaborasi kolegial guru dosen kontribusi tingkat pembelajaran ips smpn sumberpucung pola kolaborasi kolegial wujud giat lesson plan refleksi nampak open lesson hubung ajar dialog guru guru guru dosen ', 6),
(180, '  Meningkatkan motivasi belajar siswa  Pada pembelajaran ips  Menggunakan model pembelajaran kooperatif  Tipe group investigation	', 'penelitian ini bertujuan untuk meningkatkan motivasi belajar siswa smp pada pembelajaran ilmu pengetahuan sosial  ips  melalui penerapan model pembelajaran kooperatif tipe group investigation  Metode penelitian yang digunakan dalam penelitian ini adalah penelitian tindakan kelas  ptk  yang dilaksanakan pada siklus i dan siklus ii  Setiap siklus terdiri dari lima pertemuan empat pertemuan di dalam kelas satu pertemuan di luar jam pembelajaran  Jenis tindakan yang dilakukan adalah pembelajaran ips menggunakan model pembelajaran kooperatif tipe group investigation  Hasil penelitian yang dilakukan menunjukkan adanya peningkatan motivasi belajar siswa pada siklus i persentase mencapai     kriteria    tinggi    dan pada siklus ii persentase mencapai     kriteria    sangat tinggi     Terjadi persentase peningkatan sebesar      Dengan demikian model pembelajaran kooperatif group investigation terbukti dapat meningkatkan motivasi belajar siswa pada pembelajaran ips kelas viii h smpn    batu ', 'tingkat motivasi ajar siswa smp pembelajaran ilmu pengetahuan sosial ips terap model pembelajaran kooperatif tipe group investigation tindak kelas ptk laksana siklus siklus i siklus temu temu kelas temu jam pembelajaran jenis tindak pembelajaran ips model pembelajaran kooperatif tipe group investigation tingkat motivasi ajar siswa siklus persentase capai kriteria siklus i persentase capai kriteria persentase tingkat model pembelajaran kooperatif group investigation bukti tingkat motivasi ajar siswa pembelajaran ips kelas viii smpn batu ', 6),
(185, 'Satisfaction level of special education teachers training program  Toward south east asia organized by seameo sen', 'Kajian ini dijalankan untuk mengkaji tahap kepuasan guru pendidikan khas asia tenggara  gpkat  terhadap program latihan regular course  co curricular activities for sen children yang dianjurkan oleh seameo regional center for special education  seameo sen   Aspek yang diberi perhatian dalam kajian ini merangkumi tahap kepuasan gpkat terhadap kemudahan dan perkhidmatan yang disediakan oleh seameo sen  isi kandungan latihan  kaedah latihan dan penilaian gpkat terhadap kualiti fasilitator  Kajian ini melibatkan seramai    orang gpkat yang menghadiri kursus   minggu di seameo sen  Ini adalah kajian tinjauan untuk mendapatkan data kuantitatif dengan menggunakan soal selidik sebagai instrumen kajian  Data telah dianalisis secara diskriptif  Model latihan yang dipelopori oleh silver        telah dijadikan asas bagi mendasari kajian ini di samping teori hierarki keperluan maslow        untuk melihat perkaitan dalam konstruk yang dikaji  Dapatan yang diperolehi dari pada keempat empat aspek yang dikaji adalah seperti berikut  Tahap kepuasan gpkat terhadap aspek kemudahan dan perkhidmatan yang disediakan memperolehi nilai min      diikuti tahap kepuasan bagi isi kandungan latihan min       manakala      pula adalah min purata bagi kaedah latihan dan min bagi kualiti fasilitator adalah sebanyak       Secara keseluruhannya  dapatan ini menunjukkan tahap kepuasan gpkat adalah tinggi dengan min purata adalah       maka dapat disimpulkan bahawa gpkat sangat berpuas hati dengan program latihan yang telah dianjurkan oleh seameo sen ', 'kaji jalan kaji tahap puas guru didik khas asia tenggara gpkat program latih regular course co curricular activities for sen children dianjurkan seameo regional center for special education seameo sen aspek hati kaji rangkum tahap puas gpkat mudah khidmat sedia seameo sen isi kandung latih kaedah latih nilai gpkat kualiti fasilitator kaji libat serama orang gpkat hadir kursus minggu seameo sen kaji tinjau data kuantitatif selidik instrumen kaji data analisis diskriptif model latih pelopor silver jadi asas dasar kaji samping teori hierarki perlu maslow kait konstruk kaji dapat oleh empat aspek kaji tahap puas gpkat aspek mudah khidmat sedia oleh nilai min ikut tahap puas isi kandung latih min min purata kaedah latih min kualiti fasilitator dapat tahap puas gpkat min purata simpul bahawa gpkat puas hati program latih dianjurkan seameo sen ', 4),
(186, ' Satisfaction level of special education teachers training program  Toward south east asia organized by seameo sen', 'Kemahiran sosial adalah salah satu permasalahan yang dialami oleh Murid Berkeperluan Pendidikan Khas  MBK  ketidakupayaan penglihatan akibat ketiadaan persepsi visual  Objektif kajian ini dijalankan adalah untuk meninjau tahap kemahiran sosial MBK ketidakupayaan penglihatan dari persepsi guru  Selain itu  kajian ini juga meninjau tahap pencapaian akademik MBK ketidakupayaan penglihatan melalui keputusan Ujian Pencapaian Sekolah Rendah  UPSR  dan melihat hubungannya dengan kemahiran sosial murid  Sampel kajian terdiri daripada    orang MBK ketidakupayaan penglihatan tahun enam program pendidikan khas integrasi dan Sekolah Pendidikan Khas Cacat Penglihatan dari tujuh buah negeri  Instrumen kajian ialah satu set borang soal selidik yang ditadbir ke atas guru yang mengajar sampel  Data dianalisis menggunakan statistik deskriptif yang melibatkan skor min dan sisihan piawai serta analisis inferensi Korelasi Spearman  Dapatan kajian menunjukkan persepsi guru terhadap kemahiran sosial MBK ketidakupayaan penglihatan tahun enam adalah tinggi  Selain itu  didapati pencapaian akademik MBK ketidakupayaan penglihatan adalah rendah  Analisis inferensi pekali Korelasi Spearman mendapati hubungan positif yang sangat lemah dan tidak signifikan antara kemahiran sosial dan pencapaian akademik  Dapatan kajian ini menjadi indikator kepada komuniti pendidikan khas ketidakupayaan penglihatan bahwa berbagai usaha perlu dilakukan untuk memperbaiki pencapaian akademik golongan ini ', 'mahir sosial salah masalah alami murid berkeperluan didik khas mbk ketidakupayaan lihat tiada persepsi visual objektif kaji jalan tinjau tahap mahir sosial mbk ketidakupayaan lihat persepsi guru kaji tinjau tahap capai akademik mbk ketidakupayaan lihat uji capai sekolah rendah upsr hubung mahir sosial murid sampel kaji orang mbk ketidakupayaan lihat enam program didik khas integrasi sekolah didik khas cacat lihat tujuh buah negeri instrumen kaji set borang selidik tadbir guru ajar sampel data analisis statistik deskriptif libat skor min sisih piawai analisis inferensi korelasi spearman dapat kaji persepsi guru mahir sosial mbk ketidakupayaan lihat enam dapat capai akademik mbk ketidakupayaan lihat rendah analisis inferensi kali korelasi spearman dapat hubung positif lemah signifikan mahir sosial capai akademik dapat kaji indikator komuniti didik khas ketidakupayaan lihat usaha baik capai akademik golong ', 4),
(187, ' Interactive animation multimedia for knowing the words (cv+cv) for student  With learning disabilities	', 'Kajian ini mengenai pembangunan modul pengajaran dan pembelajaran  p p  yang berbantukan kepada penggunaan komputer multimedia animasi interaktif  Tujuan kajian ini ialah untuk menjawab beberapa persoalan kajian iaitu  untuk meningkatkan minat dan motivasi pelajar pendidikan khas dan untuk memudahkan pelajar mengenal suku kata  kv kv   Proses membangunkan perisian ini adalah berdasarkan kepada model addie yang mempunyai lima fasa iaitu    analysis        design        development        implementation    dan    evaluation     Pemilihan tajuk mengenal suku kata  kv kv  adalah untuk membantu pelajar pelajar pendidikan khas dalam proses membaca  Proses kajian ini menggunakan teori pembelajaran multimedia oleh mayer  dan teori ini juga adalah berdasarkan kepada teori beban kongnitif sweller   chandler   sweller    Kajian ini menggunakan kaedah kualitatif dan reka bentuk kajian ialah kajian kes  Sampel dalam kajian ini ialah seramai   orang pelajar yang dipilih secara sampel bertujuan yang telah dibentuk dalam satu kumpulan iaitu kumpulan a  Instrumen kajian yang digunakan ialah ujian pra  ujian pos dan soal selidik  Dapatan kajian telah mendapati bahwa terdapat peningkatan pencapaian dalam ujian pra dan ujian pos yang menggunakan kaedah multimedia bagi kumpulan a iaitu sebanyak          Pembelajaran yang menggunakan kaedah multimedia animasi interaktif bukan sahaja dapat menarik minat dan memberi motivasi kepada pelajar  secara tidak langsung juga pelajar pendidikan khas ini dapat membaca ', 'kaji bangun modul ajar pembelajaran bantu guna komputer multimedia animasi interaktif kaji kaji iaitu tingkat minat motivasi ajar didik khas mudah ajar kenal suku kv kv proses bangun risi dasar model addie fasa iaitu analysis design development implementation evaluation tajuk kenal suku kv kv bantu ajar ajar didik khas proses baca proses kaji teori pembelajaran multimedia mayer teori dasar teori beban kongnitif sweller chandler sweller kaji kaedah kualitatif reka bentuk kaji kaji kes sampel kaji serama orang ajar pilih sampel bentuk kumpul iaitu kumpul instrumen kaji uji pra uji pos selidik dapat kaji dapat tingkat capai uji pra uji pos kaedah multimedia kumpul iaitu pembelajaran kaedah multimedia animasi interaktif sahaja tarik minat motivasi ajar langsung ajar didik khas baca ', 4),
(188, 'Teachers Perception on Social Skills of Students with Visual Impairments and its Relation with Academic Achievements	', 'Kemahiran sosial adalah salah satu permasalahan yang dialami oleh Murid Berkeperluan Pendidikan Khas  MBK  ketidakupayaan penglihatan akibat ketiadaan persepsi visual  Objektif kajian ini dijalankan adalah untuk meninjau tahap kemahiran sosial MBK ketidakupayaan penglihatan dari persepsi guru  Selain itu  kajian ini juga meninjau tahap pencapaian akademik MBK ketidakupayaan penglihatan melalui keputusan Ujian Pencapaian Sekolah Rendah  UPSR  dan melihat hubungannya dengan kemahiran sosial murid  Sampel kajian terdiri daripada    orang MBK ketidakupayaan penglihatan tahun enam program pendidikan khas integrasi dan Sekolah Pendidikan Khas Cacat Penglihatan dari tujuh buah negeri  Instrumen kajian ialah satu set borang soal selidik yang ditadbir ke atas guru yang mengajar sampel  Data dianalisis menggunakan statistik deskriptif yang melibatkan skor min dan sisihan piawai serta analisis inferensi Korelasi Spearman  Dapatan kajian menunjukkan persepsi guru terhadap kemahiran sosial MBK ketidakupayaan penglihatan tahun enam adalah tinggi  Selain itu  didapati pencapaian akademik MBK ketidakupayaan penglihatan adalah rendah  Analisis inferensi pekali Korelasi Spearman mendapati hubungan positif yang sangat lemah dan tidak signifikan antara kemahiran sosial dan pencapaian akademik  Dapatan kajian ini menjadi indikator kepada komuniti pendidikan khas ketidakupayaan penglihatan bahawa pelbagai usaha perlu dilakukan untuk memperbaiki pencapaian akademik golongan ini ', 'mahir sosial salah masalah alami murid berkeperluan didik khas mbk ketidakupayaan lihat tiada persepsi visual objektif kaji jalan tinjau tahap mahir sosial mbk ketidakupayaan lihat persepsi guru kaji tinjau tahap capai akademik mbk ketidakupayaan lihat uji capai sekolah rendah upsr hubung mahir sosial murid sampel kaji orang mbk ketidakupayaan lihat enam program didik khas integrasi sekolah didik khas cacat lihat tujuh buah negeri instrumen kaji set borang selidik tadbir guru ajar sampel data analisis statistik deskriptif libat skor min sisih piawai analisis inferensi korelasi spearman dapat kaji persepsi guru mahir sosial mbk ketidakupayaan lihat enam dapat capai akademik mbk ketidakupayaan lihat rendah analisis inferensi kali korelasi spearman dapat hubung positif lemah signifikan mahir sosial capai akademik dapat kaji indikator komuniti didik khas ketidakupayaan lihat bahawa pelbagai usaha baik capai akademik golong ', 4),
(189, ' Communicating by using pecs for children with rubinstein-taybi syndrome	', 'Kajian ini membincangkan mengenai bantuan komunikasi menggunakan picture exchange communication system  pecs  kepada kanak kanak sindrom rubinstein taybi  rts   Kanak kanak rts ini mengalami kerencatan akal  memiliki ciri     ciri autisme  tidak boleh bertutur dan tidak boleh urus diri dengan baik  Tujuan kajian ini adalah untuk melihat keberkesanan menggunakan pecs dan murid rts dapat meningkatkan penguasaan bahasa untuk berkomunikasi dengan lebih baik kepada semua  Berdasarkan teori konstruktivisme yang diperkenalkan oleh gagne yang menekankan sistem pembelajaran harus bermula dari pada yang mudah kepada yang rumit  Rekabentuk kajian ini berbentuk kajian kes terhadap seorang kanak kanak yang mengalami sindrom rubinstein taybi  Kesimpulannya  diharapkan dengan adanya pecs yang dilaksanakan dapat membantu kanak kanak rts ini serta meningkatkan prestasi akademik mereka ', 'kaji bincang bantu komunikasi picture exchange communication system pecs kanak kanak sindrom rubinstein taybi rts kanak kanak rts alami rencat akal milik ciri ciri autisme urus kaji kesan pecs murid rts tingkat kuasa bahasa komunikasi dasar teori konstruktivisme kenal gagne tekan sistem pembelajaran mudah rumit rekabentuk kaji bentuk kaji kes kanak kanak alami sindrom rubinstein taybi simpul harap pecs laksana bantu kanak kanak rts tingkat prestasi akademik ', 4),
(190, '  Teaching and learning using software let''s reading for malay language subjects for students with learning disabilities	', 'Proses pembelajaran dan pengajaran yang aktif dan pelbagai dapat menarik minat murid untuk belajar  Terutamanya murid bermasalah pembelajaran yang memerlukan kaedah khusus bagi membantu proses pembelajaran mereka agar lebih menarik  Oleh itu  kajian ini dijalankan yang lebih tertumpu kepada pengajaran dan pembelajaran menggunakan perisian kursus    jom bacalah    yang menggunakan kaedah membaca menggunakan kaedah sebut suku kata yang mempunyai ciri ciri yang dapat membantu murid bermasalah pembelajaran untuk belajar bahasa melayu  Responden kajian terdiri daripada enam murid bermasalah pembelajaran aras sederhana yang sedang belajar di sebuah sekolah menengah di kuala lumpur  Satu borang pemantauan kursus adaptasi daripada kajian davis et al         dan sidek et al         dengan sedikit pengubahsuaian telah digunakan sebagai instrumen bagi menilai kajian ini  Selain itu  ujian lisan dijalankan sebelum dan selepas penggunaan perisian dijalankan  Dapatan kajian dianalisis menggunakan kaedah kuantitatif  Hasil kajian mendapati perisian yang telah dibangunkan dengan berpandukan kepada pembangunan model assure ini mampu menarik minat murid bermasalah pembelajaran untuk belajar bahasa melayu  Selain itu  kanak kanak ini juga menunjukkan peningkatan dalam bacaan ', 'proses pembelajaran ajar aktif pelbagai tarik minat murid ajar utama murid masa pembelajaran kaedah khusus bantu proses pembelajaran tarik kaji jalan tumpu ajar pembelajaran risi kursus jom baca kaedah baca kaedah suku ciri ciri bantu murid masa pembelajaran ajar bahasa layu responden kaji enam murid masa pembelajaran aras sederhana ajar sekolah tengah kuala lumpur borang pantau kursus adaptasi kaji davis et al sidek et al pengubahsuaian instrumen nilai kaji uji lisan jalan lepas guna risi jalan dapat kaji analisis kaedah kuantitatif kaji dapat risi bangun pandu bangun model assure tarik minat murid masa pembelajaran ajar bahasa layu kanak kanak tingkat baca ', 4),
(191, 'Persepsi mahasiswa terhadap pendidikan moral siswa	', 'Mengacu pada tujuan pendidikan nasional bahwasannya mata pelajaran ppkn mempersiapkan siswa untuk menjadi warga negara yang baik  Pendidikan moral merupakan salah satu elemen dalam kajian bidang mata pelajaran ppkn yang wajib diberikan kepada siswa sebagai pedoman dalam terjun di masyarakat mahasiswa prodi ppkn dipersiapkan sebagai calon pendidik yang mampu mengintegrasikan berbagai aspek dalam permasalahan kewarganegaraan maupun permasalahan sosial tidak lepas dari peran mahasiswa prodi ppkn tersebut  maka diperlukan pemahaman bagi setiap mahasiswa dalam mengetahui sejauh mana peran pendidikan moral bagi siswa tujuan penelitian ini adalah untuk memahami dan mengetahui persepsi mahasiswa prodi ppkn fkip universitas muhammadiyah ponorogo terhadap pendidikan moral siswa di kabupaten ponorogo metode penelitian yang digunakan dalam penelitian ini adalah deskriptif kualitatif  Dapat disimpulkan bahwa persepsi mahasiswa tentang pendidikan moral yang terdiri dari tiga aspek utama yaitu pendidikan moral siswa terkait akhlak terhadap tuhan yme  akhlak terhadap sesama manusia  dan akhlak terhadap lingkungan menunjukkan bahwa untuk moral siswa terhadap tuhan dan sesama manusia dikatakan sudah cukup baik dan pendidikan moral sudah terlaksana sebagaimana mestinya  Sedangkan untuk pendidikan moral siswa terkait akhlak terhadap lingkungan menunjukkan bahwa masih berada pada taraf yang kurang dan perlu untuk ditingkatkan lagi khususnya bagi beberapa pihak yang terkait ', 'acu didik nasional bahwasannya mata ajar ppkn siswa warga negara didik moral salah elemen kaji bidang mata ajar ppkn wajib siswa pedoman terjun masyarakat mahasiswa prodi ppkn siap calon didik integrasi aspek masalah kewarganegaraan masalah sosial lepas peran mahasiswa prodi ppkn paham mahasiswa peran didik moral siswa paham persepsi mahasiswa prodi ppkn fkip universitas muhammadiyah ponorogo didik moral siswa kabupaten ponorogo deskriptif kualitatif simpul persepsi mahasiswa didik moral aspek utama didik moral siswa kait akhlak tuhan yme akhlak manusia akhlak lingkung moral siswa tuhan manusia didik moral laksana mesti didik moral siswa kait akhlak lingkung taraf tingkat kait ', 5),
(192, '  Mitigasi bencana gempa bumi berbasis kearifan lokal masyarakat rote kabupaten rote ndao  Provinsi nusa tenggara timur	', 'Penelitian ini bertujuan untuk menemukan pengetahuan lokal masyarakat rote ndao menghadapi gempabumi  Metode penelitian yang digunakan adalah metode kualitatif yang difokuskan pada penggalian informasi tentang pengetahuan dan pengalaman masyarakat rote ndao di kabupaten rote ndao dalam menghadapi bencana gempabumi  Penelitian ini dilakukan di dua tempat  yaitu di desa mukebuku dan desa lakamola kecamatan rote timur kabupaten rote ndao  Dalam penelitian ini dilibatkan    orang sebagai informan  yang ditentukan dengan cara bola salju dan disertai dengan kesediaan mereka terlibat dalam penelitian ini  Hasil penelitian sebagai berikut  Pertama  masyarakat rote ndao tidak memiliki pengetahuan tentang gempabumi  mereka hanya memiliki mitos tentang gempabumi  Mitos bagi mereka adalah untuk mendekatkan warga masyarakat pada inti kehidupannya atau pada jatidirinya yang sejati  berkat mitos  setiap warga akan dapat bertemu  dengan dirinya sendiri yang khas  sekaligus pada saat yang sama pula mereka akan berjumpa dengan manusia sesama juga alam semesta  dan yang ilahi  Mitos memberi inspirasi kepada manusia untuk memelihara serta mengembangkan sebuah keserasian hidup bersama dalam tatanan masyarakat  antara makro kosmos  mikro kosmos dan yang tak kelihatan  Kedua  pengalaman masyarakat rote ndao dalam menghadapi bencana gempabumi  mereka menggunakan kearifan lokal  berteriak ketika berlangsung gempa ami nai ia o    Mereka gembira karena adanya keyakinan bahwa tahun yang sedang berjalan akan mendatangkan kesuburan tanah dan panen pertanian akan melimpah  Perasaan senasiblah yang menggerakkan manusia untuk sadar akan makna kolektivitasnya sebagai makluk sosial  Dalam hal ini  gempa yang meluluhlantakan kehidupan masyarakat silam telah menyemaikan benih solidaritas dan kesetiakawanan  Ketiga  masyarakat rote ndao tidak memiliki pengetahuan tentang mitigasi bencana gempabumi  pengalamannya adalah dengan menggunakan kearifan lokal ', 'temu pengetahuan lokal masyarakat rote ndao hadap gempabumi kualitatif fokus gali informasi pengetahuan pengalaman masyarakat rote ndao kabupaten rote ndao hadap bencana gempabumi desa mukebuku desa lakamola camat rote timur kabupaten rote ndao libat orang informan tentu bola salju serta sedia libat masyarakat rote ndao milik pengetahuan gempabumi milik mitos gempabumi mitos dekat warga masyarakat inti hidup jatidirinya sejati berkat mitos warga bertemu khas jumpa manusia alam semesta ilahi mitos inspirasi manusia pelihara kembang serasi hidup tatanan masyarakat makro kosmos mikro kosmos pengalaman masyarakat rote ndao hadap bencana gempabumi arif lokal teriak gempa ami na gembira yakin jalan subur tanah panen tani limpah rasa nasib gerak manusia sadar makna kolektivitas makluk sosial gempa meluluhlantakan hidup masyarakat silam semai benih solidaritas kesetiakawanan tiga masyarakat rote ndao milik pengetahuan mitigasi bencana gempabumi pengalaman arif lokal ', 6),
(193, '   Pembelajaran berbasis karakter  Untuk meningkatkan daya saing dalam era global  Bagi siswa di daerah terdepan, terluar, dan tertinggal  (studi kasus di kalimantan utara, sulawesi utara, ntt, dan papua)	', 'Indonesia terdiri dari berbagai wilayah yang dipisahkan oleh selat dan laut  baik pulau pulau terdepan dan terluar maupun daerah daerah tertinggal   t   Hal ini menjadi penyebab sulitnya upaya pemerataan pembangunan  karena jauhnya jarak yang harus ditempuh untuk mencapai pusat pemerintahan  Kondisi ini menyebabkan kualitas pen didikan tidak merata  Dengan demikian  sangat dibutuhkan peningkatan kualitas pendidikan di pulau pulau terde pan  terluar  dan daerah tertinggal melalui pendidikan karakter bagi siswa  Akan tetapi  realita di lapangan belum sesuai dengan kondisi yang seharusnya  Tulisan ini bertujuan untuk mengidentifikasi kondisi siswa di daerah terdepan  terluar  dan tertinggal serta menganalisis pembelajaran berbasis karakter yang sesuai diterapkan kepada siswa demi meningkatkan daya saing dalam era global di daerah terdepan terluar  dan tertinggal  Data diperoleh melalui observasi  wawancara  dan dokumentasi dan dianalisis secara deskriptif  Hasil menunjukkan bahwa karakter siswa di daerah terdepan  terluar  dan tertinggal adalah kurangnya rasa cinta tanah air  kerja keras  kreatif  tanggung jawab  disiplin  dan gemar membaca  Pembelajaran berbasis karakter yang tepat diterapkan bagi siswa di daerah  t adalah pengintegrasian pendidikan karakter dalam budaya sekolah dan matapelajaran  seperti pen ingkatan rasa cinta tanah air melalui penggunaan bahasa indonesia yang baik dan benar dalam setiap pembelajaran dan selalu memulai pembelajaran dengan meyanyikan lagu nasional  Adapun rendahnya karakter kerja keras dapat ditingkatkan melalui pemberian motivasi tentang pentingnya belajar dan sekolah bagi masa depan siswa', 'indonesia wilayah pisah selat laut pulau pulau depan luar daerah daerah tinggal sebab sulit upaya erata bangun jauh jarak tempuh capai pusat perintah sebab pen didik rata butuh tingkat didik pulau pulau de pan luar daerah tinggal didik karakter siswa realita lapang sesuai tulis identifikasi siswa daerah depan luar tinggal analisis pembelajaran basis karakter sesuai terap siswa tingkat daya saing era global daerah depan luar tinggal data observasi wawancara dokumentasi analisis deskriptif karakter siswa daerah depan luar tinggal kurang cinta tanah air kerja keras kreatif tanggung disiplin gemar baca pembelajaran basis karakter terap siswa daerah integrasi didik karakter budaya sekolah matapelajaran pen ingkatan cinta tanah air guna bahasa indonesia pembelajaran pembelajaran meyanyikan lagu nasional rendah karakter kerja keras tingkat beri motivasi ajar sekolah siswa ', 6);
